at, sans-serif;\"><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">Specjalna promocja na darmową dostawę od 79 zł do ORLEN Paczka (ponad 10 tys. punktów odbioru):</span><span style=\"margin:0px;padding:0px;border:0px;font-size:10pt;background:transparent;\"> </span></p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\"><span style=\"margin:0px;padding:0px;border:0px;font-size:10pt;background:transparent;\">Użyj poniższego kodu rabatowego i ciesz się darmową wysyłką.</span></p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\"><span style=\"margin:0px;padding:0px;border:0px;font-size:10pt;background:transparent;\">Kod: <span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">FREE</span></span></p>','promocje-specjalne'),(7,1,1,'Regulamin','','','','','regulamin'),(7,2,1,'Regulamin','Geekup - Regulamin','Geekup - Regulamin','regulamin','<h1 class=\"document-heading center\" style=\"margin:0.67em 0px;padding:0px;border:0px;background:#ffffff;font-family:Montserrat, sans-serif;line-height:1.4em;text-align:center;\">Regulamin sklepu internetowego GeekUp.pl - Figurki Funko POP, gadżety filmowe, gadżety z gier, komiksów i bajek</h1>\n<p class=\"center\" style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;text-align:center;font-family:Montserrat, sans-serif;\">Dokument określa przede wszystkim zasady, na jakich zawierane są umowy w Sklepie, w tym przedstawia ważne informacje o Sprzedawcy, Sklepie oraz przysługujących Konsumentom prawach.</p>\n<p><br style=\"font-family:Montserrat, sans-serif;font-size:14px;background-color:#ffffff;\" /><br style=\"font-family:Montserrat, sans-serif;font-size:14px;background-color:#ffffff;\" /></p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\"><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">SPIS TREŚCI</span><br /><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">§ 1</span> Definicje<br /><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">§ 2</span> Kontakt ze Sprzedawcą<br /><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">§ 3</span> Wymogi techniczne<br /><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">§ 4</span> Zakupy w Sklepie<br /><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">§ 5</span> Płatności<br /><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">§ 6</span> Realizacja zamówienia<br /><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">§ 7</span> Prawo odstąpienia od umowy<br /><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">§ 8</span> Wyjątki od prawa odstąpienia od umowy<br /><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">§ 9</span> Reklamacje<br /><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">§ 10</span> Dane osobowe<br /><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">§ 11</span> Zastrzeżenia<br /><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">Załącznik nr 1:</span> Wzór formularza odstąpienia od umowy</p>\n<h2 style=\"margin:0.83em 0px 0.7em;padding:0px;border:0px;background:#ffffff;font-family:Montserrat, sans-serif;line-height:1.4em;\">§ 1 DEFINICJE</h2>\n<p><span style=\"margin:0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-weight:bold;font-family:Montserrat, sans-serif;\">Dni robocze</span><span style=\"font-family:Montserrat, sans-serif;font-size:14px;background-color:#ffffff;\"> – dni od poniedziałku do piątku za wyjątkiem dni ustawowo wolnych od pracy w Polsce.</span><br style=\"font-family:Montserrat, sans-serif;font-size:14px;background-color:#ffffff;\" /><span style=\"margin:0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-weight:bold;font-family:Montserrat, sans-serif;\">Konsument</span><span style=\"font-family:Montserrat, sans-serif;font-size:14px;background-color:#ffffff;\"> – Kupujący będący osobą fizyczną, kupujący w Sklepie lub podejmujący czynności zmierzające do dokonania zakupu, bez bezpośredniego związku z jego działalnością gospodarczą lub zawodową.</span><br style=\"font-family:Montserrat, sans-serif;font-size:14px;background-color:#ffffff;\" /><span style=\"margin:0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-weight:bold;font-family:Montserrat, sans-serif;\">Konto</span><span style=\"font-family:Montserrat, sans-serif;font-size:14px;background-color:#ffffff;\"> – uregulowana odrębnym regulaminem usługa cyfrowa w rozumieniu Ustawy o prawach konsumenta, dzięki której Kupujący może nieodpłatnie skorzystać z dodatkowych funkcji w Sklepie.</span><br style=\"font-family:Montserrat, sans-serif;font-size:14px;background-color:#ffffff;\" /><span style=\"margin:0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-weight:bold;font-family:Montserrat, sans-serif;\">Kupujący</span><span style=\"font-family:Montserrat, sans-serif;font-size:14px;background-color:#ffffff;\"> – każdy podmiot kupujący w Sklepie lub podejmujący czynności zmierzające do dokonania zakupu.</span><br style=\"font-family:Montserrat, sans-serif;font-size:14px;background-color:#ffffff;\" /><span style=\"margin:0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-weight:bold;font-family:Montserrat, sans-serif;\">Kupujący uprzywilejowany</span><span style=\"font-family:Montserrat, sans-serif;font-size:14px;background-color:#ffffff;\"> – Konsument lub Przedsiębiorca uprzywilejowany.</span><br style=\"font-family:Montserrat, sans-serif;font-size:14px;background-color:#ffffff;\" /><span style=\"margin:0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-weight:bold;font-family:Montserrat, sans-serif;\">Przedsiębiorca uprzywilejowany</span><span style=\"font-family:Montserrat, sans-serif;font-size:14px;background-color:#ffffff;\"> – Kupujący będący osobą fizyczną, zawierający lub zamierzający zawrzeć ze Sprzedawcą umowę na podstawie Regulaminu bezpośrednio związaną z jego działalnością gospodarczą, ale nieposiadającą dla niego charakteru zawodowego.</span><br style=\"font-family:Montserrat, sans-serif;font-size:14px;background-color:#ffffff;\" /><span style=\"margin:0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-weight:bold;font-family:Montserrat, sans-serif;\">Regulamin</span><span style=\"font-family:Montserrat, sans-serif;font-size:14px;background-color:#ffffff;\"> – niniejszy regulamin.</span><br style=\"font-family:Montserrat, sans-serif;font-size:14px;background-color:#ffffff;\" /><span style=\"margin:0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-weight:bold;font-family:Montserrat, sans-serif;\">Sklep</span><span style=\"font-family:Montserrat, sans-serif;font-size:14px;background-color:#ffffff;\"> – sklep internetowy GeekUp.pl - Figurki Funko POP, gadżety filmowe, gadżety z gier, komiksów i bajek prowadzony przez Sprzedawcę pod adresem https://geekup.pl.</span><br style=\"font-family:Montserrat, sans-serif;font-size:14px;background-color:#ffffff;\" /><span style=\"margin:0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-weight:bold;font-family:Montserrat, sans-serif;\">Sprzedawca</span><span style=\"font-family:Montserrat, sans-serif;font-size:14px;background-color:#ffffff;\"> – Łukasz Marcinkowski, przedsiębiorca prowadzący działalność gospodarczą pod firmą Smooth Sport Łukasz Marcinkowski, wpisany do Centralnej Ewidencji i Informacji o Działalności Gospodarczej prowadzonej przez ministra właściwego do spraw gospodarki i prowadzenia Centralnej Ewidencji i Informacji o Działalności Gospodarczej, NIP 5342423841, nr REGON 142004657, Cicha 3, 05-090 Raszyn.</span><br style=\"font-family:Montserrat, sans-serif;font-size:14px;background-color:#ffffff;\" /><span style=\"margin:0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-weight:bold;font-family:Montserrat, sans-serif;\">Treści cyfrowe</span><span style=\"font-family:Montserrat, sans-serif;font-size:14px;background-color:#ffffff;\"> - dane wytwarzane i dostarczane w postaci cyfrowej.</span><br style=\"font-family:Montserrat, sans-serif;font-size:14px;background-color:#ffffff;\" /><span style=\"margin:0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-weight:bold;font-family:Montserrat, sans-serif;\">Ustawa o prawach konsumenta</span><span style=\"font-family:Montserrat, sans-serif;font-size:14px;background-color:#ffffff;\"> – polska ustawa z dnia 30 maja 2014 r. o prawach konsumenta.</span></p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\">Postanowienia Regulaminu dotyczące produktów mają zastosowanie zarówno do rzeczy ruchomych (towarów), jak i Treści cyfrowych.</p>\n<h2 style=\"margin:0.83em 0px 0.7em;padding:0px;border:0px;background:#ffffff;font-family:Montserrat, sans-serif;line-height:1.4em;\">§ 2 KONTAKT ZE SPRZEDAWCĄ</h2>\n<ol style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;font-size:14px;background:#ffffff;list-style-position:outside;font-family:Montserrat, sans-serif;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Adres pocztowy: Cicha 3, 05-090 Raszyn</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Adres e-mail: sklep@geekup.pl</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Telefon: 533121806</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Koszt połączenia telefonicznego lub transmisji danych wykonywanych przez Kupującego wynika z podstawowej taryfy operatora telekomunikacyjnego lub dostawcy usług internetowych, z którego usług korzysta Kupujący. Sprzedawca zwraca uwagę, że koszt połączenia międzynarodowego lub międzynarodowej transmisji danych może być wyższy niż koszt połączenia lub transmisji krajowej – w zależności od taryfy przyjętej przez operatora telekomunikacyjnego lub dostawcę usług internetowych, z usług którego korzysta Kupujący.</li>\n</ol>\n<h2 style=\"margin:0.83em 0px 0.7em;padding:0px;border:0px;background:#ffffff;font-family:Montserrat, sans-serif;line-height:1.4em;\">§ 3 WYMOGI TECHNICZNE</h2>\n<ol style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;font-size:14px;background:#ffffff;list-style-position:outside;font-family:Montserrat, sans-serif;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Dla prawidłowego funkcjonowania Sklepu potrzebne jest:\n<ul style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;background:transparent;list-style:disc;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">urządzenie z dostępem do Internetu</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">przeglądarka internetowa obsługująca JavaScript oraz pliki cookies.</li>\n</ul>\n</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Dla złożenia zamówienia w Sklepie, poza wymogami określonymi w ust. 1, niezbędne jest aktywne konto e-mail.</li>\n</ol>\n<h2 style=\"margin:0.83em 0px 0.7em;padding:0px;border:0px;background:#ffffff;font-family:Montserrat, sans-serif;line-height:1.4em;\">§ 4 ZAKUPY W SKLEPIE</h2>\n<ol style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;font-size:14px;background:#ffffff;list-style-position:outside;font-family:Montserrat, sans-serif;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Ceny produktów widoczne w Sklepie są całkowitymi cenami za produkt.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Sprzedawca zwraca uwagę, że na całkowitą cenę zamówienia składają się wskazane w Sklepie: cena za produkt oraz, jeśli w danym przypadku ma to zastosowanie, koszty dostawy towaru.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Wybrany do kupienia produkt należy dodać do koszyka w Sklepie.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Następnie Kupujący wybiera sposób dostawy towaru oraz metodę płatności za zamówienie spośród dostępnych w Sklepie opcji, a także podaje dane niezbędne do zrealizowania złożonego zamówienia.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Zamówienie zostaje złożone w momencie potwierdzenia jego treści i zaakceptowania Regulaminu przez Kupującego.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Złożenie zamówienia jest tożsame z zawarciem umowy pomiędzy Kupującym a Sprzedawcą.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Kupujący może zarejestrować się w Sklepie, tj. założyć w nim Konto, lub dokonywać zakupów bez rejestracji poprzez podawanie swoich danych przy każdym ewentualnym zamówieniu.</li>\n</ol>\n<h2 style=\"margin:0.83em 0px 0.7em;padding:0px;border:0px;background:#ffffff;font-family:Montserrat, sans-serif;line-height:1.4em;\">§ 5 PŁATNOŚCI</h2>\n<ol style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;font-size:14px;background:#ffffff;list-style-position:outside;font-family:Montserrat, sans-serif;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">W Sklepie dostępne są następujące metody płatności:\n<ol type=\"a\" style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;background:transparent;list-style-position:outside;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">zwykły przelew na rachunek bankowy Sprzedawcy;</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">za pomocą karty płatniczej:\n<ul style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;background:transparent;list-style:disc;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Visa</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Visa Electron</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">MasterCard</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">MasterCard Electronic</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Maestro</li>\n</ul>\n</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">za pośrednictwem platformy płatniczej:\n<ul style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;background:transparent;list-style:disc;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Płatności Shoper</li>\n</ul>\n</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">za pobraniem, tj. gotówką w momencie dostarczenia towaru do Kupującego;</li>\n</ol>\n</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">W przypadku wybrania płatności za pośrednictwem platformy płatniczej Płatności Shoper, podmiotem świadczącym obsługę płatności online jest Autopay S.A.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">W przypadku wybrania przez Kupującego płatności z góry, za zamówienie należy zapłacić w terminie 7 Dni roboczych od złożenia zamówienia.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Dokonując zakupów w Sklepie, Kupujący akceptuje stosowanie faktur elektronicznych przez Sprzedawcę. Kupujący ma prawo wycofać swoją akceptację.</li>\n</ol>\n<h2 style=\"margin:0.83em 0px 0.7em;padding:0px;border:0px;background:#ffffff;font-family:Montserrat, sans-serif;line-height:1.4em;\">§ 6 REALIZACJA ZAMÓWIENIA</h2>\n<ol style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;font-size:14px;background:#ffffff;list-style-position:outside;font-family:Montserrat, sans-serif;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Termin realizacji zamówienia wskazany jest w Sklepie.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">W przypadku gdy Kupujący wybrał płatność z góry za zamówienie, Sprzedawca przystąpi do realizacji zamówienia po jego opłaceniu.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">W sytuacji gdy w ramach jednego zamówienia Kupujący zakupił produkty o różnym terminie realizacji, zamówienie zostanie zrealizowane w terminie właściwym dla produktu o najdłuższym terminie realizacji.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Towar dostarczany jest wyłącznie na terytorium Rzeczypospolitej Polskiej.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">W Sklepie dostępne są następujące metody dostawy:\n<ol type=\"a\" style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;background:transparent;list-style-position:outside;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">za pośrednictwem firmy kurierskiej;</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">za pośrednictwem ORLEN Paczki;</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">do paczkomatów InPost;</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">drogą elektroniczną, na adres e-mail podany przez Kupującego podczas składania zamówienia – w przypadku Treści cyfrowych.</li>\n</ol>\n</li>\n</ol>\n<h2 style=\"margin:0.83em 0px 0.7em;padding:0px;border:0px;background:#ffffff;font-family:Montserrat, sans-serif;line-height:1.4em;\">§ 7 PRAWO ODSTĄPIENIA OD UMOWY</h2>\n<ol style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;font-size:14px;background:#ffffff;list-style-position:outside;font-family:Montserrat, sans-serif;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Kupujący uprzywilejowany ma prawo odstąpić od umowy zawartej ze Sprzedawcą za pośrednictwem Sklepu, z zastrzeżeniem § 8 Regulaminu, w terminie 14 dni bez podania jakiejkolwiek przyczyny.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Termin do odstąpienia od umowy wygasa po upływie 14 dni od dnia:\n<ol type=\"a\" style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;background:transparent;list-style-position:outside;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">w którym Kupujący uprzywilejowany wszedł w posiadanie towaru lub w którym osoba trzecia inna niż przewoźnik i wskazana przez Kupującego uprzywilejowanego weszła w posiadanie tego towaru;</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">w którym Kupujący uprzywilejowany wszedł w posiadanie ostatniego towaru, partii lub części lub w którym osoba trzecia, inna niż przewoźnik i wskazana przez Kupującego uprzywilejowanego, weszła w posiadanie ostatniego towaru, partii lub części, w przypadku umowy zobowiązującej do przeniesienia własności wielu towarów, które dostarczane są osobno, partiami lub w częściach;</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">zawarcia umowy - w przypadku umowy o dostarczenie Treści cyfrowych.</li>\n</ol>\n</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Aby Kupujący uprzywilejowany mógł skorzystać z prawa odstąpienia od umowy musi poinformować Sprzedawcę, korzystając z danych podanych w § 2 Regulaminu, o swojej decyzji o odstąpieniu od umowy w drodze jednoznacznego oświadczenia (na przykład pismo wysłane pocztą lub pocztą elektroniczną).</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Kupujący uprzywilejowany może skorzystać z wzoru formularza odstąpienia od umowy umieszczonego na końcu Regulaminu, jednak nie jest to obowiązkowe.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Aby zachować termin do odstąpienia od umowy wystarczy, że Kupujący uprzywilejowany wyśle informację dotyczącą wykonania przysługującego mu prawa odstąpienia od umowy przed upływem terminu do odstąpienia od umowy.<br /><br /><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">SKUTKI ODSTĄPIENIA OD UMOWY</span></li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">W przypadku odstąpienia od zawartej umowy Sprzedawca zwraca Kupującemu uprzywilejowanemu wszystkie otrzymane od niego płatności, w tym koszty dostarczenia towaru (z wyjątkiem dodatkowych kosztów wynikających z wybranego przez Kupującego uprzywilejowanego sposobu dostarczenia innego niż najtańszy zwykły sposób dostarczenia oferowany przez Sprzedawcę), niezwłocznie, a w każdym przypadku nie później niż 14 dni od dnia, w którym Sprzedawca został poinformowany o decyzji Kupującego uprzywilejowanego o wykonaniu prawa odstąpienia od umowy.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Zwrotu płatności Sprzedawca dokona przy użyciu takich samych sposobów płatności, jakie zostały przez Kupującego uprzywilejowanego użyte w pierwotnej transakcji, chyba że Kupujący uprzywilejowany zgodzi się na inne rozwiązanie, w każdym przypadku Kupujący uprzywilejowany nie poniesie żadnych opłat w związku z tym zwrotem.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Jeżeli Sprzedawca nie zaproponował, że sam odbierze towar od Kupującego uprzywilejowanego, może wstrzymać się ze zwrotem płatności do czasu otrzymania towaru lub do czasu dostarczenia mu dowodu jego odesłania, w zależności od tego, które zdarzenie nastąpi wcześniej.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Sprzedawca prosi o zwracanie towaru na adres: Cicha 3, 05-090 Raszyn niezwłocznie, a w każdym razie nie później niż 14 dni od dnia, w którym Kupujący uprzywilejowany poinformował Sprzedawcę o odstąpieniu od umowy sprzedaży. Termin jest zachowany, jeżeli Kupujący uprzywilejowany odeśle towar przed upływem terminu 14 dni.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Kupujący uprzywilejowany ponosi bezpośrednie koszty zwrotu towaru.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Kupujący uprzywilejowany odpowiada tylko za zmniejszenie wartości towaru wynikające z korzystania z niego w sposób inny niż było to konieczne do stwierdzenia charakteru, cech i funkcjonowania towaru.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Jeśli towar ze względu na swój charakter nie może zostać odesłany w zwykłym trybie pocztą, Kupujący uprzywilejowany również będzie musiał ponieść bezpośrednie koszty zwrotu towarów. O szacowanej wysokości tych kosztów Kupujący uprzywilejowany zostanie poinformowany przez Sprzedawcę w opisie towaru w Sklepie lub podczas składania zamówienia.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">W przypadku wystąpienia konieczności zwrotu środków za transakcję dokonaną przez Kupującego uprzywilejowanego kartą płatniczą, Sprzedawca dokona zwrotu na rachunek bankowy przypisany do tej karty płatniczej.</li>\n</ol>\n<h2 style=\"margin:0.83em 0px 0.7em;padding:0px;border:0px;background:#ffffff;font-family:Montserrat, sans-serif;line-height:1.4em;\">§ 8 WYJĄTKI OD PRAWA ODSTĄPIENIA OD UMOWY</h2>\n<ol style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;font-size:14px;background:#ffffff;list-style-position:outside;font-family:Montserrat, sans-serif;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Prawo odstąpienia od umowy zawartej na odległość, o którym mowa w § 7 Regulaminu, nie przysługuje w odniesieniu do umowy:\n<ol type=\"a\" style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;background:transparent;list-style-position:outside;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">w której przedmiotem świadczenia jest towar nieprefabrykowany, wyprodukowany według specyfikacji Kupującego uprzywilejowanego lub służący zaspokojeniu jego zindywidualizowanych potrzeb;</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">w której przedmiotem świadczenia jest towar ulegający szybkiemu zepsuciu lub mający krótki termin przydatności do użycia;</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">w której przedmiotem świadczenia jest towar dostarczany w zapieczętowanym opakowaniu, którego po otwarciu opakowania nie można zwrócić ze względu na ochronę zdrowia lub ze względów higienicznych, jeżeli opakowanie zostało otwarte po dostarczeniu;</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">w której przedmiotem świadczenia są towary, które po dostarczeniu, ze względu na swój charakter, zostają nierozłącznie połączone z innymi rzeczami;</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">w której przedmiotem świadczenia są nagrania dźwiękowe lub wizualne albo programy komputerowe dostarczane w zapieczętowanym opakowaniu, jeżeli opakowanie zostało otwarte po dostarczeniu;</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">o dostarczanie dzienników, periodyków lub czasopism, z wyjątkiem umowy o prenumeratę;</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">w której cena lub wynagrodzenie zależy od wahań na rynku finansowym, nad którymi Sprzedawca nie sprawuje kontroli, i które mogą wystąpić przed upływem terminu do odstąpienia od umowy;</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">o dostarczanie Treści cyfrowych, za które Kupujący uprzywilejowany jest zobowiązany do zapłaty ceny, jeżeli spełnione zostaną łącznie następujące warunki:\n<ul style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;background:transparent;list-style:disc;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Sprzedawca rozpoczął świadczenie za wyraźną i uprzednią zgodą Kupującego uprzywilejowanego;</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Kupujący uprzywilejowany został poinformowany przed rozpoczęciem świadczenia, że po spełnieniu świadczenia przez Sprzedawcę utraci prawo do odstąpienia od umowy i przyjął to do wiadomości;</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Sprzedawca przekazał Kupującemu uprzywilejowanemu zgodne z prawem potwierdzenie zawarcia umowy na odległość, obejmujące informację o ww. zgodzie, na trwałym nośniku w rozsądnym czasie po zawarciu umowy, najpóźniej przed rozpoczęciem świadczenia.</li>\n</ul>\n</li>\n</ol>\n</li>\n</ol>\n<h2 style=\"margin:0.83em 0px 0.7em;padding:0px;border:0px;background:#ffffff;font-family:Montserrat, sans-serif;line-height:1.4em;\">§ 9 REKLAMACJE</h2>\n<h3 style=\"margin:1em 0px 0.7em;padding:0px;border:0px;background:#ffffff;font-family:Montserrat, sans-serif;line-height:1.4em;\">I POSTANOWIENIA OGÓLNE</h3>\n<ol style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;font-size:14px;background:#ffffff;list-style-position:outside;font-family:Montserrat, sans-serif;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Sprzedawca ponosi wobec Kupującego uprzywilejowanego odpowiedzialność za zgodność świadczenia z umową, przewidzianą przez powszechnie obowiązujące przepisy prawa, w tym zwłaszcza przez przepisy Ustawy o prawach konsumenta.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Sprzedawca prosi o składanie reklamacji (w tym dotyczących działania Sklepu) na adres pocztowy lub elektroniczny wskazany w § 2 Regulaminu.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Jeśli na produkt została udzielona gwarancja, informacja o niej, a także o jej warunkach, jest dostępna w Sklepie.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Sprzedawca ustosunkuje się do reklamacji w terminie 14 dni od dnia jej otrzymania.</li>\n</ol>\n<h3 style=\"margin:1em 0px 0.7em;padding:0px;border:0px;background:#ffffff;font-family:Montserrat, sans-serif;line-height:1.4em;\">II KUPUJĄCY UPRZYWILEJOWANI</h3>\n<ol type=\"A\" style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;font-size:14px;background:#ffffff;list-style-position:outside;font-family:Montserrat, sans-serif;\">\n<li style=\"margin:1em 0px 0px;padding:0px;border:0px;background:transparent;line-height:20px;\"><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">Towary</span>\n<ol style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;background:transparent;list-style-position:outside;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">W przypadku braku zgodności towaru z umową, Kupujący uprzywilejowany ma możliwość skorzystania z uprawnień określonych w rozdziale 5a Ustawy o prawach konsumenta.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Sprzedawca ponosi odpowiedzialność za brak zgodności towaru z umową, istniejący w chwili jego dostarczenia i ujawniony w ciągu dwóch lat od tej chwili, chyba że termin przydatności towaru do użycia, określony przez Sprzedawcę, jego poprzedników prawnych lub osoby działające w ich imieniu, jest dłuższy.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Na podstawie przepisów Ustawy o prawach konsumenta, w przypadku braku zgodności z umową, Kupujący uprzywilejowany może żądać:\n<ol type=\"a\" style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;background:transparent;list-style-position:outside;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">wymiany towaru,</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">naprawy towaru.</li>\n</ol>\n</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Dodatkowo, Kupujący uprzywilejowany może złożyć oświadczenie o:\n<ol type=\"a\" style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;background:transparent;list-style-position:outside;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">obniżeniu ceny,</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">odstąpieniu od umowy</li>\n</ol>\nw sytuacji, gdy:\n<ul style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;background:transparent;list-style:disc;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Sprzedawca odmówił doprowadzenia towaru do zgodności z umową zgodnie z art. 43d ust. 2 Ustawy o prawach konsumenta;</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Sprzedawca nie doprowadził towaru do zgodności z umową zgodnie z art. 43d ust. 4-6 Ustawy o prawach konsumenta;</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">brak zgodności towaru z umową występuje nadal, pomimo że Sprzedawca próbował doprowadzić towar do zgodności z umową;</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">brak zgodności towaru z umową jest na tyle istotny, że uzasadnia obniżenie ceny albo odstąpienie od umowy bez uprzedniego skorzystania ze środków ochrony określonych w art. 43d Ustawy o prawach konsumenta;</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">z oświadczenia Sprzedawcy lub okoliczności wyraźnie wynika, że nie doprowadzi on towaru do zgodności z umową w rozsądnym czasie lub bez nadmiernych niedogodności dla Kupującego uprzywilejowanego.</li>\n</ul>\n</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">W przypadku towaru podlegającego naprawie lub wymianie, Kupujący uprzywilejowany powinien udostępnić ten towar Sprzedawcy. Sprzedawca odbiera od Kupującego uprzywilejowanego towar na swój koszt.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Kupujący uprzywilejowany nie może odstąpić od umowy, jeżeli brak zgodności towaru z umową jest nieistotny.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">W razie odstąpienia od umowy, o którym mowa w niniejszej sekcji (dotyczącej towarów), Kupujący uprzywilejowany niezwłocznie zwraca towar Sprzedawcy na jego koszt, na adres Cicha 3, 05-090 Raszyn. Sprzedawca zwraca Kupującemu uprzywilejowanemu cenę niezwłocznie, nie później niż w terminie 14 dni od dnia otrzymania towaru lub dowodu jego odesłania.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Sprzedawca zwraca Kupującemu uprzywilejowanemu kwoty należne wskutek skorzystania z prawa obniżenia ceny niezwłocznie, nie później niż w terminie 14 dni od dnia otrzymania oświadczenia Kupującego uprzywilejowanego o obniżeniu ceny.</li>\n</ol>\n</li>\n<li style=\"margin:1em 0px 0px;padding:0px;border:0px;background:transparent;line-height:20px;\"><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">Treści cyfrowe</span>\n<ol style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;background:transparent;list-style-position:outside;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">W przypadku niewłaściwej realizacji przez Sprzedawcę umowy o dostarczenie Treści cyfrowych, Kupujący uprzywilejowany ma możliwość skorzystania z uprawnień uregulowanych w rozdziale 5b Ustawy o prawach konsumenta.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Jeżeli Sprzedawca nie dostarczył Treści cyfrowych, Kupujący uprzywilejowany może wezwać go do ich dostarczenia. Jeżeli mimo to Sprzedawca nie dostarczy Treści cyfrowych niezwłocznie lub w dodatkowym, wyraźnie uzgodnionym przez Kupującego uprzywilejowanego i Sprzedawcę terminie, Kupujący uprzywilejowany może odstąpić od umowy.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Kupujący uprzywilejowany może odstąpić od umowy bez wzywania do dostarczenia Treści cyfrowych, jeżeli:\n<ul style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;background:transparent;list-style:disc;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">z oświadczenia Sprzedawcy lub z okoliczności wyraźnie wynika, że nie dostarczy Treści cyfrowych lub</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Kupujący uprzywilejowany i Sprzedawca uzgodnili, lub z okoliczności zawarcia umowy wyraźnie wynika, że określony termin dostarczenia Treści cyfrowych miał istotne znaczenie dla Kupującego uprzywilejowanego, a Sprzedawca nie dostarczył ich w tym terminie.</li>\n</ul>\n</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Sprzedawca ponosi odpowiedzialność za brak zgodności Treści cyfrowych z umową, który istniał w chwili ich dostarczenia i ujawnił się w ciągu dwóch lat od tej chwili.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Jeżeli Treści cyfrowe są niezgodne z umową, Kupujący uprzywilejowany może żądać doprowadzenia do ich zgodności z umową.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">W przypadku braku zgodności Treści cyfrowych z umową, Kupujący uprzywilejowany ma obowiązek współpracy ze Sprzedawcą, w rozsądnym zakresie i przy zastosowaniu najmniej uciążliwych dla siebie środków technicznych, w celu ustalenia, czy brak zgodności Treści cyfrowych z umową w odpowiednim czasie wynika z cech środowiska cyfrowego Kupującego uprzywilejowanego.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Dodatkowo, jeżeli Treści cyfrowe są niezgodne z umową, Kupujący uprzywilejowany może złożyć oświadczenie o:\n<ol type=\"a\" style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;background:transparent;list-style-position:outside;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">obniżeniu ceny,</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">odstąpieniu od umowy,</li>\n</ol>\ngdy:\n<ul style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;background:transparent;list-style:disc;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">doprowadzenie do zgodności Treści cyfrowych z umową jest niemożliwe albo wymaga nadmiernych kosztów stosownie do art. 43m ust. 2 i 3 Ustawy o prawach konsumenta;</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Sprzedawca nie doprowadził Treści cyfrowych do zgodności z umową w rozsądnym czasie od chwili, w której Sprzedawca został poinformowany przez Kupującego uprzywilejowanego o braku zgodności z umową, i bez nadmiernych niedogodności dla Kupującego uprzywilejowanego, uwzględniając ich charakter oraz cel, w jakim są wykorzystywane;</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">brak zgodności Treści cyfrowych z umową występuje nadal, mimo że Sprzedawca próbował doprowadzić Treści cyfrowe do zgodności z umową;</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">brak zgodności Treści cyfrowych z umową jest na tyle istotny, że uzasadnia obniżenie ceny albo odstąpienie od umowy bez uprzedniego skorzystania ze środka ochrony określonego w art. 43m Ustawy o prawach konsumenta (tj. żądania doprowadzenia Treści cyfrowych do zgodności z umową);</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">z oświadczenia Sprzedawcy lub okoliczności wyraźnie wynika, że nie doprowadzi on Treści cyfrowych do zgodności z umową w rozsądnym czasie lub bez nadmiernych niedogodności dla Kupującego uprzywilejowanego.</li>\n</ul>\n</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Kupujący uprzywilejowany nie może odstąpić od umowy na podstawie poprzedniego postanowienia, jeżeli Treści cyfrowe są dostarczane w zamian za zapłatę ceny, a brak zgodności Treści cyfrowych z umową jest nieistotny.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Sprzedawca ma obowiązek dokonać zwrotu Kupującemu uprzywilejowanemu ceny należnej wskutek skorzystania z prawa odstąpienia od umowy, o którym mowa w niniejszej sekcji (dotyczącej Treści cyfrowych), lub obniżenia ceny, niezwłocznie, nie później niż w terminie 14 dni od dnia otrzymania oświadczenia Kupującego uprzywilejowanego o odstąpieniu od umowy lub obniżeniu ceny.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Sprzedawca dokonuje zwrotu ceny przy użyciu takiego samego sposobu zapłaty, jakiego użył Kupujący uprzywilejowany, chyba że Kupujący uprzywilejowany wyraźnie zgodził się na inny sposób zwrotu, który nie wiąże się dla niego z żadnymi kosztami.</li>\n</ol>\n</li>\n<li style=\"margin:1em 0px 0px;padding:0px;border:0px;background:transparent;line-height:20px;\"><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">Pozasądowe sposoby rozpatrywania reklamacji i dochodzenia roszczeń</span>\n<ol style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;background:transparent;list-style-position:outside;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Sprzedawca informuje Konsumenta o możliwości skorzystania z pozasądowych sposobów rozpatrywania reklamacji i dochodzenia roszczeń. Zasady dostępu do tych procedur dostępne są w siedzibach lub na stronach internetowych podmiotów uprawnionych do pozasądowego rozpatrywania sporów. Konsument może skorzystać m.in. z:\n<ul style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;background:transparent;list-style:disc;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">pomocy odpowiedniego Europejskiego Centrum Konsumenckiego z Sieci Europejskich Centrów Konsumenckich. Centra udzielają informacji o prawach konsumentów i pomagają w rozwiązaniu sporu w przypadku zakupów transgranicznych. Pomoc Europejskich Centrów Konsumenckich jest co do zasady bezpłatna. Lista Centrów Konsumenckich właściwych dla danego państwa znajduje się pod adresem: <a href=\"https://konsument.gov.pl/eck-w-europie/\" target=\"_blank\" style=\"margin:0px;padding:0px;border:0px;background:transparent;color:#f6a802;\" rel=\"noreferrer noopener\">https://konsument.gov.pl/eck-w-europie/</a></li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">internetowej platformy ODR (Online Dispute Resolution), zapewnianej przez Komisję Europejską, dostępnej pod adresem: <a href=\"https://ec.europa.eu/consumers/odr\" target=\"_blank\" style=\"margin:0px;padding:0px;border:0px;background:transparent;color:#f6a802;\" rel=\"noreferrer noopener\">https://ec.europa.eu/consumers/odr</a></li>\n</ul>\nPonadto, na terenie Rzeczypospolitej Polskiej można skorzystać z następujących form wsparcia:\n<ul style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;background:transparent;list-style:disc;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">mediacji prowadzonej przez właściwy terenowo Wojewódzki Inspektorat Inspekcji Handlowej, do którego należy się zwrócić z wnioskiem o mediację. Co do zasady postępowanie jest bezpłatne. Wykaz Inspektoratów znajduje się tutaj: <a href=\"https://uokik.gov.pl/wojewodzkie_inspektoraty_inspekcji_handlowej.php\" target=\"_blank\" style=\"margin:0px;padding:0px;border:0px;background:transparent;color:#f6a802;\" rel=\"noreferrer noopener\">https://uokik.gov.pl/wojewodzkie_inspektoraty_inspekcji_handlowej.php</a></li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">pomocy właściwego terenowo stałego polubownego sądu konsumenckiego działającego przy Wojewódzkim Inspektoracie Inspekcji Handlowej, do którego należy złożyć wniosek o rozpatrzenie sprawy przed sądem polubownym. Co do zasady postępowanie jest bezpłatne. Wykaz sądów dostępny jest pod adresem: <a href=\"https://uokik.gov.pl/stale_sady_polubowne.php\" target=\"_blank\" style=\"margin:0px;padding:0px;border:0px;background:transparent;color:#f6a802;\" rel=\"noreferrer noopener\">https://uokik.gov.pl/stale_sady_polubowne.php</a></li>\n</ul>\n</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Poprzednie postanowienie ma charakter informacyjny i nie stanowi zobowiązania Sprzedawcy do skorzystania z pozasądowych sposobów rozwiązywania sporów.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Skorzystanie z pozasądowych sposobów rozpatrywania reklamacji i dochodzenia roszczeń jest dobrowolne zarówno dla Sprzedawcy jak i Konsumenta.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Konsument może dodatkowo skorzystać z bezpłatnej pomocy miejskiego lub powiatowego rzecznika konsumentów.</li>\n</ol>\n</li>\n</ol>\n<h3 style=\"margin:1em 0px 0.7em;padding:0px;border:0px;background:#ffffff;font-family:Montserrat, sans-serif;line-height:1.4em;\">III KUPUJĄCY INNI NIŻ KUPUJĄCY UPRZYWILEJOWANI</h3>\n<ol style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;font-size:14px;background:#ffffff;list-style-position:outside;font-family:Montserrat, sans-serif;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Celem uniknięcia wątpliwości Sprzedawca zwraca uwagę, że do odpowiedzialności Sprzedawcy wobec Kupującego innego niż Kupujący uprzywilejowany, związanej z reklamacją, stosuje się postanowienie § 11 ust. 7.</li>\n</ol>\n<h2 style=\"margin:0.83em 0px 0.7em;padding:0px;border:0px;background:#ffffff;font-family:Montserrat, sans-serif;line-height:1.4em;\">§ 10 DANE OSOBOWE</h2>\n<ol style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;font-size:14px;background:#ffffff;list-style-position:outside;font-family:Montserrat, sans-serif;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Administratorem danych osobowych przekazanych przez Kupującego podczas korzystania ze Sklepu jest Sprzedawca. Szczegółowe informacje dotyczące przetwarzania danych osobowych przez Sprzedawcę – w tym o pozostałych celach oraz podstawach przetwarzania danych, a także o odbiorcach danych – znajdują się w dostępnej w Sklepie polityce prywatności – ze względu na zasadę przejrzystości, zawartą w ogólnym rozporządzeniu Parlamentu Europejskiego i Rady (UE) o ochronie danych – „<span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">RODO</span>”.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Celem przetwarzania danych Kupującego przez Sprzedawcę, podanych przez Kupującego w związku z zakupami w Sklepie, jest realizacja zamówień. Podstawą przetwarzania danych osobowych w tym przypadku jest:\n<ul style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;background:transparent;list-style:disc;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">umowa lub działania podejmowane na żądanie Kupującego, zmierzające do jej zawarcia (art. 6 ust. 1 lit. b RODO),</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">ciążący na Sprzedawcy obowiązek prawny związany z rachunkowością (art. 6 ust. 1 lit. c RODO) oraz</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">prawnie uzasadniony interes Sprzedawcy, polegający na przetwarzaniu danych w celu ustalenia, dochodzenia lub obrony ewentualnych roszczeń (art. 6 ust. 1 lit. f RODO).</li>\n</ul>\n</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Podanie danych przez Kupującego jest dobrowolne, ale jednocześnie konieczne do zawarcia umowy. Niepodanie danych uniemożliwi zawarcie umowy w Sklepie.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Dane Kupującego podane w związku z zakupami w Sklepie będą przetwarzane do momentu, w którym:\n<ol type=\"a\" style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;background:transparent;list-style-position:outside;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">przestanie obowiązywać umowa zawarta między Kupującym a Sprzedawcą;</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">na Sprzedawcy przestanie ciążyć obowiązek prawny, zobowiązujący go do przetwarzania danych Kupującego;</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">ustanie możliwość dochodzenia roszczeń przez Kupującego lub Sprzedawcę, związanych z umową zawartą przez Sklep;</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">zostanie przyjęty sprzeciw Kupującego wobec przetwarzania jego danych osobowych – w przypadku gdy podstawą przetwarzania danych był uzasadniony interes Sprzedawcy</li>\n</ol>\n– w zależności od tego, co ma zastosowanie w danym przypadku.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Kupującemu przysługuje prawo żądania:\n<ol type=\"a\" style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;background:transparent;list-style-position:outside;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">dostępu do swoich danych osobowych,</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">ich sprostowania,</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">usunięcia,</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">ograniczenia przetwarzania,</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">przeniesienia danych do innego administratora<br />a także prawo:</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">wniesienia w dowolnym momencie sprzeciwu wobec przetwarzania danych z przyczyn związanych ze szczególną sytuacją Kupującego – wobec przetwarzania dotyczących go danych osobowych, opartego na art. 6 ust. 1 lit. f RODO (tj. na prawnie uzasadnionych interesach realizowanych przez Sprzedawcę).</li>\n</ol>\n</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">W celu realizacji swoich praw, Kupujący powinien skontaktować się ze Sprzedawcą przy wykorzystaniu danych z § 2 Regulaminu.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">W przypadku gdy Kupujący uzna, że jego dane są przetwarzane niezgodnie z prawem, Kupujący może złożyć skargę do organu właściwego dla ochrony danych osobowych. W Polsce jest nim Prezes Urzędu Ochrony Danych Osobowych.</li>\n</ol>\n<h2 style=\"margin:0.83em 0px 0.7em;padding:0px;border:0px;background:#ffffff;font-family:Montserrat, sans-serif;line-height:1.4em;\">§ 11 ZASTRZEŻENIA</h2>\n<ol style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;font-size:14px;background:#ffffff;list-style-position:outside;font-family:Montserrat, sans-serif;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Zakazane jest dostarczanie przez Kupującego treści o charakterze bezprawnym.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Każdorazowo składane w Sklepie zamówienie stanowi odrębną umowę i wymaga osobnej akceptacji Regulaminu. Umowa zawierana jest na czas i w celu realizacji zamówienia.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Wszelkie umowy zawierane na podstawie niniejszego Regulaminu podlegają przepisom prawa polskiego, z zastrzeżeniem ust. 4.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Wybór prawa polskiego dla umów zawartych na podstawie Regulaminu z Konsumentem nie uchyla i nie ogranicza praw tego Kupującego, przysługujących mu na podstawie bezwzględnie obowiązujących przepisów prawa, znajdujących zastosowanie dla Konsumenta w sytuacji, w których nie ma miejsca wybór prawa. Oznacza to w szczególności, że jeśli właściwe dla danego Konsumenta przepisy krajowe przewidują ochronę szerszą niż wynikająca z niniejszego Regulaminu lub prawa polskiego – stosuje się tę ochronę szerszą.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Umowy zawierane na podstawie Regulaminu zawierane są w języku polskim.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">W przypadku ewentualnego sporu z Kupującym niebędącym Kupującym uprzywilejowanym, związanego z umową zawartą za pośrednictwem Sklepu, sądem właściwym będzie sąd właściwy dla siedziby Sprzedawcy.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Wszelka odpowiedzialność Sprzedawcy w stosunku do Kupującego niebędącego Kupującym uprzywilejowanym, z tytułu umowy zawartej za pośrednictwem Sklepu - w granicach dopuszczonych przez prawo - jest wyłączona.</li>\n</ol>\n<p><br style=\"font-family:Montserrat, sans-serif;font-size:14px;background-color:#ffffff;\" /><br style=\"font-family:Montserrat, sans-serif;font-size:14px;background-color:#ffffff;\" /><span style=\"margin:0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-weight:bold;font-family:Montserrat, sans-serif;\">Załącznik nr 1 do Regulaminu</span><span style=\"font-family:Montserrat, sans-serif;font-size:14px;background-color:#ffffff;\"></span><br style=\"font-family:Montserrat, sans-serif;font-size:14px;background-color:#ffffff;\" /><br style=\"font-family:Montserrat, sans-serif;font-size:14px;background-color:#ffffff;\" /><span style=\"font-family:Montserrat, sans-serif;font-size:14px;background-color:#ffffff;\">Poniżej znajduje się wzór formularza odstąpienia od umowy, z którego Konsument lub Przedsiębiorca uprzywilejowany może, ale nie musi skorzystać:</span><br style=\"font-family:Montserrat, sans-serif;font-size:14px;background-color:#ffffff;\" /><br style=\"font-family:Montserrat, sans-serif;font-size:14px;background-color:#ffffff;\" /><br style=\"font-family:Montserrat, sans-serif;font-size:14px;background-color:#ffffff;\" /><br style=\"font-family:Montserrat, sans-serif;font-size:14px;background-color:#ffffff;\" /></p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;text-align:center;\"><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">WZÓR FORMULARZA ODSTĄPIENIA OD UMOWY</span><br />(formularz ten należy wypełnić i odesłać tylko w przypadku chęci odstąpienia od umowy)</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\">Smooth Sport Łukasz Marcinkowski<br />Cicha 3, 05-090 Raszyn<br />adres e-mail: sklep@geekup.pl</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\">- Ja/My(*) ..................................................................... niniejszym informuję/informujemy(*) o moim/naszym odstąpieniu od umowy sprzedaży następujących towarów(*) / o świadczenie następującej usługi(*) / o dostarczenie treści cyfrowych w postaci(*):<br /><br />..............................................................................................................................................................................<br /><br />..............................................................................................................................................................................<br /><br />..............................................................................................................................................................................</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\">- Data zawarcia umowy<sup style=\"margin:0px;padding:0px;border:0px;font-size:14px;background:transparent;\">(*)</sup>/odbioru<sup style=\"margin:0px;padding:0px;border:0px;font-size:14px;background:transparent;\">(*)</sup><br /><br />..............................................................................................................................................................................<br /><br />- Imię i nazwisko Konsumenta(-ów) / Przedsiębiorcy(-ów) uprzywilejowanego(-ych):<br /><br />..............................................................................................................................................................................<br /><br />- Adres Konsumenta(-ów) / Przedsiębiorcy(-ów) uprzywilejowanego(-ych):<br /><br />..............................................................................................................................................................................<br /><br />..............................................................................................................................................................................<br /><br /></p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;text-align:right;\">.............................................................................................<br />Podpis Konsumenta(-ów) / Przedsiębiorcy(-ów) uprzywilejowanego(-ych)<br /><small style=\"margin:0px;padding:0px;border:0px;font-size:14px;background:transparent;\">(tylko jeżeli formularz jest przesyłany w wersji papierowej)</small><br /><br />Data ............................................</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;text-align:right;\"><small style=\"margin:0px;padding:0px;border:0px;font-size:14px;background:transparent;\">(*) Niepotrzebne skreślić.</small></p>\n<p><br style=\"font-family:Montserrat, sans-serif;font-size:14px;background-color:#ffffff;\" /><br style=\"font-family:Montserrat, sans-serif;font-size:14px;background-color:#ffffff;\" /><br style=\"font-family:Montserrat, sans-serif;font-size:14px;background-color:#ffffff;\" /><br style=\"font-family:Montserrat, sans-serif;font-size:14px;background-color:#ffffff;\" /></p>\n<h1 class=\"center clearfix\" style=\"margin:0.67em 0px;padding:0px;border:0px;background:#ffffff;font-family:Montserrat, sans-serif;line-height:1.4em;text-align:center;clear:both;\">Regulamin Konta</h1>\n<p class=\"center\" style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;text-align:center;font-family:Montserrat, sans-serif;\">w sklepie GeekUp.pl - Figurki Funko POP, gadżety filmowe, gadżety z gier, komiksów i bajek</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\"><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">SPIS TREŚCI</span><br /><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">§ 1</span> Definicje<br /><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">§ 2</span> Kontakt z Usługodawcą<br /><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">§ 3</span> Wymogi techniczne<br /><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">§ 4</span> Konto<br /><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">§ 5</span> Reklamacje<br /><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">§ 6</span> Prawo odstąpienia od umowy<br /><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">§ 7</span> Dane osobowe<br /><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">§ 8</span> Zmiana w Regulaminie lub Koncie<br /><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">§ 9</span> Postanowienia końcowe</p>\n<h2 style=\"margin:0.83em 0px 0.7em;padding:0px;border:0px;background:#ffffff;font-family:Montserrat, sans-serif;line-height:1.4em;\">§ 1 DEFINICJE</h2>\n<p><span style=\"margin:0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-weight:bold;font-family:Montserrat, sans-serif;\">Konsument</span><span style=\"font-family:Montserrat, sans-serif;font-size:14px;background-color:#ffffff;\"> – Usługobiorca będący osobą fizyczną, który zawarł na podstawie Regulaminu umowę o prowadzenie Konta lub podejmuje czynności zmierzające do jej zawarcia, bez bezpośredniego związku z jego działalnością gospodarczą lub zawodową.</span><br style=\"font-family:Montserrat, sans-serif;font-size:14px;background-color:#ffffff;\" /><span style=\"margin:0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-weight:bold;font-family:Montserrat, sans-serif;\">Konto</span><span style=\"font-family:Montserrat, sans-serif;font-size:14px;background-color:#ffffff;\"> – usługa cyfrowa w rozumieniu Ustawy o prawach konsumenta, świadczona nieodpłatnie drogą elektroniczną przez Usługodawcę na rzecz Usługobiorcy, dzięki której Usługobiorca może skorzystać z dodatkowych funkcji w Sklepie.</span><br style=\"font-family:Montserrat, sans-serif;font-size:14px;background-color:#ffffff;\" /><span style=\"margin:0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-weight:bold;font-family:Montserrat, sans-serif;\">Przedsiębiorca uprzywilejowany</span><span style=\"font-family:Montserrat, sans-serif;font-size:14px;background-color:#ffffff;\"> - Usługobiorca, który jest osobą fizyczną zawierającą na podstawie Regulaminu umowę o prowadzenie Konta (lub podejmującą czynności zmierzające do jej zawarcia), bezpośrednio związaną z jej działalnością gospodarczą, ale nieposiadającą dla niej charakteru zawodowego.</span><br style=\"font-family:Montserrat, sans-serif;font-size:14px;background-color:#ffffff;\" /><span style=\"margin:0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-weight:bold;font-family:Montserrat, sans-serif;\">Regulamin</span><span style=\"font-family:Montserrat, sans-serif;font-size:14px;background-color:#ffffff;\"> - niniejszy regulamin Konta.</span><br style=\"font-family:Montserrat, sans-serif;font-size:14px;background-color:#ffffff;\" /><span style=\"margin:0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-weight:bold;font-family:Montserrat, sans-serif;\">Sklep</span><span style=\"font-family:Montserrat, sans-serif;font-size:14px;background-color:#ffffff;\"> – sklep internetowy GeekUp.pl - Figurki Funko POP, gadżety filmowe, gadżety z gier, komiksów i bajek prowadzony przez Usługodawcę pod adresem https://geekup.pl</span><br style=\"font-family:Montserrat, sans-serif;font-size:14px;background-color:#ffffff;\" /><span style=\"margin:0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-weight:bold;font-family:Montserrat, sans-serif;\">Usługobiorca</span><span style=\"font-family:Montserrat, sans-serif;font-size:14px;background-color:#ffffff;\"> - każdy podmiot, który zawarł umowę o prowadzenie Konta lub podejmuje czynności zmierzające do jej zawarcia.</span><br style=\"font-family:Montserrat, sans-serif;font-size:14px;background-color:#ffffff;\" /><span style=\"margin:0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-weight:bold;font-family:Montserrat, sans-serif;\">Usługobiorca uprzywilejowany</span><span style=\"font-family:Montserrat, sans-serif;font-size:14px;background-color:#ffffff;\"> – Usługobiorca, który jest Konsumentem lub Przedsiębiorcą uprzywilejowanym.</span><br style=\"font-family:Montserrat, sans-serif;font-size:14px;background-color:#ffffff;\" /><span style=\"margin:0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-weight:bold;font-family:Montserrat, sans-serif;\">Usługodawca</span><span style=\"font-family:Montserrat, sans-serif;font-size:14px;background-color:#ffffff;\"> - Łukasz Marcinkowski, przedsiębiorca prowadzący działalność gospodarczą pod firmą Smooth Sport Łukasz Marcinkowski, wpisany do Centralnej Ewidencji i Informacji o Działalności Gospodarczej prowadzonej przez ministra właściwego do spraw gospodarki i prowadzenia Centralnej Ewidencji i Informacji o Działalności Gospodarczej, NIP 5342423841, nr REGON 142004657, Cicha 3, 05-090 Raszyn.</span><br style=\"font-family:Montserrat, sans-serif;font-size:14px;background-color:#ffffff;\" /><span style=\"margin:0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-weight:bold;font-family:Montserrat, sans-serif;\">Ustawa o prawach konsumenta</span><span style=\"font-family:Montserrat, sans-serif;font-size:14px;background-color:#ffffff;\"> – polska ustawa z dnia 30 maja 2014 r. o prawach konsumenta.</span></p>\n<h2 style=\"margin:0.83em 0px 0.7em;padding:0px;border:0px;background:#ffffff;font-family:Montserrat, sans-serif;line-height:1.4em;\">§ 2 KONTAKT Z USŁUGODAWCĄ</h2>\n<ol style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;font-size:14px;background:#ffffff;list-style-position:outside;font-family:Montserrat, sans-serif;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Adres pocztowy: Cicha 3, 05-090 Raszyn</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Adres e-mail: sklep@geekup.pl</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Telefon: 533121806</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Koszt połączenia telefonicznego lub transmisji danych wykonywanych przez Usługobiorcę wynika z podstawowej taryfy operatora telekomunikacyjnego lub dostawcy usług internetowych, z którego usług korzysta Usługobiorca. Usługodawca zwraca uwagę, że koszt połączenia międzynarodowego lub międzynarodowej transmisji danych może być wyższy niż koszt połączenia lub transmisji krajowej – w zależności od taryfy przyjętej przez operatora telekomunikacyjnego lub dostawcę usług internetowych, z usług którego korzysta Usługobiorca.</li>\n</ol>\n<h2 style=\"margin:0.83em 0px 0.7em;padding:0px;border:0px;background:#ffffff;font-family:Montserrat, sans-serif;line-height:1.4em;\">§ 3 WYMOGI TECHNICZNE</h2>\n<ol style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;font-size:14px;background:#ffffff;list-style-position:outside;font-family:Montserrat, sans-serif;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Dla prawidłowego funkcjonowania i założenia Konta potrzebne jest:\n<ul style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;background:transparent;list-style:disc;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">aktywne konto e-mail,</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">urządzenie z dostępem do Internetu,</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">przeglądarka internetowa obsługująca JavaScript i pliki cookies.</li>\n</ul>\n</li>\n</ol>\n<h2 style=\"margin:0.83em 0px 0.7em;padding:0px;border:0px;background:#ffffff;font-family:Montserrat, sans-serif;line-height:1.4em;\">§ 4 KONTO</h2>\n<ol style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;font-size:14px;background:#ffffff;list-style-position:outside;font-family:Montserrat, sans-serif;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Założenie Konta jest całkowicie dobrowolne i zależne od woli Usługobiorcy.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Konto daje Usługobiorcy dodatkowe możliwości, takie jak: przeglądanie historii zamówień złożonych przez Usługobiorcę w Sklepie, sprawdzenie statusu zamówienia czy samodzielna edycja danych Usługobiorcy.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">W celu założenia Konta należy wypełnić stosowny formularz w Sklepie.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">W momencie założenia Konta zawierana jest na czas nieoznaczony pomiędzy Usługobiorcą a Usługodawcą umowa o prowadzenie Konta na zasadach wskazanych w Regulaminie.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Usługodawca rozpoczyna świadczenie usługi prowadzenia Konta na zasadach określonych w Regulaminie niezwłocznie po zawarciu umowy o prowadzenie Konta.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Usługobiorca może bez ponoszenia jakichkolwiek kosztów w każdym czasie zrezygnować z Konta.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Usunięcie Konta skutkuje rozwiązaniem umowy o prowadzenie Konta. W celu usunięcia Konta przez Usługodawcę należy wysłać swoją rezygnację z Konta na adres e-mail Usługodawcy podany w § 2 Regulaminu, czego skutkiem będzie niezwłoczne usunięcie Konta oraz rozwiązanie umowy o prowadzenie Konta.</li>\n</ol>\n<h2 style=\"margin:0.83em 0px 0.7em;padding:0px;border:0px;background:#ffffff;font-family:Montserrat, sans-serif;line-height:1.4em;\">§ 5 REKLAMACJE</h2>\n<h3 style=\"margin:1em 0px 0.7em;padding:0px;border:0px;background:#ffffff;font-family:Montserrat, sans-serif;line-height:1.4em;\">I POSTANOWIENIA OGÓLNE</h3>\n<ol style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;font-size:14px;background:#ffffff;list-style-position:outside;font-family:Montserrat, sans-serif;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Usługodawca prosi o składanie reklamacji dotyczących Konta na adres pocztowy lub elektroniczny wskazany w § 2 Regulaminu.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Usługodawca ustosunkuje się do reklamacji w terminie 14 dni od otrzymania zgłoszenia reklamacyjnego.</li>\n</ol>\n<h3 style=\"margin:1em 0px 0.7em;padding:0px;border:0px;background:#ffffff;font-family:Montserrat, sans-serif;line-height:1.4em;\">II USŁUGOBIORCY UPRZYWILEJOWANI</h3>\n<ol start=\"3\" style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;font-size:14px;background:#ffffff;list-style-position:outside;font-family:Montserrat, sans-serif;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Usługodawca ponosi wobec Usługobiorcy uprzywilejowanego odpowiedzialność za zgodność świadczenia z umową, przewidzianą przez powszechnie obowiązujące przepisy prawa, w tym zwłaszcza przez przepisy Ustawy o prawach konsumenta.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">W przypadku niewłaściwej realizacji przez Usługodawcę umowy o prowadzenie Konta, Usługobiorca uprzywilejowany ma możliwość skorzystania z uprawnień uregulowanych w rozdziale 5b Ustawy o prawach konsumenta.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Jeżeli Usługodawca nie dostarczył usługi cyfrowej, Usługobiorca uprzywilejowany może wezwać go do jej dostarczenia. Jeżeli mimo to Usługodawca nie dostarczy usługi cyfrowej niezwłocznie lub w dodatkowym, wyraźnie uzgodnionym przez Usługodawcę i Usługobiorcę uprzywilejowanego terminie, Usługobiorca uprzywilejowany może odstąpić od umowy o prowadzenie Konta.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Usługobiorca uprzywilejowany może odstąpić od umowy o prowadzenie Konta bez wzywania do dostarczenia usługi cyfrowej, jeżeli:\n<ol type=\"a\" style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;background:transparent;list-style-position:outside;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">z oświadczenia Usługodawcy lub okoliczności wyraźnie wynika, że nie dostarczy usługi cyfrowej lub</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Usługobiorca uprzywilejowany i Usługodawca uzgodnili lub z okoliczności zawarcia umowy o prowadzenie Konta wyraźnie wynika, że określony termin dostarczenia usługi cyfrowej miał istotne znaczenie dla Usługobiorcy uprzywilejowanego, a Usługodawca nie dostarczył jej w tym terminie.</li>\n</ol>\n</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Usługodawca ponosi odpowiedzialność za brak zgodności z umową o prowadzenie Konta usługi cyfrowej dostarczanej w sposób ciągły, który wystąpił lub ujawnił się w czasie, w którym zgodnie z tą umową usługa miała być dostarczana.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Jeśli usługa cyfrowa jest niezgodna z umową o prowadzenie Konta, Usługobiorca uprzywilejowany może żądać jej doprowadzenia do zgodności z tą umową.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">W przypadku braku zgodności usługi cyfrowej z umową o prowadzenie Konta Usługobiorca uprzywilejowany ma obowiązek współpracy z Usługodawcą, w rozsądnym zakresie i przy zastosowaniu najmniej uciążliwych dla siebie środków technicznych, w celu ustalenia, czy brak zgodności usługi cyfrowej z umową o prowadzenie Konta w odpowiednim czasie wynika z cech środowiska cyfrowego Usługobiorcy uprzywilejowanego.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Dodatkowo, jeżeli usługa cyfrowa jest niezgodna z umową o prowadzenie Konta, Usługobiorca uprzywilejowany może złożyć oświadczenie o odstąpieniu od tej umowy, gdy:\n<ol type=\"a\" style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;background:transparent;list-style-position:outside;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">doprowadzenie do zgodności usługi cyfrowej z umową o prowadzenie Konta jest niemożliwe albo wymaga nadmiernych kosztów stosownie do art. 43m ust. 2 i 3 Ustawy o prawach konsumenta;</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Usługodawca nie doprowadził usługi cyfrowej do zgodności z umową o prowadzenie Konta w rozsądnym czasie od chwili, w której Usługodawca został poinformowany przez Usługobiorcę uprzywilejowanego o braku zgodności z tą umową, i bez nadmiernych niedogodności dla Usługobiorcy uprzywilejowanego, uwzględniając charakter oraz cel tej usługi cyfrowej, w jakim jest wykorzystywana;</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">brak zgodności usługi cyfrowej z umową o prowadzenie Konta występuje nadal, mimo że Usługodawca próbował doprowadzić usługę cyfrową do zgodności z tą umową;</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">brak zgodności usługi cyfrowej z umową o prowadzenie Konta jest na tyle istotny, że uzasadnia odstąpienie od umowy o prowadzenie Konta bez uprzedniego skorzystania ze środka ochrony określonego w art. 43m Ustawy o prawach konsumenta (tj. żądania doprowadzenia usługi cyfrowej do zgodności z umową);</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">z oświadczenia Usługodawcy lub okoliczności wyraźnie wynika, że nie doprowadzi on usługi cyfrowej do zgodności z umową o prowadzenie Konta w rozsądnym czasie lub bez nadmiernych niedogodności dla Usługobiorcy uprzywilejowanego.</li>\n</ol>\n</li>\n</ol>\n<h3 style=\"margin:1em 0px 0.7em;padding:0px;border:0px;background:#ffffff;font-family:Montserrat, sans-serif;line-height:1.4em;\">III POZASĄDOWE SPOSOBY ROZPATRYWANIA REKLAMACJI I DOCHODZENIA ROSZCZEŃ</h3>\n<ol start=\"11\" style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;font-size:14px;background:#ffffff;list-style-position:outside;font-family:Montserrat, sans-serif;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Usługodawca informuje Konsumenta o możliwości skorzystania z pozasądowych sposobów rozpatrywania reklamacji i dochodzenia roszczeń. Zasady dostępu do tych procedur dostępne są w siedzibach lub na stronach internetowych podmiotów uprawnionych do pozasądowego rozpatrywania sporów. Konsument może skorzystać m.in. z:\n<ul style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;background:transparent;list-style:disc;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">pomocy odpowiedniego Europejskiego Centrum Konsumenckiego z Sieci Europejskich Centrów Konsumenckich. Centra udzielają informacji o prawach konsumentów i pomagają w rozwiązaniu sporu w przypadku zakupów transgranicznych. Pomoc Europejskich Centrów Konsumenckich jest co do zasady bezpłatna. Lista Centrów Konsumenckich właściwych dla danego państwa znajduje się pod adresem: <a href=\"https://konsument.gov.pl/eck-w-europie/\" target=\"_blank\" style=\"margin:0px;padding:0px;border:0px;background:transparent;color:#f6a802;\" rel=\"noreferrer noopener\">https://konsument.gov.pl/eck-w-europie/</a></li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">internetowej platformy Online Dispute Resolution (ODR), zapewnianej przez Komisję Europejską, dostępnej pod adresem: <a href=\"https://ec.europa.eu/consumers/odr\" target=\"_blank\" style=\"margin:0px;padding:0px;border:0px;background:transparent;color:#f6a802;\" rel=\"noreferrer noopener\">https://ec.europa.eu/consumers/odr</a></li>\n</ul>\nPonadto, na terenie Rzeczypospolitej Polskiej można skorzystać z następujących form wsparcia:\n<ul style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;background:transparent;list-style:disc;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">mediacji prowadzonej przez właściwy terenowo Wojewódzki Inspektorat Inspekcji Handlowej, do którego należy się zwrócić z wnioskiem o mediację. Co do zasady postępowanie jest bezpłatne. Wykaz Inspektoratów znajduje się tutaj: <a href=\"https://uokik.gov.pl/wojewodzkie_inspektoraty_inspekcji_handlowej.php\" target=\"_blank\" style=\"margin:0px;padding:0px;border:0px;background:transparent;color:#f6a802;\" rel=\"noreferrer noopener\">&gt;https://uokik.gov.pl/wojewodzkie_inspektoraty_inspekcji_handlowej.php</a></li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">pomocy właściwego terenowo stałego polubownego sądu konsumenckiego działającego przy Wojewódzkim Inspektoracie Inspekcji Handlowej, do którego należy złożyć wniosek o rozpatrzenie sprawy przed sądem polubownym. Co do zasady postępowanie jest bezpłatne. Wykaz sądów dostępny jest pod adresem: <a href=\"https://uokik.gov.pl/stale_sady_polubowne.php\" target=\"_blank\" style=\"margin:0px;padding:0px;border:0px;background:transparent;color:#f6a802;\" rel=\"noreferrer noopener\">&gt;https://uokik.gov.pl/stale_sady_polubowne.php</a></li>\n</ul>\n</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Poprzednie postanowienie ma charakter informacyjny i nie stanowi zobowiązania Usługodawcy do skorzystania z pozasądowych sposobów rozwiązywania sporów.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Skorzystanie z pozasądowych sposobów rozpatrywania reklamacji i dochodzenia roszczeń jest dobrowolne zarówno dla Usługodawcy jak i Konsumenta.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Konsument może dodatkowo skorzystać z bezpłatnej pomocy miejskiego lub powiatowego rzecznika konsumentów.</li>\n</ol>\n<h2 style=\"margin:0.83em 0px 0.7em;padding:0px;border:0px;background:#ffffff;font-family:Montserrat, sans-serif;line-height:1.4em;\">§ 6 PRAWO ODSTĄPIENIA OD UMOWY</h2>\n<ol style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;font-size:14px;background:#ffffff;list-style-position:outside;font-family:Montserrat, sans-serif;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Usługobiorca uprzywilejowany ma prawo odstąpić od zawartej z Usługodawcą umowy o prowadzenie Konta, w terminie 14 dni bez podania jakiejkolwiek przyczyny.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Termin do odstąpienia od umowy o prowadzenie Konta wygasa po upływie 14 dni od dnia zawarcia tej umowy.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Aby Usługobiorca uprzywilejowany mógł skorzystać z prawa odstąpienia od umowy, musi poinformować Usługodawcę, korzystając z danych podanych w § 2 Regulaminu, o swojej decyzji o odstąpieniu od umowy w drodze jednoznacznego oświadczenia (na przykład pismo wysłane pocztą lub pocztą elektroniczną).</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Usługobiorca uprzywilejowany może skorzystać z wzoru formularza odstąpienia od umowy umieszczonego na końcu Regulaminu, jednak nie jest to obowiązkowe.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Aby zachować termin do odstąpienia od umowy wystarczy, że Usługobiorca uprzywilejowany wyśle informację dotyczącą wykonania przysługującego mu prawa odstąpienia od umowy przed upływem terminu do odstąpienia od umowy.</li>\n</ol>\n<h2 style=\"margin:0.83em 0px 0.7em;padding:0px;border:0px;background:#ffffff;font-family:Montserrat, sans-serif;line-height:1.4em;\">§ 7 DANE OSOBOWE</h2>\n<ol style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;font-size:14px;background:#ffffff;list-style-position:outside;font-family:Montserrat, sans-serif;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Administratorem danych osobowych przekazanych przez Usługobiorcę w związku z zawarciem umowy o prowadzenie Konta jest Usługodawca. Szczegółowe informacje dotyczące przetwarzania danych osobowych przez Usługodawcę – w tym o pozostałych celach oraz podstawach przetwarzania danych, a także o odbiorcach danych, znajdują się w dostępnej w Sklepie polityce prywatności – ze względu na zasadę przejrzystości, zawartą w ogólnym rozporządzeniu Parlamentu Europejskiego i Rady (UE) o ochronie danych – „<span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">RODO</span>”.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Celem przetwarzania danych Usługobiorcy jest prowadzenie Konta. Podstawą przetwarzania danych osobowych w tym przypadku jest umowa o prowadzenie Konta lub działania podejmowane na żądanie Usługobiorcy, zmierzające do jej zawarcia (art. 6 ust. 1 lit. b RODO), a także prawnie uzasadniony interes Usługodawcy, polegający na przetwarzaniu danych w celu ustalenia, dochodzenia lub obrony ewentualnych roszczeń (art. 6 ust. 1 lit. f RODO).</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Podanie danych przez Usługobiorcę jest dobrowolne, ale jednocześnie konieczne do zawarcia umowy o prowadzenie Konta i świadczenia usług nią objętych. Niepodanie danych oznacza, że umowa o prowadzenie Konta nie będzie mogła być zawarta, Usługodawca nie będzie mógł świadczyć usług nią objętych.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Dane Usługobiorcy będą przetwarzane do momentu, w którym:\n<ol type=\"a\" style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;background:transparent;list-style-position:outside;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">przestanie obowiązywać umowa o prowadzenie Konta;</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">ustanie możliwość dochodzenia roszczeń przez Usługobiorcę lub Usługodawcę, związanych z Kontem;</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">zostanie przyjęty sprzeciw Usługobiorcy wobec przetwarzania jego danych osobowych – w przypadku gdy podstawą przetwarzania danych był uzasadniony interes Usługodawcy</li>\n</ol>\n– w zależności od tego, co ma zastosowanie w danym przypadku.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Usługobiorcy przysługuje prawo żądania:\n<ol type=\"a\" style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;background:transparent;list-style-position:outside;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">dostępu do swoich danych osobowych,</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">ich sprostowania,</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">usunięcia,</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">ograniczenia przetwarzania,</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">przeniesienia danych do innego administratora<br />a także prawo:</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">wniesienia w dowolnym momencie sprzeciwu wobec przetwarzania danych z przyczyn związanych ze szczególną sytuacją Usługobiorcy – wobec przetwarzania dotyczących go danych osobowych, opartego na art. 6 ust. 1 lit. f RODO (tj. na prawnie uzasadnionych interesach realizowanych przez Usługodawcę).</li>\n</ol>\n</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">W celu realizacji swoich praw, Usługobiorca powinien skontaktować się z Usługodawcą.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">W przypadku gdy Usługobiorca uzna, że jego dane są przetwarzane niezgodnie z prawem, Usługobiorca może złożyć skargę do organu właściwego dla ochrony danych osobowych. W Polsce jest nim Prezes Urzędu Ochrony Danych Osobowych.</li>\n</ol>\n<h2 style=\"margin:0.83em 0px 0.7em;padding:0px;border:0px;background:#ffffff;font-family:Montserrat, sans-serif;line-height:1.4em;\">§ 8 ZMIANA W REGULAMINIE LUB KONCIE</h2>\n<ol style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;font-size:14px;background:#ffffff;list-style-position:outside;font-family:Montserrat, sans-serif;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Usługodawca zastrzega sobie prawo do zmiany Regulaminu tylko z ważnych przyczyn. Jako ważną przyczynę rozumie się konieczność zmiany Regulaminu spowodowaną:\n<ol type=\"a\" style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;background:transparent;list-style-position:outside;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">zmianą funkcjonalności Konta, wymagającą modyfikacji Regulaminu lub</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">zmianą przepisów prawa, mającą wpływ na realizację umowy o prowadzenie Konta przez Usługodawcę lub dostosowaniem usług do zaleceń, wytycznych, nakazów lub zakazów, orzeczeń, postanowień, interpretacji lub decyzji uprawnionych władz publicznych lub</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">zmianą danych kontaktowych lub identyfikacyjnych Usługodawcy.</li>\n</ol>\n</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Informacja o planowanej zmianie Regulaminu zostanie wysłana na adres e-mail Usługobiorcy przypisany do Konta co najmniej na 7 dni przed wprowadzeniem zmian w życie.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">W przypadku gdy Usługobiorca nie sprzeciwi się planowanym zmianom do chwili wejścia ich w życie, przyjmuje się, że akceptuje je, co nie stanowi żadnej przeszkody do rozwiązania umowy w przyszłości.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">W przypadku braku akceptacji dla planowanych zmian, Usługobiorca powinien wysłać informację o tym na adres e-mail Usługodawcy podany w § 2 Regulaminu, co będzie skutkować rozwiązaniem umowy o prowadzenia Konta z chwilą wejścia w życie planowanych zmian.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Usługodawca może dokonać zmiany Konta, która nie jest niezbędna do zachowania jego zgodności z umową o prowadzenie Konta, z przyczyny wskazanej w ust. 1 lit. b lub z powodu zmiany funkcjonalności Konta. Wprowadzenie zmiany, o której mowa w zdaniu poprzednim, nie będzie się wiązać z jakimikolwiek kosztami po stronie Usługobiorcy uprzywilejowanego. Postanowienie ust. 2-4 stosuje się odpowiednio.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Jeżeli zmiana, o której mowa w ust. 5, istotnie i negatywnie wpływa na dostęp Usługobiorcy uprzywilejowanego do Konta lub korzystanie z niego, Usługodawca wyśle na adres e-mail Usługobiorcy uprzywilejowanego, z odpowiednim wyprzedzeniem, na trwałym nośniku, informację o właściwościach i terminie dokonania tej zmiany oraz prawach przysługujących w związku z tą zmianą Usługobiorcy uprzywilejowanemu.</li>\n</ol>\n<h2 style=\"margin:0.83em 0px 0.7em;padding:0px;border:0px;background:#ffffff;font-family:Montserrat, sans-serif;line-height:1.4em;\">§ 9 POSTANOWIENIA KOŃCOWE</h2>\n<ol style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;font-size:14px;background:#ffffff;list-style-position:outside;font-family:Montserrat, sans-serif;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Zakazane jest dostarczanie przez Usługobiorcę treści o charakterze bezprawnym.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Umowa o prowadzenie Konta zawierana jest w języku polskim.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Umowa zawierana na podstawie niniejszego Regulaminu podlega przepisom prawa polskiego, z zastrzeżeniem ust. 4.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Wybór prawa polskiego dla umowy zawartej na podstawie Regulaminu z Konsumentem nie uchyla i nie ogranicza praw Konsumenta przysługujących mu na podstawie bezwzględnie obowiązujących przepisów prawa, znajdujących zastosowanie dla Konsumenta w sytuacji, w której nie ma miejsca wybór prawa. Oznacza to w szczególności, że jeśli właściwe dla danego Konsumenta przepisy krajowe przewidują ochronę szerszą niż wynikająca z niniejszego Regulaminu lub prawa polskiego – stosuje się tę ochronę szerszą.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">W przypadku ewentualnego sporu z Usługobiorcą niebędącym Usługobiorcą uprzywilejowanym, związanego z umową o prowadzenie Konta, sądem właściwym będzie sąd właściwy dla siedziby Usługodawcy.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Wszelka odpowiedzialność Usługodawcy w związku z umową o prowadzenie Konta w stosunku do Usługobiorcy niebędącego Usługobiorcą uprzywilejowanym, w granicach prawem dopuszczonych, jest wyłączona.</li>\n</ol>\n\n<h2 style=\"margin:2em 0px 0.7em;padding:0px;border:0px;background:transparent;font-family:inherit;line-height:1.4em;\">Załącznik nr 1 do Regulaminu</h2>\nPoniżej znajduje się wzór formularza odstąpienia od umowy, z którego Konsument lub Przedsiębiorca uprzywilejowany może, ale nie musi skorzystać:<br /><br />\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;text-align:center;\"><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">WZÓR FORMULARZA ODSTĄPIENIA OD UMOWY</span><br />(formularz ten należy wypełnić i odesłać tylko w przypadku chęci odstąpienia od umowy)</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">Smooth Sport Łukasz Marcinkowski<br />Cicha 3, 05-090 Raszyn<br />adres e-mail: sklep@geekup.pl</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">- Ja/My(*) ..................................................................... niniejszym informuję/informujemy(*) o moim/naszym odstąpieniu od umowy o świadczenie następującej usługi(*) / o dostarczenie treści cyfrowych w postaci(*):<br /><br />..............................................................................................................................................................................<br /><br />..............................................................................................................................................................................<br /><br />..............................................................................................................................................................................</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">- Data zawarcia umowy<sup style=\"margin:0px;padding:0px;border:0px;font-size:14px;background:transparent;\">(*)</sup><br /><br />..............................................................................................................................................................................<br /><br />- Imię i nazwisko Konsumenta(-ów) / Przedsiębiorcy(-ów) uprzywilejowanego(-ych):<br /><br />..............................................................................................................................................................................<br /><br />- Adres Konsumenta(-ów) / Przedsiębiorcy(-ów) uprzywilejowanego(-ych):<br /><br />..............................................................................................................................................................................<br /><br />..............................................................................................................................................................................<br /><br /></p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;text-align:right;\">.............................................................................................<br />Podpis Konsumenta(-ów) / Przedsiębiorcy(-ów) uprzywilejowanego(-ych)<br /><small style=\"margin:0px;padding:0px;border:0px;font-size:14px;background:transparent;\">(tylko jeżeli formularz jest przesyłany w wersji papierowej)</small><br /><br />Data ............................................</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;text-align:right;\"><small style=\"margin:0px;padding:0px;border:0px;font-size:14px;background:transparent;\">(*) Niepotrzebne skreślić.</small></p>\n\n<p><br style=\"font-family:Montserrat, sans-serif;font-size:14px;background-color:#ffffff;\" /><br style=\"font-family:Montserrat, sans-serif;font-size:14px;background-color:#ffffff;\" /><br style=\"font-family:Montserrat, sans-serif;font-size:14px;background-color:#ffffff;\" /><br style=\"font-family:Montserrat, sans-serif;font-size:14px;background-color:#ffffff;\" /><br style=\"font-family:Montserrat, sans-serif;font-size:14px;background-color:#ffffff;\" /></p>\n<h1 class=\"center clearfix\" style=\"margin:0.67em 0px;padding:0px;border:0px;background:#ffffff;font-family:Montserrat, sans-serif;line-height:1.4em;text-align:center;clear:both;\">Regulamin Newslettera</h1>\n<p class=\"center\" style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;text-align:center;font-family:Montserrat, sans-serif;\">w sklepie GeekUp.pl - Figurki Funko POP, gadżety filmowe, gadżety z gier, komiksów i bajek</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\"><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">SPIS TREŚCI</span><br /><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">§ 1</span> Definicje<br /><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">§ 2</span> Kontakt z Usługodawcą<br /><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">§ 3</span> Wymogi techniczne<br /><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">§ 4</span> Umowa<br /><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">§ 5</span> Reklamacje<br /><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">§ 6</span> Prawo odstąpienia od Umowy<br /><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">§ 7</span> Dane osobowe<br /><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">§ 8</span> Zmiana w Regulaminie lub Newsletterze<br /><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">§ 9</span> Postanowienia końcowe</p>\n<h2 style=\"margin:0.83em 0px 0.7em;padding:0px;border:0px;background:#ffffff;font-family:Montserrat, sans-serif;line-height:1.4em;\">§ 1 DEFINICJE</h2>\n<div style=\"margin:0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\"><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">Konsument</span> – Usługobiorca będący osobą fizyczną, który zawarł Umowę lub podejmuje czynności zmierzające do jej zawarcia, bez bezpośredniego związku z jego działalnością gospodarczą lub zawodową.<br /><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">Newsletter</span> – wiadomości dotyczące Sklepu, w tym informacje o ofertach, promocjach oraz nowościach w Sklepie, dostarczane nieodpłatnie Usługobiorcy przez Usługodawcę w ramach Umowy, stanowiące treści cyfrowe w rozumieniu Ustawy o prawach konsumenta.<br /><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">Przedsiębiorca uprzywilejowany</span> - Usługobiorca, który jest osobą fizyczną zawierającą Umowę (lub podejmującą czynności zmierzające do jej zawarcia), bezpośrednio związaną z jej działalnością gospodarczą, ale nieposiadającą dla niej charakteru zawodowego.<br /><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">Regulamin</span> – niniejszy regulamin.<br /><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">Sklep</span> – sklep internetowy GeekUp.pl - Figurki Funko POP, gadżety filmowe, gadżety z gier, komiksów i bajek prowadzony przez Usługodawcę pod adresem https://geekup.pl.<br /><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">Umowa</span> – umowa o dostarczanie Newslettera.<br /><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">Usługobiorca</span> – każdy podmiot, który zawarł Umowę lub podejmuje czynności zmierzające do jej zawarcia.<br /><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">Usługobiorca uprzywilejowany</span>  – Usługobiorca, który jest Konsumentem lub Przedsiębiorcą uprzywilejowanym.<br /><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">Usługodawca</span> – Łukasz Marcinkowski, przedsiębiorca prowadzący działalność gospodarczą pod firmą Smooth Sport Łukasz Marcinkowski, wpisany do Centralnej Ewidencji i Informacji o Działalności Gospodarczej prowadzonej przez ministra właściwego do spraw gospodarki i prowadzenia Centralnej Ewidencji i Informacji o Działalności Gospodarczej, NIP 5342423841, nr REGON 142004657, Cicha 3, 05-090 Raszyn.<br /><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">Ustawa o prawach konsumenta</span> – polska ustawa z dnia 30 maja 2014 r. o prawach konsumenta.</div>\n<h2 style=\"margin:0.83em 0px 0.7em;padding:0px;border:0px;background:#ffffff;font-family:Montserrat, sans-serif;line-height:1.4em;\">§ 2 KONTAKT Z USŁUGODAWCĄ</h2>\n<ol style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;font-size:14px;background:#ffffff;list-style-position:outside;font-family:Montserrat, sans-serif;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Adres pocztowy: Cicha 3, 05-090 Raszyn</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Adres e-mail: sklep@geekup.pl</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Telefon: 533121806</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Koszt połączenia telefonicznego lub transmisji danych wykonywanych przez Usługobiorcę wynika z podstawowej taryfy operatora telekomunikacyjnego lub dostawcy usług internetowych, z którego usług korzysta Usługobiorca. Usługodawca zwraca uwagę, że koszt połączenia międzynarodowego lub międzynarodowej transmisji danych może być wyższy niż koszt połączenia lub transmisji krajowej – w zależności od taryfy przyjętej przez operatora telekomunikacyjnego lub dostawcę usług internetowych, z usług którego korzysta Usługobiorca.</li>\n</ol>\n<h2 style=\"margin:0.83em 0px 0.7em;padding:0px;border:0px;background:#ffffff;font-family:Montserrat, sans-serif;line-height:1.4em;\">§ 3 WYMOGI TECHNICZNE</h2>\n<ol style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;font-size:14px;background:#ffffff;list-style-position:outside;font-family:Montserrat, sans-serif;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Dla skorzystania z treści cyfrowych objętych Regulaminem potrzebne jest:\n<ul style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;background:transparent;list-style:disc;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">aktywne konto e-mail;</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">urządzenie z dostępem do Internetu;</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">przeglądarka internetowa obsługująca JavaScript i pliki cookies.</li>\n</ul>\n</li>\n</ol>\n<h2 style=\"margin:0.83em 0px 0.7em;padding:0px;border:0px;background:#ffffff;font-family:Montserrat, sans-serif;line-height:1.4em;\">§ 4 UMOWA</h2>\n<ol style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;font-size:14px;background:#ffffff;list-style-position:outside;font-family:Montserrat, sans-serif;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Usługobiorca może dobrowolnie zapisać się do Newslettera.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">W celu otrzymania Newslettera konieczne jest zawarcie Umowy.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Wiadomości e-mail wysyłane w ramach Umowy kierowane będą na adres e-mail podany przez Usługobiorcę w momencie zawierania Umowy.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Usługobiorca, w celu zawarcia Umowy, w pierwszym kroku podaje w przeznaczonym do tego miejscu w Sklepie swój adres e-mail, na który chce otrzymywać wiadomości przesyłane w ramach Umowy. W momencie zapisu na Newsletter zostaje zawarta Umowa na czas nieoznaczony, a Usługodawca rozpocznie jej świadczenie na rzecz Usługobiorcy – z zastrzeżeniem ust. 5.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">W celu właściwej realizacji Umowy Usługobiorca jest obowiązany podać swój prawidłowy adres e-mail.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Newsletter jest dostarczany niezwłocznie po utworzeniu przez Usługodawcę wiadomości przeznaczonych dla Usługobiorców.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">W wiadomościach wysyłanych w ramach Newslettera będzie znajdować się informacja o możliwości wypisania się z niego, a także link do wypisania się.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Usługobiorca może wypisać się z Newslettera bez podawania przyczyny i ponoszenia jakichkolwiek kosztów, w każdym momencie, korzystając z opcji, o której mowa w poprzednim postanowieniu, lub wysyłając wiadomość na adres e-mail Usługodawcy podany w § 2 Regulaminu.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Skorzystanie przez Usługobiorcę z linka do wypisania się z Newslettera lub wysłanie wiadomości z żądaniem wypisania z Newslettera będzie skutkować niezwłocznym rozwiązaniem Umowy.</li>\n</ol>\n<h2 style=\"margin:0.83em 0px 0.7em;padding:0px;border:0px;background:#ffffff;font-family:Montserrat, sans-serif;line-height:1.4em;\">§ 5 REKLAMACJE</h2>\n<h3 style=\"margin:1em 0px 0.7em;padding:0px;border:0px;background:#ffffff;font-family:Montserrat, sans-serif;line-height:1.4em;\">I POSTANOWIENIA OGÓLNE</h3>\n<ol style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;font-size:14px;background:#ffffff;list-style-position:outside;font-family:Montserrat, sans-serif;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Usługodawca prosi o składanie reklamacji dotyczących treści cyfrowych objętych Regulaminem na adres pocztowy lub elektroniczny wskazany w § 2 Regulaminu.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Usługodawca ustosunkuje się do reklamacji w terminie 14 dni od otrzymania zgłoszenia reklamacyjnego.</li>\n</ol>\n<h3 style=\"margin:1em 0px 0.7em;padding:0px;border:0px;background:#ffffff;font-family:Montserrat, sans-serif;line-height:1.4em;\">II USŁUGOBIORCY UPRZYWILEJOWANI</h3>\n<ol start=\"3\" style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;font-size:14px;background:#ffffff;list-style-position:outside;font-family:Montserrat, sans-serif;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Usługodawca ponosi wobec Usługobiorcy uprzywilejowanego odpowiedzialność za zgodność świadczenia z Umową, przewidzianą przez powszechnie obowiązujące przepisy prawa, w tym zwłaszcza przez przepisy Ustawy o prawach konsumenta.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">W przypadku niewłaściwej realizacji przez Usługodawcę Umowy, Usługobiorca uprzywilejowany ma możliwość skorzystania z uprawnień uregulowanych w rozdziale 5b Ustawy o prawach konsumenta.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Jeżeli Usługodawca nie dostarczył treści cyfrowych objętych Umową, Usługobiorca uprzywilejowany może wezwać go do ich dostarczenia. Jeżeli mimo to Usługodawca nie dostarczy treści cyfrowych objętych Umową niezwłocznie lub w dodatkowym, wyraźnie uzgodnionym przez Usługobiorcę uprzywilejowanego i Usługodawcę terminie, Usługobiorca uprzywilejowany może odstąpić od Umowy.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Usługobiorca uprzywilejowany może odstąpić od Umowy bez wzywania do dostarczenia treści cyfrowych objętych Umową, jeżeli:\n<ul style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;background:transparent;list-style:disc;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">z oświadczenia Usługodawcy lub okoliczności wyraźnie wynika, że nie dostarczy treści cyfrowych objętych Umową lub</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Usługobiorca uprzywilejowany i Usługodawca uzgodnili lub z okoliczności zawarcia Umowy wyraźnie wynika, że określony termin dostarczenia treści cyfrowych objętych Umową miał istotne znaczenie dla Usługobiorcy uprzywilejowanego, a Usługodawca nie dostarczył ich w tym terminie.</li>\n</ul>\n</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Usługodawca ponosi odpowiedzialność za brak zgodności Newslettera z Umową, który – z uwagi na fakt, że Newsletter jest dostarczany w sposób ciągły - wystąpił lub ujawnił się w czasie, w którym zgodnie z tą Umową miał być dostarczany.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Jeżeli treści cyfrowe objęte Regulaminem są niezgodne z Umową, Usługobiorca uprzywilejowany może żądać doprowadzenia do ich zgodności z Umową.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">W przypadku braku zgodności z Umową treści cyfrowych objętych Regulaminem, Usługobiorca uprzywilejowany ma obowiązek współpracy z Usługodawcą, w rozsądnym zakresie i przy zastosowaniu najmniej uciążliwych dla siebie środków technicznych, w celu ustalenia, czy brak zgodności z Umową w odpowiednim czasie wynika z cech środowiska cyfrowego Usługobiorcy uprzywilejowanego.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Dodatkowo, jeżeli treści cyfrowe objęte Regulaminem są niezgodne z Umową, Usługobiorca uprzywilejowany może złożyć oświadczenie o odstąpieniu od Umowy, gdy:\n<ul style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;background:transparent;list-style:disc;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">doprowadzenie do zgodności tych treści cyfrowych z Umową jest niemożliwe albo wymaga nadmiernych kosztów stosownie do art. 43m ust. 2 i 3 Ustawy o prawach konsumenta;</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Usługodawca nie doprowadził treści cyfrowych objętych Regulaminem do zgodności z Umową w rozsądnym czasie od chwili, w której Usługodawca został poinformowany przez Usługobiorcę uprzywilejowanego o braku zgodności z Umową, i bez nadmiernych niedogodności dla Usługobiorcy uprzywilejowanego, uwzględniając ich charakter oraz cel, w jakim są wykorzystywane;</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">brak zgodności z Umową treści cyfrowych objętych Regulaminem występuje nadal, mimo że Usługodawca próbował doprowadzić je do zgodności z Umową;</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">brak zgodności z Umową treści cyfrowych objętych Regulaminem jest na tyle istotny, że uzasadnia odstąpienie od Umowy bez uprzedniego skorzystania ze środka ochrony określonego w art. 43m Ustawy o prawach konsumenta (tj. żądania doprowadzenia treści cyfrowych do zgodności z Umową);</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">z oświadczenia Usługodawcy lub okoliczności wyraźnie wynika, że nie doprowadzi on do zgodności z Umową treści cyfrowych objętych Regulaminem w rozsądnym czasie lub bez nadmiernych niedogodności dla Usługobiorcy uprzywilejowanego.</li>\n</ul>\n</li>\n</ol>\n<h3 style=\"margin:1em 0px 0.7em;padding:0px;border:0px;background:#ffffff;font-family:Montserrat, sans-serif;line-height:1.4em;\">III POZASĄDOWE SPOSOBY ROZPATRYWANIA REKLAMACJI I DOCHODZENIA ROSZCZEŃ</h3>\n<ol start=\"11\" style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;font-size:14px;background:#ffffff;list-style-position:outside;font-family:Montserrat, sans-serif;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Usługodawca informuje Konsumenta o możliwości skorzystania z pozasądowych sposobów rozpatrywania reklamacji i dochodzenia roszczeń. Zasady dostępu do tych procedur dostępne są w siedzibach lub na stronach internetowych podmiotów uprawnionych do pozasądowego rozpatrywania sporów. Konsument może skorzystać m.in. z:\n<ul style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;background:transparent;list-style:disc;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">pomocy odpowiedniego Europejskiego Centrum Konsumenckiego z Sieci Europejskich Centrów Konsumenckich. Centra udzielają informacji o prawach konsumentów i pomagają w rozwiązaniu sporu w przypadku zakupów transgranicznych. Pomoc Europejskich Centrów Konsumenckich jest co do zasady bezpłatna. Lista Centrów Konsumenckich właściwych dla danego państwa znajduje się pod adresem: <a href=\"https://konsument.gov.pl/eck-w-europie/\" target=\"_blank\" style=\"margin:0px;padding:0px;border:0px;background:transparent;color:#f6a802;\" rel=\"noreferrer noopener\">https://konsument.gov.pl/eck-w-europie/</a></li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">internetowej platformy Online Dispute Resolution (ODR), zapewnianej przez Komisję Europejską, dostępnej pod adresem: <a href=\"https://ec.europa.eu/consumers/odr\" target=\"_blank\" style=\"margin:0px;padding:0px;border:0px;background:transparent;color:#f6a802;\" rel=\"noreferrer noopener\">https://ec.europa.eu/consumers/odr</a></li>\n</ul>\nPonadto, na terenie Rzeczypospolitej Polskiej można skorzystać z następujących form wsparcia:\n<ul style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;background:transparent;list-style:disc;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">mediacji prowadzonej przez właściwy terenowo Wojewódzki Inspektorat Inspekcji Handlowej, do którego należy się zwrócić z wnioskiem o mediację. Co do zasady postępowanie jest bezpłatne. Wykaz Inspektoratów znajduje się tutaj: <a href=\"https://uokik.gov.pl/wojewodzkie_inspektoraty_inspekcji_handlowej.php\" target=\"_blank\" style=\"margin:0px;padding:0px;border:0px;background:transparent;color:#f6a802;\" rel=\"noreferrer noopener\">https://uokik.gov.pl/wojewodzkie_inspektoraty_inspekcji_handlowej.php</a></li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">pomocy właściwego terenowo stałego polubownego sądu konsumenckiego działającego przy Wojewódzkim Inspektoracie Inspekcji Handlowej, do którego należy złożyć wniosek o rozpatrzenie sprawy przed sądem polubownym. Co do zasady postępowanie jest bezpłatne. Wykaz sądów dostępny jest pod adresem: <a href=\"https://uokik.gov.pl/stale_sady_polubowne.php\" target=\"_blank\" style=\"margin:0px;padding:0px;border:0px;background:transparent;color:#f6a802;\" rel=\"noreferrer noopener\">https://uokik.gov.pl/stale_sady_polubowne.php</a></li>\n</ul>\n</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Poprzednie postanowienie ma charakter informacyjny i nie stanowi zobowiązania Usługodawcy do skorzystania z pozasądowych sposobów rozwiązywania sporów.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Skorzystanie z pozasądowych sposobów rozpatrywania reklamacji i dochodzenia roszczeń jest dobrowolne zarówno dla Usługodawcy jak i Konsumenta.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Konsument może dodatkowo skorzystać z bezpłatnej pomocy miejskiego lub powiatowego rzecznika konsumentów.</li>\n</ol>\n<h2 style=\"margin:0.83em 0px 0.7em;padding:0px;border:0px;background:#ffffff;font-family:Montserrat, sans-serif;line-height:1.4em;\">§ 6 PRAWO ODSTĄPIENIA OD UMOWY</h2>\n<ol style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;font-size:14px;background:#ffffff;list-style-position:outside;font-family:Montserrat, sans-serif;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Usługobiorca uprzywilejowany ma prawo odstąpić od zawartej z Usługodawcą Umowy w terminie 14 dni bez podania jakiejkolwiek przyczyny.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Termin do odstąpienia od Umowy wygasa po upływie 14 dni od dnia zawarcia tej Umowy.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Aby Usługobiorca uprzywilejowany mógł skorzystać z prawa odstąpienia od Umowy, musi poinformować Usługodawcę, korzystając z danych podanych w § 2 Regulaminu, o swojej decyzji o odstąpieniu od Umowy w drodze jednoznacznego oświadczenia (na przykład pismo wysłane pocztą lub pocztą elektroniczną).</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Usługobiorca uprzywilejowany może skorzystać z wzoru formularza odstąpienia od Umowy umieszczonego na końcu Regulaminu, jednak nie jest to obowiązkowe.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Aby zachować termin do odstąpienia od Umowy wystarczy, że Usługobiorca uprzywilejowany wyśle informację dotyczącą wykonania przysługującego mu prawa odstąpienia od Umowy przed upływem terminu do odstąpienia od Umowy.</li>\n</ol>\n<h2 style=\"margin:0.83em 0px 0.7em;padding:0px;border:0px;background:#ffffff;font-family:Montserrat, sans-serif;line-height:1.4em;\">§ 7 DANE OSOBOWE</h2>\n<ol style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;font-size:14px;background:#ffffff;list-style-position:outside;font-family:Montserrat, sans-serif;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Administratorem danych osobowych przekazanych przez Usługobiorcę w związku z Umową jest Usługodawca. Szczegółowe informacje dotyczące przetwarzania danych osobowych przez Usługodawcę – w tym o pozostałych celach oraz podstawach przetwarzania danych, a także o odbiorcach danych, znajdują się w dostępnej w Sklepie polityce prywatności – ze względu na zasadę przejrzystości, zawartą w ogólnym rozporządzeniu Parlamentu Europejskiego i Rady (UE) o ochronie danych – „<span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">RODO</span>”.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Celem przetwarzania danych Usługobiorcy jest:\n<ul style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;background:transparent;list-style:disc;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">realizacja Umowy; podstawą przetwarzania danych osobowych w tym przypadku jest Umowa lub działania podejmowane na żądanie Usługobiorcy, zmierzające do jej zawarcia (art. 6 ust. 1 lit. b RODO);</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">analiza efektywności wysłanych w ramach Umowy wiadomości, celem ustalenia ogólnych zasad dotyczących skutecznej wysyłki w działalności Usługodawcy; podstawą przetwarzania danych osobowych w tym celu jest prawnie uzasadniony interes Usługodawcy (art. 6 ust. 1 lit. f RODO);</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">ustalenie, dochodzenie lub obrona ewentualnych roszczeń związanych z Umową; podstawą przetwarzania danych osobowych w tym celu jest prawnie uzasadniony interes Usługodawcy (art. 6 ust. 1 lit. f RODO).</li>\n</ul>\n</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Podanie danych przez Usługobiorcę jest dobrowolne, ale jednocześnie konieczne do zawarcia Umowy i dostarczenia objętych nią treści cyfrowych. Niepodanie danych spowoduje, że Umowa nie będzie mogła być zawarta, a Usługodawca nie dostarczy objętych nią treści cyfrowych.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Dane Usługobiorcy będą przetwarzane do momentu, w którym:\n<ol type=\"a\" style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;background:transparent;list-style-position:outside;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">przestanie obowiązywać Umowa;</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">ustanie możliwość dochodzenia roszczeń przez Usługobiorcę lub Usługodawcę, związanych z Umową;</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">zostanie przyjęty sprzeciw Usługobiorcy wobec przetwarzania jego danych osobowych – w przypadku gdy podstawą przetwarzania danych był uzasadniony interes Usługodawcy</li>\n</ol>\n– w zależności od tego, co ma zastosowanie w danym przypadku.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Usługobiorcy przysługuje prawo żądania:\n<ol type=\"a\" style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;background:transparent;list-style-position:outside;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">dostępu do swoich danych osobowych,</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">ich sprostowania,</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">usunięcia,</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">ograniczenia przetwarzania,</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">przeniesienia danych do innego administratora<br />a także prawo:</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">wniesienia w dowolnym momencie sprzeciwu wobec przetwarzania danych z przyczyn związanych ze szczególną sytuacją Usługobiorcy – wobec przetwarzania dotyczących go danych osobowych, opartego na art. 6 ust. 1 lit. f RODO (tj. na prawnie uzasadnionych interesach realizowanych przez Usługodawcę).</li>\n</ol>\n</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">W celu realizacji swoich praw, Usługobiorca powinien skontaktować się z Usługodawcą.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">W przypadku gdy Usługobiorca uzna, że jego dane są przetwarzane niezgodnie z prawem, Usługobiorca może złożyć skargę do organu właściwego dla ochrony danych osobowych. W Polsce jest nim Prezes Urzędu Ochrony Danych Osobowych.</li>\n</ol>\n<h2 style=\"margin:0.83em 0px 0.7em;padding:0px;border:0px;background:#ffffff;font-family:Montserrat, sans-serif;line-height:1.4em;\">§ 8 ZMIANA W REGULAMINIE LUB NEWSLETTERZE</h2>\n<ol style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;font-size:14px;background:#ffffff;list-style-position:outside;font-family:Montserrat, sans-serif;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Usługodawca zastrzega sobie prawo do zmiany Regulaminu tylko z ważnych przyczyn. Jako ważną przyczynę rozumie się konieczność zmiany Regulaminu spowodowaną:\n<ol type=\"a\" style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;background:transparent;list-style-position:outside;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">zmianą funkcjonalności Newslettera, wymagającą modyfikacji Regulaminu lub</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">zmianą przepisów prawa, mającą wpływ na realizację Umowy przez Usługodawcę lub dostosowaniem usług do zaleceń, wytycznych, nakazów lub zakazów, orzeczeń, postanowień, interpretacji lub decyzji uprawnionych władz publicznych lub</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">zmianą danych kontaktowych lub identyfikacyjnych Usługodawcy.</li>\n</ol>\n</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Informacja o planowanej zmianie Regulaminu zostanie wysłana na adres e-mail Usługobiorcy podany w momencie zawarcia Umowy co najmniej na 7 dni przed wprowadzeniem zmian w życie.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">W przypadku gdy Usługobiorca nie sprzeciwi się planowanym zmianom do chwili wejścia ich w życie, przyjmuje się, że akceptuje je, co nie stanowi żadnej przeszkody do rozwiązania Umowy w przyszłości.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">W przypadku braku akceptacji dla planowanych zmian, Usługobiorca powinien wysłać informację o tym na adres e-mail Usługodawcy podany w § 2 Regulaminu, co będzie skutkować rozwiązaniem Umowy z chwilą wejścia w życie planowanych zmian.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Usługodawca może dokonać zmiany Newslettera, która nie jest niezbędna do zachowania jego zgodności z Umową, z przyczyny wskazanej w ust. 1 lit. b lub z powodu zmiany funkcjonalności Newslettera. Wprowadzenie zmiany, o której mowa w zdaniu poprzednim, nie będzie się wiązać z jakimikolwiek kosztami po stronie Usługobiorcy uprzywilejowanego. Postanowienie ust. 2-4 stosuje się odpowiednio.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Jeżeli zmiana, o której mowa w poprzednim postanowieniu, istotnie i negatywnie wpływa na dostęp Usługobiorcy uprzywilejowanego do Newslettera lub korzystanie z niego, Usługodawca wyśle na adres e-mail Usługobiorcy uprzywilejowanego z odpowiednim wyprzedzeniem, na trwałym nośniku, informację o właściwościach i terminie dokonania tej zmiany oraz prawach przysługujących w związku z tą zmianą Usługobiorcy uprzywilejowanemu.</li>\n</ol>\n<h2 style=\"margin:0.83em 0px 0.7em;padding:0px;border:0px;background:#ffffff;font-family:Montserrat, sans-serif;line-height:1.4em;\">§ 9 POSTANOWIENIA KOŃCOWE</h2>\n<ol style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;font-size:14px;background:#ffffff;list-style-position:outside;font-family:Montserrat, sans-serif;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Zakazane jest dostarczanie przez Usługobiorcę treści o charakterze bezprawnym.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Umowa zawierana jest w języku polskim.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Umowa zawierana na podstawie niniejszego Regulaminu podlega przepisom prawa polskiego, z zastrzeżeniem ust. 4.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Wybór prawa polskiego dla Umowy zawartej na podstawie Regulaminu z Konsumentem nie uchyla i nie ogranicza praw Konsumenta przysługujących mu na podstawie bezwzględnie obowiązujących przepisów prawa, znajdujących zastosowanie dla tego Konsumenta w sytuacji, w której nie ma miejsca wybór prawa. Oznacza to w szczególności, że jeśli właściwe dla danego Konsumenta przepisy krajowe przewidują ochronę szerszą niż wynikająca z niniejszego Regulaminu lub prawa polskiego – stosuje się tę ochronę szerszą.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">W przypadku ewentualnego sporu z Usługobiorcą niebędącym Usługobiorcą uprzywilejowanym, związanego z Umową, sądem właściwym będzie sąd właściwy dla siedziby Usługodawcy.</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">Wszelka odpowiedzialność Usługodawcy w związku z Umową w stosunku do Usługobiorcy niebędącego Usługobiorcą uprzywilejowanym, w granicach prawem dopuszczonych, jest wyłączona.</li>\n</ol>\n\n<h2 style=\"margin:2em 0px 0.7em;padding:0px;border:0px;background:transparent;font-family:inherit;line-height:1.4em;\">Załącznik nr 1 do Regulaminu</h2>\nPoniżej znajduje się wzór formularza odstąpienia od umowy, z którego Konsument lub Przedsiębiorca uprzywilejowany może, ale nie musi skorzystać:<br /><br />\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;text-align:center;\"><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">WZÓR FORMULARZA ODSTĄPIENIA OD UMOWY</span><br />(formularz ten należy wypełnić i odesłać tylko w przypadku chęci odstąpienia od umowy)</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">Smooth Sport Łukasz Marcinkowski<br />Cicha 3, 05-090 Raszyn<br />adres e-mail: sklep@geekup.pl</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">- Ja/My(*) ..................................................................... niniejszym informuję/informujemy(*) o moim/naszym odstąpieniu od umowy o świadczenie następującej usługi(*) / o dostarczenie treści cyfrowych w postaci(*):<br /><br />..............................................................................................................................................................................<br /><br />..............................................................................................................................................................................<br /><br />..............................................................................................................................................................................</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">- Data zawarcia umowy<sup style=\"margin:0px;padding:0px;border:0px;font-size:14px;background:transparent;\">(*)</sup><br /><br />..............................................................................................................................................................................<br /><br />- Imię i nazwisko Konsumenta(-ów) / Przedsiębiorcy(-ów) uprzywilejowanego(-ych):<br /><br />..............................................................................................................................................................................<br /><br />- Adres Konsumenta(-ów) / Przedsiębiorcy(-ów) uprzywilejowanego(-ych):<br /><br />..............................................................................................................................................................................<br /><br />..............................................................................................................................................................................<br /><br /></p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;text-align:right;\">.............................................................................................<br />Podpis Konsumenta(-ów) / Przedsiębiorcy(-ów) uprzywilejowanego(-ych)<br /><small style=\"margin:0px;padding:0px;border:0px;font-size:14px;background:transparent;\">(tylko jeżeli formularz jest przesyłany w wersji papierowej)</small><br /><br />Data ............................................</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;text-align:right;\"><small style=\"margin:0px;padding:0px;border:0px;font-size:14px;background:transparent;\">(*) Niepotrzebne skreślić.</small></p>\n','regulamin'),(8,1,1,'Polityka prywatności','','','','','polityka-prywatnosci'),(8,2,1,'Polityka prywatności','Geekup - Polityka prywatności','Geekup - Polityka prywatności','polityka prywatności','<h1 class=\"document-heading center\" style=\"margin:0.67em 0px;padding:0px;border:0px;background:#ffffff;font-family:Montserrat, sans-serif;line-height:1.4em;text-align:center;\">Polityka prywatności Sklepu GeekUp.pl - Figurki Funko POP, gadżety filmowe, gadżety z gier, komiksów i bajek<br />https://geekup.pl<br />(„Sklep”)</h1>\n\n<h2 style=\"margin:0.83em 0px 0.7em;padding:0px;border:0px;background:transparent;font-family:inherit;line-height:1.4em;\">Drogi Użytkowniku!</h2>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">Dbamy o Twoją prywatność i chcemy, abyś w czasie korzystania z naszych usług czuł się komfortowo. Dlatego też poniżej prezentujemy Ci najważniejsze informacje o zasadach przetwarzania przez nas Twoich danych osobowych oraz plikach cookies, które są wykorzystywane przez nasz Sklep. Informacje te zostały przygotowane z uwzględnieniem RODO, czyli ogólnego rozporządzenia o ochronie danych.</p>\n\n\n<h2 style=\"margin:0.83em 0px 0.7em;padding:0px;border:0px;background:transparent;font-family:inherit;line-height:1.4em;\">ADMINISTRATOR DANYCH OSOBOWYCH</h2>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">Łukasz Marcinkowski, przedsiębiorca prowadzący działalność gospodarczą pod firmą Smooth Sport Łukasz Marcinkowski, wpisany do Centralnej Ewidencji i Informacji o Działalności Gospodarczej prowadzonej przez ministra właściwego do spraw gospodarki i prowadzenia Centralnej Ewidencji i Informacji o Działalności Gospodarczej, NIP 5342423841, nr REGON 142004657, Cicha 3, 05-090 Raszyn.</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">Jeśli chcesz skontaktować się z nami w związku z przetwarzaniem przez nas Twoich danych osobowych, napisz do nas na adres e-mail: sklep@geekup.pl.</p>\n\n\n<h2 style=\"margin:0.83em 0px 0.7em;padding:0px;border:0px;background:transparent;font-family:inherit;line-height:1.4em;\">TWOJE UPRAWNIENIA</h2>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">Przysługuje Ci prawo żądania:</p>\n<ul style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;background:transparent;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">dostępu do Twoich danych osobowych, w tym uzyskania kopii Twoich danych (art. 15 RODO lub - jeśli ma to zastosowanie - art. 13 ust. 1 lit. f RODO),</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">ich sprostowania (art. 16 RODO),</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">usunięcia (art. 17 RODO),</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">ograniczenia przetwarzania (art. 18 RODO),</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">przeniesienia danych do innego administratora (art. 20 RODO).</li>\n</ul>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">A także prawo:</p>\n<ul style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;background:transparent;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">wniesienia w dowolnym momencie sprzeciwu wobec przetwarzania Twoich danych:\n<ul style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;background:transparent;list-style:disc;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">z przyczyn związanych z Twoją szczególną sytuacją – wobec przetwarzania dotyczących Ciebie danych osobowych, opartego na art. 6 ust. 1 lit. f RODO (tj. na realizowanych przez nas prawnie uzasadnionych interesach), w tym profilowania (art. 21 ust. 1 RODO);</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">jeżeli dane osobowe są przetwarzane na potrzeby marketingu bezpośredniego, w tym profilowania, w zakresie, w jakim przetwarzanie jest związane z takim marketingiem bezpośrednim (art. 21 ust. 2 RODO).</li>\n</ul>\n</li>\n</ul>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">Skontaktuj się z nami, jeśli chcesz skorzystać ze swoich praw. Sprzeciw w odniesieniu do wykorzystywania przez nas plików cookies (o których przeczytasz poniżej) możesz wyrazić zwłaszcza za pomocą odpowiednich ustawień przeglądarki.</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">Jeśli uznasz, że Twoje dane są przetwarzane niezgodnie z prawem, możesz złożyć skargę do Prezesa Urzędu Ochrony Danych Osobowych.</p>\n\n\n<h2 style=\"margin:0.83em 0px 0.7em;padding:0px;border:0px;background:transparent;font-family:inherit;line-height:1.4em;\">DANE OSOBOWE I PRYWATNOŚĆ</h2>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">Poniżej znajdziesz szczegółowe informacje na temat przetwarzania Twoich danych w zależności od podejmowanych przez Ciebie działań.</p>\n<h3 style=\"margin:1em 0px 0.7em;padding:0px;border:0px;background:transparent;font-family:inherit;line-height:1.4em;\">1. Złożenie zamówienia w Sklepie</h3>\n<table style=\"background:transparent;border-collapse:collapse;border-color:transparent;border-spacing:0px;border-width:0px;margin:1em 0px 0px;padding:0px;width:1050px;max-width:75em;\">\n<tbody style=\"background:transparent;border-collapse:collapse;border-color:transparent;border-spacing:0px;border-width:0px;margin:0px;padding:0px;\">\n<tr style=\"background:transparent;border-collapse:collapse;border-color:transparent;border-spacing:0px;border-width:0px;margin:0px;padding:0px;\">\n<th colspan=\"2\" style=\"background:#eeeeee;border-collapse:collapse;border:1px solid #000000;border-spacing:0px;font-size:14px;margin:0px;padding:0.5em 1em;text-align:center;\">W jakim celu?</th>\n</tr>\n<tr style=\"background:transparent;border-co