pse;border:1px solid #000000;border-spacing:0px;font-size:14px;margin:0px;padding:0.5em 1em;text-align:center;\">Jak długo?</th>\n</tr>\n<tr style=\"background:transparent;border-collapse:collapse;border-color:transparent;border-spacing:0px;border-width:0px;margin:0px;padding:0px;\">\n<td style=\"background-size:initial;border-collapse:collapse;border:1px solid #000000;border-spacing:0px;font-size:14px;margin:0px;padding:0.5em 1em;text-align:center;\">przez okres obowiązywania wyżej wymienionej umowy</td>\n</tr>\n<tr style=\"background:transparent;border-collapse:collapse;border-color:transparent;border-spacing:0px;border-width:0px;margin:0px;padding:0px;\">\n<td style=\"background-size:initial;border-collapse:collapse;border:1px solid #000000;border-spacing:0px;font-size:14px;margin:0px;padding:0.5em 1em;text-align:center;\">ponadto, Twoje dane będą przetwarzane do upływu okresu, w którym możliwe jest dochodzenie roszczeń – przez Ciebie lub przez nas<br />(więcej informacji na ten temat znajdziesz w ostatniej tabeli tej sekcji)</td>\n</tr>\n<tr style=\"background:transparent;border-collapse:collapse;border-color:transparent;border-spacing:0px;border-width:0px;margin:0px;padding:0px;\">\n<th style=\"background:#eeeeee;border-collapse:collapse;border:1px solid #000000;border-spacing:0px;font-size:14px;margin:0px;padding:0.5em 1em;text-align:center;\">Co się stanie, jeśli nie podasz danych?</th>\n</tr>\n<tr style=\"background:transparent;border-collapse:collapse;border-color:transparent;border-spacing:0px;border-width:0px;margin:0px;padding:0px;\">\n<td style=\"background-size:initial;border-collapse:collapse;border:1px solid #000000;border-spacing:0px;font-size:14px;margin:0px;padding:0.5em 1em;text-align:center;\">nie będziesz mieć możliwości założenia konta i korzystania z jego funkcji, takich jak przeglądanie historii zamówień czy sprawdzenie statusu zamówienia</td>\n</tr>\n</tbody>\n</table>\n<br />\n<h3 style=\"margin:1em 0px 0.7em;padding:0px;border:0px;background:transparent;font-family:inherit;line-height:1.4em;\">3. Nawiązanie z nami kontaktu (np. w celu zadania pytania)</h3>\n<table style=\"background:transparent;border-collapse:collapse;border-color:transparent;border-spacing:0px;border-width:0px;margin:1em 0px 0px;padding:0px;width:1050px;max-width:75em;\">\n<tbody style=\"background:transparent;border-collapse:collapse;border-color:transparent;border-spacing:0px;border-width:0px;margin:0px;padding:0px;\">\n<tr style=\"background:transparent;border-collapse:collapse;border-color:transparent;border-spacing:0px;border-width:0px;margin:0px;padding:0px;\">\n<th colspan=\"2\" style=\"background:#eeeeee;border-collapse:collapse;border:1px solid #000000;border-spacing:0px;font-size:14px;margin:0px;padding:0.5em 1em;text-align:center;\">W jakim celu?</th>\n</tr>\n<tr style=\"background:transparent;border-collapse:collapse;border-color:transparent;border-spacing:0px;border-width:0px;margin:0px;padding:0px;\">\n<td colspan=\"2\" style=\"background-size:initial;border-collapse:collapse;border:1px solid #000000;border-spacing:0px;font-size:14px;margin:0px;padding:0.5em 1em;text-align:center;\">obsługa Twoich zapytań lub zgłoszeń</td>\n</tr>\n<tr style=\"background:transparent;border-collapse:collapse;border-color:transparent;border-spacing:0px;border-width:0px;margin:0px;padding:0px;\">\n<th colspan=\"2\" style=\"background:#eeeeee;border-collapse:collapse;border:1px solid #000000;border-spacing:0px;font-size:14px;margin:0px;padding:0.5em 1em;text-align:center;\">Na jakiej podstawie?</th>\n</tr>\n<tr style=\"background:transparent;border-collapse:collapse;border-color:transparent;border-spacing:0px;border-width:0px;margin:0px;padding:0px;\">\n<td style=\"background-size:initial;border-collapse:collapse;border:1px solid #000000;border-spacing:0px;font-size:14px;margin:0px;padding:0.5em 1em;text-align:center;width:495.5px;\">umowa lub działania podejmowane na Twoje żądanie, zmierzające do jej zawarcia (art. 6 ust. 1 lit. b RODO) 