(więcej na ten temat przeczytasz w sekcji „Działania analityczne” Polityki prywatności)</td>\n</tr>\n<tr style=\"background:transparent;border-collapse:collapse;border-color:transparent;border-spacing:0px;border-width:0px;margin:0px;padding:0px;\">\n<th colspan=\"2\" style=\"background:#eeeeee;border-collapse:collapse;border:1px solid #000000;border-spacing:0px;font-size:14px;margin:0px;padding:0.5em 1em;text-align:center;\">Na jakiej podstawie?</th>\n</tr>\n<tr style=\"background:transparent;border-collapse:collapse;border-color:transparent;border-spacing:0px;border-width:0px;margin:0px;padding:0px;\">\n<td style=\"background-size:initial;border-collapse:collapse;border:1px solid #000000;border-spacing:0px;font-size:14px;margin:0px;padding:0.5em 1em;text-align:center;width:495.5px;\">umowa o świadczenie usługi wysyłki newslettera (art. 6 ust. 1 lit. b RODO)</td>\n<td style=\"background-size:initial;border-collapse:collapse;border:1px solid #000000;border-spacing:0px;font-size:14px;margin:0px;padding:0.5em 1em;text-align:center;width:495.5px;\">nasz prawnie uzasadniony interes, polegający na przetwarzaniu danych w podanym wyżej celu (art. 6 ust. 1 lit. f RODO)</td>\n</tr>\n<tr style=\"background:transparent;border-collapse:collapse;border-color:transparent;border-spacing:0px;border-width:0px;margin:0px;padding:0px;\">\n<th colspan=\"2\" style=\"background:#eeeeee;border-collapse:collapse;border:1px solid #000000;border-spacing:0px;font-size:14px;margin:0px;padding:0.5em 1em;text-align:center;\">Jak długo?</th>\n</tr>\n<tr style=\"background:transparent;border-collapse:collapse;border-color:transparent;border-spacing:0px;border-width:0px;margin:0px;padding:0px;\">\n<td style=\"background-size:initial;border-collapse:collapse;border:1px solid #000000;border-spacing:0px;font-size:14px;margin:0px;padding:0.5em 1em;text-align:center;width:495.5px;\">do momentu, w którym wypiszesz się z naszego newslettera</td>\n<td style=\"background-size:initial;border-collapse:collapse;border:1px solid #000000;border-spacing:0px;font-size:14px;margin:0px;padding:0.5em 1em;text-align:center;width:495.5px;\">do momentu, w którym uwzględnimy Twój sprzeciw wobec przetwarzania</td>\n</tr>\n<tr style=\"background:transparent;border-collapse:collapse;border-color:transparent;border-spacing:0px;border-width:0px;margin:0px;padding:0px;\">\n<td colspan=\"2\" style=\"background-size:initial;border-collapse:collapse;border:1px solid #000000;border-spacing:0px;font-size:14px;margin:0px;padding:0.5em 1em;text-align:center;\">ponadto, Twoje dane będą przetwarzane do upływu okresu, w którym możliwe jest dochodzenie roszczeń – przez Ciebie lub przez nas<br />(więcej informacji na ten temat znajdziesz w ostatniej tabeli tej sekcji)</td>\n</tr>\n<tr style=\"background:transparent;border-collapse:collapse;border-color:transparent;border-spacing:0px;border-width:0px;margin:0px;padding:0px;\">\n<th colspan=\"2\" style=\"background:#eeeeee;border-collapse:collapse;border:1px solid #000000;border-spacing:0px;font-size:14px;margin:0px;padding:0.5em 1em;text-align:center;\">Co się stanie, jeśli nie podasz danych?</th>\n</tr>\n<tr style=\"background:transparent;border-collapse:collapse;border-color:transparent;border-spacing:0px;border-width:0px;margin:0px;padding:0px;\">\n<td colspan=\"2\" style=\"background-size:initial;border-collapse:collapse;border:1px solid #000000;border-spacing:0px;font-size:14px;margin:0px;padding:0.5em 1em;text-align:center;\">nie będziesz mieć możliwości otrzymywania informacji dotyczących Sklepu i naszych usług</td>\n</tr>\n</tbody>\n</table>\n<br />\n<h3 style=\"margin:1em 0px 0.7em;padding:0px;border:0px;background:transparent;font-family:inherit;line-height:1.4em;\">8. Podjęcie działania lub zaniechanie mogące powodować powstanie roszczeń związanych ze Sklepem lub naszymi usługami</h3>\n<table style=\"background:transparent;border-collapse:collapse;border-color:transparent;border-spacing:0px;border-width:0px;margin:1em 0px 0px;padding:0px;width:1050px;max-width:75em;\">\n<tbody style=\"background:transparent;border-collapse:collapse;border-color:transparent;border-spacing:0px;border-width:0px;margin:0px;padding:0px;\">\n<tr style=\"background:transparent;border-collapse:collapse;border-color:transparent;border-spacing:0px;border-width:0px;margin:0px;padding:0px;\">\n<th style=\"background:#eeeeee;border-collapse:collapse;border:1px solid #000000;border-spacing:0px;font-size:14px;margin:0px;padding:0.5em 1em;text-align:center;\">W jakim celu?</th>\n</tr>\n<tr style=\"background:transparent;border-collapse:collapse;border-color:transparent;border-spacing:0px;border-width:0px;margin:0px;padding:0px;\">\n<td style=\"background-size:initial;border-collapse:collapse;border:1px solid #000000;border-spacing:0px;font-size:14px;margin:0px;padding:0.5em 1em;text-align:center;\">ustalenie, dochodzenie lub obrona ewentualnych roszczeń, związanych z zawartą umową lub świadczonymi usługami</td>\n</tr>\n<tr style=\"background:transparent;border-collapse:collapse;border-color:transparent;border-spacing:0px;border-width:0px;margin:0px;padding:0px;\">\n<th style=\"background:#eeeeee;border-collapse:collapse;border:1px solid #000000;border-spacing:0px;font-size:14px;margin:0px;padding:0.5em 1em;text-align:center;\">Na jakiej podstawie?</th>\n</tr>\n<tr style=\"background:transparent;border-collapse:collapse;border-color:transparent;border-spacing:0px;border-width:0px;margin:0px;padding:0px;\">\n<td style=\"background-size:initial;border-collapse:collapse;border:1px solid #000000;border-spacing:0px;font-size:14px;margin:0px;padding:0.5em 1em;text-align:center;\">nasz prawnie uzasadniony interes, polegający na przetwarzaniu danych osobowych we wskazanym powyżej celu (art. 6 ust. 1 lit. f RODO)</td>\n</tr>\n<tr style=\"background:transparent;border-collapse:collapse;border-color:transparent;border-spacing:0px;border-width:0px;margin:0px;padding:0px;\">\n<th style=\"background:#eeeeee;border-collapse:collapse;border:1px solid #000000;border-spacing:0px;font-size:14px;margin:0px;padding:0.5em 1em;text-align:center;\">Jak długo?</th>\n</tr>\n<tr style=\"background:transparent;border-collapse:collapse;border-color:transparent;border-spacing:0px;border-width:0px;margin:0px;padding:0px;\">\n<td style=\"background-size:initial;border-collapse:collapse;border:1px solid #000000;border-spacing:0px;font-size:14px;margin:0px;padding:0.5em 1em;text-align:center;\">do upływu okresu przedawnienia roszczeń lub do momentu, w którym uwzględnimy Twój sprzeciw wobec przetwarzania*</td>\n</tr>\n<tr style=\"background:transparent;border-collapse:collapse;border-color:transparent;border-spacing:0px;border-width:0px;margin:0px;padding:0px;\">\n<th style=\"background:#eeeeee;border-collapse:collapse;border:1px solid #000000;border-spacing:0px;font-size:14px;margin:0px;padding:0.5em 1em;text-align:center;\">Co się stanie, jeśli nie podasz danych?</th>\n</tr>\n<tr style=\"background:transparent;border-collapse:collapse;border-color:transparent;border-spacing:0px;border-width:0px;margin:0px;padding:0px;\">\n<td style=\"background-size:initial;border-collapse:collapse;border:1px solid #000000;border-spacing:0px;font-size:14px;margin:0px;padding:0.5em 1em;text-align:center;\">brak możliwości ustalenia, dochodzenia lub obrony roszczeń</td>\n</tr>\n</tbody>\n</table>\n* w zależności od tego, które ma zastosowanie w danym przypadku<br /><br />\n\n<h2 style=\"margin:0.83em 0px 0.7em;padding:0px;border:0px;background:transparent;font-family:inherit;line-height:1.4em;\">PUBLIKOWANIE DANYCH</h2>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">Jeśli zdecydujesz się na opublikowanie komentarza, jego treść oraz Twój podpis będą widoczne dla innych użytkowników Sklepu.</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">Nie ujawniamy innym użytkownikom Twojego adresu e-mail – chyba że sam to zrobisz.</p>\n\n\n<h2 style=\"margin:0.83em 0px 0.7em;padding:0px;border:0px;background:transparent;font-family:inherit;line-height:1.4em;\">PROFILOWANIE</h2>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">W ramach Sklepu dokonujemy profilowania – w odniesieniu do Ciebie będzie to miało miejsce, jeśli zezwolisz na takie działania. Profilowanie to polega na automatycznej ocenie, jakimi produktami lub usługami możesz być zainteresowany, wykorzystując do tego informacje o wyświetlanych przez Ciebie treściach. Dzięki temu, reklamy produktów lub usług wyświetlane w ramach usług internetowych, z których korzystasz, będą bardziej dostosowane do Ciebie i Twoich potrzeb.</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">Profilowanie, którego dokonujemy, nie skutkuje podejmowaniem decyzji wywołujących wobec Ciebie skutki prawne lub wpływających na Ciebie w podobnie istotny sposób.</p>\n\n\n<h2 style=\"margin:0.83em 0px 0.7em;padding:0px;border:0px;background:transparent;font-family:inherit;line-height:1.4em;\">DZIAŁANIA ANALITYCZNE</h2>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">W ramach strony internetowej Sklepu prowadzimy działania analityczne, mające na celu zwiększenie jej intuicyjności i przystępności – w odniesieniu do Ciebie będzie to miało miejsce, jeśli zezwolisz na takie działania. W ramach analizy będziemy brać pod uwagę sposób, w jaki poruszasz się po Sklepie – a więc np. to, ile czasu spędzasz na danej podstronie, czy w które miejsca w Sklepie klikasz. Dzięki temu podczas prac nad rozwojem Sklepu będziemy mogli zoptymalizować jego układ, wygląd oraz zamieszczane w nim treści, tak aby polepszyć jego funkcjonalność.</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">Ponadto, jeśli wyrazisz wolę otrzymywania od nas wiadomości marketingowych lub newslettera, możemy dokonywać analizy efektywności przeprowadzonej przez nas wysyłki. Przykładowo, możemy sprawdzić, czy i w jaki sposób wpłynęła ona na aktywność w naszym Sklepie. Takie działania pomogą nam ustalić ogólne zasady dotyczące wysyłki tego typu wiadomości w naszej działalności - np. w zakresie optymalnych godzin wysyłki czy sposobu formułowania skutecznych treści.</p>\n\n\n<h2 style=\"margin:0.83em 0px 0.7em;padding:0px;border:0px;background:transparent;font-family:inherit;line-height:1.4em;\">BEZPIECZEŃSTWO DANYCH</h2>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">Przetwarzając Twoje dane osobowe stosujemy środki organizacyjne i techniczne zgodne z właściwymi przepisami prawa, w tym stosujemy szyfrowanie połączenia za pomocą certyfikatu SSL/TLS.</p>\n\n\n<h2 style=\"margin:0.83em 0px 0.7em;padding:0px;border:0px;background:transparent;font-family:inherit;line-height:1.4em;\">PLIKI COOKIES</h2>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">Nasz Sklep, jak większość witryn internetowych, korzysta z tzw. plików cookies (ciasteczek). Pliki te:</p>\n<ul style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;background:transparent;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">są zapisywane w pamięci Twojego urządzenia (komputera, telefonu, itd.);</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">nie powodują zmian w ustawieniach Twojego urządzenia.</li>\n</ul>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">W tym Sklepie ciasteczka wykorzystywane są w celach:</p>\n<ul style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;background:transparent;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">zapamiętywania Twojej sesji</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">statystycznych</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">marketingowych</li>\n</ul>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">Aby dowiedzieć się, jak zarządzać plikami cookies, w tym jak wyłączyć ich obsługę w Twojej przeglądarce, możesz skorzystać z pliku pomocy Twojej przeglądarki. Z informacjami na ten temat możesz zapoznać się wciskając klawisz F1 w przeglądarce. Ponadto odpowiednie wskazówki znajdziesz na następujących podstronach, w zależności od przeglądarki, której używasz:</p>\n<ul style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;background:transparent;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\"><a href=\"https://support.google.com/chrome/answer/95647?hl=pl\" target=\"_blank\" style=\"margin:0px;padding:0px;border:0px;background:transparent;color:#f6a802;\" rel=\"noreferrer noopener\">Google Chrome</a></li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\"><a href=\"https://help.opera.com/pl/latest/web-preferences/#cookies\" target=\"_blank\" style=\"margin:0px;padding:0px;border:0px;background:transparent;color:#f6a802;\" rel=\"noreferrer noopener\">Opera</a></li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\"><a href=\"https://support.apple.com/pl-pl/guide/safari/sfri11471/mac\" target=\"_blank\" style=\"margin:0px;padding:0px;border:0px;background:transparent;color:#f6a802;\" rel=\"noreferrer noopener\">Safari</a></li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\"><a href=\"https://support.mozilla.org/pl/kb/elementy-sledzace-zewnetrznych-witryn\" target=\"_blank\" style=\"margin:0px;padding:0px;border:0px;background:transparent;color:#f6a802;\" rel=\"noreferrer noopener\">Mozilla Firefox</a></li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\"><a href=\"https://support.microsoft.com/pl-pl/help/4468242/microsoft-edge-browsing-data-and-privacy\" target=\"_blank\" style=\"margin:0px;padding:0px;border:0px;background:transparent;color:#f6a802;\" rel=\"noreferrer noopener\">Microsoft Edge</a></li>\n</ul>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">Poniżej znajdziesz informacje na temat funkcji przetwarzanych przez nas plików cookie oraz ich okresie ważności.</p>\n<table style=\"background:transparent;border-collapse:collapse;border-color:transparent;border-spacing:0px;border-width:0px;margin:1em 0px 0px;padding:0px;width:1050px;max-width:75em;\">\n<tbody style=\"background:transparent;border-collapse:collapse;border-color:transparent;border-spacing:0px;border-width:0px;margin:0px;padding:0px;\">\n<tr style=\"background:transparent;border-collapse:collapse;border-color:transparent;border-spacing:0px;border-width:0px;margin:0px;padding:0px;\">\n<th style=\"background:#eeeeee;border-collapse:collapse;border:1px solid #000000;border-spacing:0px;font-size:14px;margin:0px;padding:0.5em 1em;text-align:center;\">nazwa pliku cookie</th>\n<th style=\"background:#eeeeee;border-collapse:collapse;border:1px solid #000000;border-spacing:0px;font-size:14px;margin:0px;padding:0.5em 1em;text-align:center;\">okres ważności pliku cookie</th>\n<th style=\"background:#eeeeee;border-collapse:collapse;border:1px solid #000000;border-spacing:0px;font-size:14px;margin:0px;padding:0.5em 1em;text-align:center;\">funkcja pliku cookie</th>\n</tr>\n<tr style=\"background:transparent;border-collapse:collapse;border-color:transparent;border-spacing:0px;border-width:0px;margin:0px;padding:0px;\">\n<td style=\"background-size:initial;border-collapse:collapse;border:1px solid #000000;border-spacing:0px;font-size:14px;margin:0px;padding:0.5em 1em;text-align:center;\">Statystyka</td>\n<td style=\"background-size:initial;border-collapse:collapse;border:1px solid #000000;border-spacing:0px;font-size:14px;margin:0px;padding:0.5em 1em;text-align:center;\">czas trwania sesji</td>\n<td style=\"background-size:initial;border-collapse:collapse;border:1px solid #000000;border-spacing:0px;font-size:14px;margin:0px;padding:0.5em 1em;text-align:center;\">śledzenie ruchu w Sklepie w celach statystycznych</td>\n</tr>\n</tbody>\n</table>\n<br />\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">Korzystając z odpowiednich opcji Twojej przeglądarki, w każdej chwili możesz:</p>\n<ul style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;background:transparent;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">usunąć pliki cookies,</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">blokować wykorzystanie plików cookies w przyszłości.</li>\n</ul>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">W takich przypadkach nie będziemy ich już dłużej przetwarzać.</p>\n\n\n<h2 style=\"margin:0.83em 0px 0.7em;padding:0px;border:0px;background:transparent;font-family:inherit;line-height:1.4em;\">USŁUGI ZEWNĘTRZNE / ODBIORCY DANYCH</h2>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">Korzystamy z usług podmiotów zewnętrznych, które wspierają nas w prowadzeniu działalności. Powierzamy im do przetwarzania Twoje dane – podmioty te przetwarzają dane wyłącznie na nasze udokumentowane polecenie.</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">Poniżej znajdziesz listę odbiorców Twoich danych:</p>\n<table style=\"background:transparent;border-collapse:collapse;border-color:transparent;border-spacing:0px;border-width:0px;margin:1em 0px 0px;padding:0px;width:1050px;max-width:75em;\">\n<tbody style=\"background:transparent;border-collapse:collapse;border-color:transparent;border-spacing:0px;border-width:0px;margin:0px;padding:0px;\">\n<tr style=\"background:transparent;border-collapse:collapse;border-color:transparent;border-spacing:0px;border-width:0px;margin:0px;padding:0px;\">\n<th style=\"background:#eeeeee;border-collapse:collapse;border:1px solid #000000;border-spacing:0px;font-size:14px;margin:0px;padding:0.5em 1em;text-align:center;\">DZIAŁANIE</th>\n<th style=\"background:#eeeeee;border-collapse:collapse;border:1px solid #000000;border-spacing:0px;font-size:14px;margin:0px;padding:0.5em 1em;text-align:center;\">ODBIORCY DANYCH</th>\n<th style=\"background:#eeeeee;border-collapse:collapse;border:1px solid #000000;border-spacing:0px;font-size:14px;margin:0px;padding:0.5em 1em;text-align:center;\">PRZEKAZANIE DANYCH POZA UNIĘ EUROPEJSKĄ</th>\n</tr>\n<tr style=\"background:transparent;border-collapse:collapse;border-color:transparent;border-spacing:0px;border-width:0px;margin:0px;padding:0px;\">\n<th rowspan=\"1\" style=\"background:#eeeeee;border-collapse:collapse;border:1px solid #000000;border-spacing:0px;font-size:14px;margin:0px;padding:0.5em 1em;text-align:center;\">każde działanie w związku ze Sklepem</th>\n<td style=\"background-size:initial;border-collapse:collapse;border:1px solid #000000;border-spacing:0px;font-size:14px;margin:0px;padding:0.5em 1em;text-align:center;\">dostawca oprogramowania do prowadzenia sprzedaży</td>\n<td style=\"background-size:initial;border-collapse:collapse;border:1px solid #000000;border-spacing:0px;font-size:14px;margin:0px;padding:0.5em 1em;text-align:center;\">nie ma miejsca</td>\n</tr>\n<tr style=\"background:transparent;border-collapse:collapse;border-color:transparent;border-spacing:0px;border-width:0px;margin:0px;padding:0px;\">\n<th rowspan=\"1\" style=\"background:#eeeeee;border-collapse:collapse;border:1px solid #000000;border-spacing:0px;font-size:14px;margin:0px;padding:0.5em 1em;text-align:center;\">przebywanie na stronie Sklepu z ustawieniami zezwalającymi na prowadzenie działań marketingowych</th>\n<td style=\"background-size:initial;border-collapse:collapse;border:1px solid #000000;border-spacing:0px;font-size:14px;margin:0px;padding:0.5em 1em;text-align:center;\">podmiot zapewniający usługi marketingowe</td>\n<td style=\"background-size:initial;border-collapse:collapse;border:1px solid #000000;border-spacing:0px;font-size:14px;margin:0px;padding:0.5em 1em;text-align:center;\">nie ma miejsca</td>\n</tr>\n<tr style=\"background:transparent;border-collapse:collapse;border-color:transparent;border-spacing:0px;border-width:0px;margin:0px;padding:0px;\">\n<th rowspan=\"2\" style=\"background:#eeeeee;border-collapse:collapse;border:1px solid #000000;border-spacing:0px;font-size:14px;margin:0px;padding:0.5em 1em;text-align:center;\">złożenie zamówienia w Sklepie</th>\n<td style=\"background-size:initial;border-collapse:collapse;border:1px solid #000000;border-spacing:0px;font-size:14px;margin:0px;padding:0.5em 1em;text-align:center;\">dostawca płatności</td>\n<td style=\"background-size:initial;border-collapse:collapse;border:1px solid #000000;border-spacing:0px;font-size:14px;margin:0px;padding:0.5em 1em;text-align:center;\">nie ma miejsca</td>\n</tr>\n<tr style=\"background:transparent;border-collapse:collapse;border-color:transparent;border-spacing:0px;border-width:0px;margin:0px;padding:0px;\">\n<td style=\"background-size:initial;border-collapse:collapse;border:1px solid #000000;border-spacing:0px;font-size:14px;margin:0px;padding:0.5em 1em;text-align:center;\">biuro rachunkowe</td>\n<td style=\"background-size:initial;border-collapse:collapse;border:1px solid #000000;border-spacing:0px;font-size:14px;margin:0px;padding:0.5em 1em;text-align:center;\">nie ma miejsca</td>\n</tr>\n<tr style=\"background:transparent;border-collapse:collapse;border-color:transparent;border-spacing:0px;border-width:0px;margin:0px;padding:0px;\">\n<th rowspan=\"1\" style=\"background:#eeeeee;border-collapse:collapse;border:1px solid #000000;border-spacing:0px;font-size:14px;margin:0px;padding:0.5em 1em;text-align:center;\">zapis na newsletter lub wyrażenie zgody na przesyłanie wiadomości marketingowych</th>\n<td style=\"background-size:initial;border-collapse:collapse;border:1px solid #000000;border-spacing:0px;font-size:14px;margin:0px;padding:0.5em 1em;text-align:center;\">podmiot zapewniający wysyłkę newslettera lub wiadomości marketingowych</td>\n<td style=\"background-size:initial;border-collapse:collapse;border:1px solid #000000;border-spacing:0px;font-size:14px;margin:0px;padding:0.5em 1em;text-align:center;\">nie ma miejsca</td>\n</tr>\n<tr style=\"background:transparent;border-collapse:collapse;border-color:transparent;border-spacing:0px;border-width:0px;margin:0px;padding:0px;\">\n<th rowspan=\"1\" style=\"background:#eeeeee;border-collapse:collapse;border:1px solid #000000;border-spacing:0px;font-size:14px;margin:0px;padding:0.5em 1em;text-align:center;\">skorzystanie przez Ciebie z usług dostarczanych nam w związku ze Sklepem przez portale społecznościowe</th>\n<td style=\"background-size:initial;border-collapse:collapse;border:1px solid #000000;border-spacing:0px;font-size:14px;margin:0px;padding:0.5em 1em;text-align:center;\">portale społecznościowe</td>\n<td style=\"background-size:initial;border-collapse:collapse;border:1px solid #000000;border-spacing:0px;font-size:14px;margin:0px;padding:0.5em 1em;text-align:center;\">nie ma miejsca</td>\n</tr>\n<tr style=\"background:transparent;border-collapse:collapse;border-color:transparent;border-spacing:0px;border-width:0px;margin:0px;padding:0px;\">\n<th rowspan=\"1\" style=\"background:#eeeeee;border-collapse:collapse;border:1px solid #000000;border-spacing:0px;font-size:14px;margin:0px;padding:0.5em 1em;text-align:center;\">wzięcie udziału w badaniu satysfakcji z naszych usług lub produktów</th>\n<td style=\"background-size:initial;border-collapse:collapse;border:1px solid #000000;border-spacing:0px;font-size:14px;margin:0px;padding:0.5em 1em;text-align:center;\">podmioty umożliwiające umieszczanie opinii o Sklepie lub produktach i ich porównywanie</td>\n<td style=\"background-size:initial;border-collapse:collapse;border:1px solid #000000;border-spacing:0px;font-size:14px;margin:0px;padding:0.5em 1em;text-align:center;\">nie ma miejsca</td>\n</tr>\n</tbody>\n</table>\n<br />\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">A ponadto:</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">odpowiednie organy publiczne w zakresie, w jakim jesteśmy zobowiązani do udostępnienia im danych.</p>\n','polityka-prywatnosci'),(9,1,1,'Zwroty i reklamacje','','','','','zwroty-i-reklamacje'),(9,2,1,'Zwroty i reklamacje','Geekup - Zwroty i reklamacje','Geekup - Zwroty i reklamacje','zwroty, reklamacje','<h1 class=\"document-heading center\" style=\"margin:0.67em 0px;padding:0px;border:0px;background:#ffffff;font-family:Montserrat, sans-serif;line-height:1.4em;text-align:center;\">Zwroty i reklamacje</h1>\n\n<h2 class=\"center\" style=\"margin:0.83em 0px 0.7em;padding:0px;border:0px;background:transparent;font-family:inherit;line-height:1.4em;text-align:center;\">Odstąpienie od umowy</h2>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">Jeśli jesteś tzw. kupującym uprzywilejowanym, a więc:</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">A) konsumentem</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">albo</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">B) osobą fizyczną, dla której umowa, jaką z nami zawarłeś, jest bezpośrednio związana z Twoją działalnością gospodarczą, ale nie ma dla Ciebie charakteru zawodowego</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">- co do zasady przysługuje Ci <span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">prawo do odstąpienia od zawartej na odległość umowy</span>.</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">Od umowy możesz odstąpić, składając nam <span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">oświadczenie o odstąpieniu od umowy</span> np. poprzez wiadomość e-mail przesłaną na adres: <a href=\"mailto:sklep@geekup.pl\" style=\"margin:0px;padding:0px;border:0px;background:transparent;color:#f6a802;\">sklep@geekup.pl</a>.</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">Od umowy możesz odstąpić w terminie <span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">14 dni</span>.</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">Bieg czternastodniowego terminu na odstąpienie od umowy rozpoczyna się:</p>\n<ul style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;background:transparent;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">dla umowy, w której wydajemy towar, będąc zobowiązanymi do przeniesienia jego własności - <span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">od objęcia towaru w posiadanie przez Ciebie</span> lub wskazaną przez Ciebie osobę trzecią inną niż przewoźnik, a w przypadku umowy, która obejmuje wiele towarów, które są dostarczane osobno, partiami lub w częściach - od <span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">objęcia w posiadanie ostatniego towaru, jego partii lub części</span>;</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">dla treści cyfrowych - od dnia zawarcia umowy.</li>\n</ul>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">Do zachowania terminu wystarczy wysłanie oświadczenia przed jego upływem.</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\"><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">Zwracany towar zwróć do nas niezwłocznie na adres: Cicha 3, 05-090 Raszyn</span>, jednak nie później niż w terminie 14 dni od dnia, w którym odstąpiłeś od umowy.</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">Dokonane przez Ciebie płatności zwrócimy Ci niezwłocznie na zasadach wskazanych w Regulaminie sklepu, jednak nie później niż w terminie 14 dni od dnia otrzymania od Ciebie oświadczenia o odstąpieniu od umowy.</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">Jeśli nie zaproponowaliśmy, że sami odbierzemy od Ciebie towar – możemy wstrzymać się ze zwrotem otrzymanej od Ciebie płatności do chwili otrzymania towaru z powrotem lub dostarczenia przez Ciebie dowodu jego odesłania - w zależności od tego, które zdarzenie nastąpi wcześniej.</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\"><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">Pamiętaj, że prawo odstąpienia od umowy zawartej na odległość nie przysługuje Ci m.in. w odniesieniu do umowy:</span></p>\n<ul style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;background:transparent;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">w której przedmiotem świadczenia jest <span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">towar nieprefabrykowany, wyprodukowany według Twojej specyfikacji</span> lub <span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">służący zaspokojeniu Twoich zindywidualizowanych potrzeb</span>;</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">w której przedmiotem świadczenia jest <span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">towar ulegający szybkiemu zepsuciu</span> lub mający krótki termin przydatności do użycia;</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">w której przedmiotem świadczenia jest towar dostarczany w zapieczętowanym opakowaniu, którego <span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">po otwarciu opakowania nie można zwrócić ze względu na ochronę zdrowia lub ze względów higienicznych</span>, jeżeli opakowanie zostało otwarte po dostarczeniu;</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">w której przedmiotem świadczenia są <span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">nagrania dźwiękowe lub wizualne albo programy komputerowe dostarczane w zapieczętowanym opakowaniu</span>, jeżeli opakowanie zostało otwarte po dostarczeniu;</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\"><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">o dostarczanie treści cyfrowych, które nie są dostarczane na nośniku materialnym</span>, za które jesteś zobowiązany do zapłaty ceny, jeżeli zostaną spełnione łącznie następujące warunki:\n<ul style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;background:transparent;list-style:disc;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">rozpoczęliśmy świadczenie za Twoją wyraźną i uprzednią zgodą,</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">zostałeś przez nas poinformowany przed rozpoczęciem świadczenia, że po jego spełnieniu utracisz prawo do odstąpienia od umowy, i przyjąłeś to do wiadomości,</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">przekazaliśmy Ci zgodne z prawem potwierdzenie zawarcia umowy na odległość, obejmujące informację o ww. zgodzie, na trwałym nośniku w rozsądnym czasie po zawarciu umowy, najpóźniej przez rozpoczęciem świadczenia usługi.</li>\n</ul>\n</li>\n</ul>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">Szczegółowe informacje na temat odstąpienia od umowy znajdziesz w naszym Regulaminie sklepu.</p>\n\n\n<h2 class=\"center\" style=\"margin:0.83em 0px 0.7em;padding:0px;border:0px;background:transparent;font-family:inherit;line-height:1.4em;text-align:center;\">Reklamacje</h2>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">Poniższe treści mają zastosowanie do tzw. kupującego uprzywilejowanego. Jeśli nim nie jesteś, zajrzyj do naszego Regulaminu sklepu, aby uzyskać szczegółowe informacje na temat reklamacji.</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">W przypadku gdy niewłaściwie zrealizujemy zawartą z Tobą umowę, masz prawo złożyć reklamację - najlepiej na adres e-mail: <a href=\"mailto:sklep@geekup.pl\" style=\"margin:0px;padding:0px;border:0px;background:transparent;color:#f6a802;\">sklep@geekup.pl</a> lub drogą pocztową na adres Cicha 3, 05-090 Raszyn.</p>\n<h3 style=\"margin:1em 0px 0.7em;padding:0px;border:0px;background:transparent;font-family:inherit;line-height:1.4em;\">TOWARY</h3>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">Co do zasady, ponosimy odpowiedzialność za brak zgodności towaru z umową, istniejący w chwili jego dostarczenia i ujawniony w ciągu dwóch lat od tej chwili.</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">Na podstawie przepisów ustawy o prawach konsumenta możesz w takiej sytuacji żądać:</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">a) wymiany towaru</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">lub</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">b) naprawy towaru.</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">W niektórych przypadkach możesz też:</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">a) odstąpić od umowy</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">lub</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">b) złożyć oświadczenie o obniżeniu ceny</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\"><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">- szczegóły w tym zakresie znajdziesz w naszym Regulaminie sklepu.</span></p>\n<h3 style=\"margin:1em 0px 0.7em;padding:0px;border:0px;background:transparent;font-family:inherit;line-height:1.4em;\">TREŚCI CYFROWE</h3>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">Ponosimy odpowiedzialność za brak zgodności treści cyfrowych z umową, który istniał w chwili ich dostarczenia i ujawnił się w ciągu dwóch lat od tej chwili.</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">Jeśli treści cyfrowe są niezgodne z umową, możesz żądać:</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">a) doprowadzenia do ich zgodności z umową,</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">a w niektórych przypadkach złożyć oświadczenie o:</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">b) obniżeniu ceny</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">albo</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">c) odstąpieniu od umowy.</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\"><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">Szczegółowe zasady w zakresie reklamacji znajdziesz w naszym Regulaminie sklepu.</span></p>\n','zwroty-i-reklamacje'),(10,1,1,'Pytania i odpowiedzi','','','','','pytania-i-odpowiedzi'),(10,2,1,'Pytania i odpowiedzi','Geekup - Pytania i odpowiedzi','Geekup - Pytania i odpowiedzi','pytania, odpowiedzi','<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\">Poniżej znajdują się przygotowane przez nas odpowiedzi na najczęściej zadawane pytania, dotyczące przeprowadzania zakupów w naszym sklepie.</p>\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-size: 10pt; background: transparent;\"><span style=\"margin: 0px; padding: 0px; border: 0px; background: transparent; font-weight: bold;\">Kliknij na interesujące Ciebie pytanie:</span></span></p>\r\n<ul style=\"margin: 1em 0px; padding: 0px 0px 0px 40px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\">\r\n<li style=\"margin: 0px 0px 3px; padding: 0px; border: 0px; background: transparent; line-height: 20px;\"><a href=\"#dostepnosc\" style=\"margin: 0px; padding: 0px; border: 0px; background: transparent; color: #f6a802;\">Jak sprawdzić dostępność produktów?</a></li>\r\n<li style=\"margin: 0px 0px 3px; padding: 0px; border: 0px; background: transparent; line-height: 20px;\"><a href=\"#stan\" style=\"margin: 0px; padding: 0px; border: 0px; background: transparent; color: #f6a802;\">Jak sprawdzić stan realizacji zamówienia?</a></li>\r\n<li style=\"margin: 0px 0px 3px; padding: 0px; border: 0px; background: transparent; line-height: 20px;\"><a href=\"#dostawa-czas\" style=\"margin: 0px; padding: 0px; border: 0px; background: transparent; color: #f6a802;\">Jak długo będę czekać na przesyłkę?</a></li>\r\n<li style=\"margin: 0px 0px 3px; padding: 0px; border: 0px; background: transparent; line-height: 20px;\"><a href=\"#dostawa-formy\" style=\"margin: 0px; padding: 0px; border: 0px; background: transparent; color: #f6a802;\">Jakie występują formy dostawy?</a></li>\r\n<li style=\"margin: 0px 0px 3px; padding: 0px; border: 0px; background: transparent; line-height: 20px;\"><a href=\"#dostawa-cena\" style=\"margin: 0px; padding: 0px; border: 0px; background: transparent; color: #f6a802;\">Ile zapłacę za przesyłkę?</a></li>\r\n<li style=\"margin: 0px 0px 3px; padding: 0px; border: 0px; background: transparent; line-height: 20px;\"><a href=\"#platnosc\" style=\"margin: 0px; padding: 0px; border: 0px; background: transparent; color: #f6a802;\">Jak zapłacić za zamówienie?</a></li>\r\n<li style=\"margin: 0px 0px 3px; padding: 0px; border: 0px; background: transparent; line-height: 20px;\"><a href=\"#kupony\" style=\"margin: 0px; padding: 0px; border: 0px; background: transparent; color: #f6a802;\">Co to są kupony rabatowe?</a></li>\r\n<li style=\"margin: 0px 0px 3px; padding: 0px; border: 0px; background: transparent; line-height: 20px;\"><a href=\"#przechowalnia\" style=\"margin: 0px; padding: 0px; border: 0px; background: transparent; color: #f6a802;\">Co to jest przechowalnia?</a></li>\r\n<li style=\"margin: 0px 0px 3px; padding: 0px; border: 0px; background: transparent; line-height: 20px;\"><a href=\"#vat\" style=\"margin: 0px; padding: 0px; border: 0px; background: transparent; color: #f6a802;\">Czy mogę otrzymać fakturę VAT?</a></li>\r\n<li style=\"margin: 0px 0px 3px; padding: 0px; border: 0px; background: transparent; line-height: 20px;\"><a href=\"#edycja\" style=\"margin: 0px; padding: 0px; border: 0px; background: transparent; color: #f6a802;\">Jak zmienić moje zamówienie?</a></li>\r\n<li style=\"margin: 0px 0px 3px; padding: 0px; border: 0px; background: transparent; line-height: 20px;\"><a href=\"#anulowanie\" style=\"margin: 0px; padding: 0px; border: 0px; background: transparent; color: #f6a802;\">Złożyłem błędne zamówienie. Jak je anulować?</a></li>\r\n<li style=\"margin: 0px 0px 3px; padding: 0px; border: 0px; background: transparent; line-height: 20px;\"><a href=\"#przesylka\" style=\"margin: 0px; padding: 0px; border: 0px; background: transparent; color: #f6a802;\">Gdzie jest moja przesyłka?</a></li>\r\n<li style=\"margin: 0px 0px 3px; padding: 0px; border: 0px; background: transparent; line-height: 20px;\"><a href=\"#gwarancja\" style=\"margin: 0px; padding: 0px; border: 0px; background: transparent; color: #f6a802;\">Czy sprzedawane produkty posiadają gwarancję?</a></li>\r\n<li style=\"margin: 0px 0px 3px; padding: 0px; border: 0px; background: transparent; line-height: 20px;\"><a href=\"#reklamacja\" style=\"margin: 0px; padding: 0px; border: 0px; background: transparent; color: #f6a802;\">Mam problem z zamówionym produktem. Co teraz?</a></li>\r\n<li style=\"margin: 0px 0px 3px; padding: 0px; border: 0px; background: transparent; line-height: 20px;\"><a href=\"#zwrot\" style=\"margin: 0px; padding: 0px; border: 0px; background: transparent; color: #f6a802;\">Czy mogę zwrócić zakupiony produkt?</a></li>\r\n</ul>\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\"> </p>\r\n<hr style=\"height: 0px; font-family: Montserrat, sans-serif; font-size: 14px; background-color: #ffffff; width: 792px;\" />\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\"> </p>\r\n<h3 id=\"dostepnosc\" style=\"margin: 1em 0px 0.7em; padding: 0px; border: 0px; background: #ffffff; font-family: Montserrat, sans-serif; line-height: 1.4em;\">Jak sprawdzić dostępność produktów?</h3>\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\"> </p>\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\">Przy każdym z produktów znajduje się informacja o jego dostępności w sklepie:</p>\r\n<ul style=\"margin: 1em 0px; padding: 0px 0px 0px 40px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\">\r\n<li style=\"margin: 0px 0px 10px; padding: 0px; border: 0px; background: transparent; line-height: 20px;\">Brak towaru – chwilowo 0 sztuk na magazynie; jeżeli jesteś bardzo zainteresowany tym produktem, daj nam znać poprzez email: <span style=\"margin: 0px; padding: 0px; border: 0px; background: transparent; font-weight: bold;\"><em>sklep@geekup.pl</em></span> lub telefonicznie: <span style=\"margin: 0px; padding: 0px; border: 0px; background: transparent; font-weight: bold;\"><em>533121806</em></span></li>\r\n<li style=\"margin: 0px 0px 10px; padding: 0px; border: 0px; background: transparent; line-height: 20px;\">Na wyczerpaniu – ostatnie sztuki danego towaru, warto się pospieszyć z zakupem!</li>\r\n<li style=\"margin: 0px 0px 10px; padding: 0px; border: 0px; background: transparent; line-height: 20px;\">Średnia ilość – mamy przynajmniej kilka/kilkanaście egzemplarzy</li>\r\n<li style=\"margin: 0px 0px 10px; padding: 0px; border: 0px; background: transparent; line-height: 20px;\">Duża ilość – w magazynie mamy wystarczającą ilość produktu, aby obsłużyć wiele zamówień</li>\r\n<li style=\"margin: 0px 0px 10px; padding: 0px; border: 0px; background: transparent; line-height: 20px;\">Dostępny na zamówienie – możemy specjalnie dla Ciebie sprowadzić ten produkt - skontaktuj się z nami drogą email: <span style=\"margin: 0px; padding: 0px; border: 0px; background: transparent; font-weight: bold;\"><em>sklep@geekup.pl</em></span> lub telefonicznie: <span style=\"margin: 0px; padding: 0px; border: 0px; background: transparent; font-weight: bold;\"><em>533121806</em></span></li>\r\n<li style=\"margin: 0px 0px 10px; padding: 0px; border: 0px; background: transparent; line-height: 20px;\">Spodziewana dostawa – produkt będzie dostępny już wkrótce</li>\r\n<li style=\"margin: 0px 0px 10px; padding: 0px; border: 0px; background: transparent; line-height: 20px;\">Wycofany z oferty – produkt nie jest już dostępny w ofercie naszego sklepu</li>\r\n</ul>\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\"> </p>\r\n<hr style=\"height: 0px; font-family: Montserrat, sans-serif; font-size: 14px; background-color: #ffffff; width: 792px;\" />\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\"> </p>\r\n<h3 id=\"stan\" style=\"margin: 1em 0px 0.7em; padding: 0px; border: 0px; background: #ffffff; font-family: Montserrat, sans-serif; line-height: 1.4em;\">Jak sprawdzić stan realizacji zamówienia?</h3>\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\"> </p>\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\">Na Twój adres email będziemy przesyłać informacje o postępach w realizacji Twojego zamówienia.  Ponadto po zalogowaniu do Twojego konta będziesz miał dostęp do wszelkich informacji o Twoich bieżacych oraz już zrealizowanych zamówieniach: statusie, zawartości, podanych adresach, itp.</p>\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\"> </p>\r\n<hr style=\"height: 0px; font-family: Montserrat, sans-serif; font-size: 14px; background-color: #ffffff; width: 792px;\" />\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\"> </p>\r\n<h3 id=\"dostawa-czas\" style=\"margin: 1em 0px 0.7em; padding: 0px; border: 0px; background: #ffffff; font-family: Montserrat, sans-serif; line-height: 1.4em;\">Jak długo będę czekać na przesyłkę?</h3>\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\"> </p>\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\">Natychmiast po złożeniu przez Ciebie zamówienia otrzymasz na adres email informacje z linkiem, który należy kliknąć, aby potwierdzić zamówienie - wtedy też rozpoczynamy proces jego realizacji. Na Twój adres email na bieżąco będą przesyłane informacje o stanie realizacji Twojego zamówienia.</p>\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\"> </p>\r\n<h3 style=\"margin: 1em 0px 0.7em; padding: 0px; border: 0px; background: #ffffff; font-family: Montserrat, sans-serif; line-height: 1.4em; text-align: center;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-size: 16.38px; background: transparent; color: #808080;\">Termin otrzymania paczki = termin wysyłki + czas dostawy</span></h3>\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\"> </p>\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\">Termin wysyłki wynika z dostępności produktów i wybranej formy płatności, podczas gdy czas dostawy zależy od wybranej przez Ciebie formy dostawy.</p>\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif; text-align: right;\"><span style=\"margin: 0px; padding: 0px; border: 0px; background: transparent; font-weight: bold;\">» <a href=\"11-czas-realizacji-zamowienia\" style=\"margin: 0px; padding: 0px; border: 0px; background: transparent; color: #f6a802;\">szczegółowy opis realizacji zamówień</a></span></p>\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\"> </p>\r\n<hr style=\"height: 0px; font-family: Montserrat, sans-serif; font-size: 14px; background-color: #ffffff; width: 792px;\" />\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\"> </p>\r\n<h3 id=\"dostawa-formy\" style=\"margin: 1em 0px 0.7em; padding: 0px; border: 0px; background: #ffffff; font-family: Montserrat, sans-serif; line-height: 1.4em;\">Jakie występują formy dostawy?</h3>\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\"> </p>\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\">W zależności od ilości i wagi zamawianych przez Ciebie produktów, wybranej formy płatności i własnych preferencji, możesz wybrać jedną z form dostawy:</p>\r\n<ul style=\"margin: 1em 0px; padding: 0px 0px 0px 40px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\">\r\n<li style=\"margin: 0px; padding: 0px; border: 0px; background: transparent; line-height: 20px;\">przesyłka kurierska</li>\r\n<li style=\"margin: 0px; padding: 0px; border: 0px; background: transparent; line-height: 20px;\">poczta polska</li>\r\n<li style=\"margin: 0px; padding: 0px; border: 0px; background: transparent; line-height: 20px;\">paczkomaty InPost</li>\r\n</ul>\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif; text-align: right;\"><span style=\"margin: 0px; padding: 0px; border: 0px; background: transparent; font-weight: bold;\">» <a href=\"13-czas-i-koszty-dostawy\" style=\"margin: 0px; padding: 0px; border: 0px; background: transparent; color: #f6a802;\">szczegółowy opis form dostawy</a></span></p>\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\"> </p>\r\n<hr style=\"height: 0px; font-family: Montserrat, sans-serif; font-size: 14px; background-color: #ffffff; width: 792px;\" />\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\"> </p>\r\n<h3 id=\"dostawa-cena\" style=\"margin: 1em 0px 0.7em; padding: 0px; border: 0px; background: #ffffff; font-family: Montserrat, sans-serif; line-height: 1.4em;\">Ile zapłacę za przesyłkę?</h3>\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\"> </p>\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\">Całkowity koszt dostawy zamówienia poznasz po dodaniu produktów do koszyka i wybraniu interesującej Ciebie formy dostawy i metody płatności - w podsumowaniu zobaczysz dokładną wartość do zapłaty. W zależności od wybranej formy płatności (przedpłata lub płatność za pobraniem) oraz sposobu dostawy, koszt przesyłki wynosi od kilku do kilkunastu złotych.</p>\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\"> </p>\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif; text-align: right;\"><span style=\"margin: 0px; padding: 0px; border: 0px; background: transparent; font-weight: bold;\">» <a href=\"13-czas-i-koszty-dostawy\" style=\"margin: 0px; padding: 0px; border: 0px; background: transparent; color: #f6a802;\">szczegółowy cennik dostaw</a></span></p>\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\"> </p>\r\n<hr style=\"height: 0px; font-family: Montserrat, sans-serif; font-size: 14px; background-color: #ffffff; width: 792px;\" />\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\"> </p>\r\n<h3 id=\"platnosc\" style=\"margin: 1em 0px 0.7em; padding: 0px; border: 0px; background: #ffffff; font-family: Montserrat, sans-serif; line-height: 1.4em;\">Jak zapłacić za zamówienie?</h3>\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\"> </p>\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\">W zależności od wartości zamówienia, wybranej formy dostawy i własnych preferencji, możesz wybrać jeden z następujących sposobów płatności:</p>\r\n<ul style=\"margin: 1em 0px; padding: 0px 0px 0px 40px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\">\r\n<li style=\"margin: 0px; padding: 0px; border: 0px; background: transparent; line-height: 20px;\">przelew na konto bankowe,</li>\r\n<li style=\"margin: 0px; padding: 0px; border: 0px; background: transparent; line-height: 20px;\">płatność za pobraniem,</li>\r\n<li style=\"margin: 0px; padding: 0px; border: 0px; background: transparent; line-height: 20px;\">płatność elektroniczna (przelew on-line).</li>\r\n</ul>\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif; text-align: right;\"><span style=\"margin: 0px; padding: 0px; border: 0px; background: transparent; font-weight: bold;\">» <a href=\"12-dane-do-przelewu\" style=\"margin: 0px; padding: 0px; border: 0px; background: transparent; color: #f6a802;\">szczegółowy opis form płatności</a></span></p>\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\"> </p>\r\n<hr style=\"height: 0px; font-family: Montserrat, sans-serif; font-size: 14px; background-color: #ffffff; width: 792px;\" />\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\"> </p>\r\n<h3 id=\"kupony\" style=\"margin: 1em 0px 0.7em; padding: 0px; border: 0px; background: #ffffff; font-family: Montserrat, sans-serif; line-height: 1.4em;\">Co to są kupony rabatowe?</h3>\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\"> </p>\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\">W wielu akcjach promocyjnych oferujemy naszym Klientom kupony rabatowe. Mają one formę  kodów, które należy wpisać w koszyk, w odpowiednio oznaczonym polu. Spowoduje to przeliczenie kwoty do zapłaty z uwzględnieniem rabatu. </p>\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\">Pamiętaj, że większość kodów rabatowych ma swój okres ważności. Po jego wygaśnięciu kod rabatowy przestaje być aktywny – nie spowoduje przyznania określonego rabatu.</p>\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\"> </p>\r\n<hr style=\"height: 0px; font-family: Montserrat, sans-serif; font-size: 14px; background-color: #ffffff; width: 792px;\" />\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\"> </p>\r\n<h3 id=\"przechowalnia\" style=\"margin: 1em 0px 0.7em; padding: 0px; border: 0px; background: #ffffff; font-family: Montserrat, sans-serif; line-height: 1.4em;\">Co to jest przechowalnia?</h3>\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\"> </p>\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\">Przechowalnia to miejsce, do którego możesz dodawać produkty, nad którymi się zastanawiasz. Dostęp do tej funkcjonalności mają <span style=\"margin: 0px; padding: 0px; border: 0px; background: transparent; font-weight: bold;\">tylko zalogowani użytkownicy.</span></p>\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\">Jeżeli wahasz się, czy kupić dany produkt, a posiadasz konto w naszym sklepie, zaloguj się i dodaj produkt do przechowalni. Produkty w przechowalni są dla Ciebie zapamiętywane. Przy kolejnym zalogowaniu do sklepu w przechowalni znajdziesz wszystkie zapisane przez Ciebie produkty. W każdej chwili możesz powrócić do nich, przerzucić je do koszyka lub usunąć z przechowalni.</p>\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\"> </p>\r\n<hr style=\"height: 0px; font-family: Montserrat, sans-serif; font-size: 14px; background-color: #ffffff; width: 792px;\" />\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\"> </p>\r\n<h3 id=\"vat\" style=\"margin: 1em 0px 0.7em; padding: 0px; border: 0px; background: #ffffff; font-family: Montserrat, sans-serif; line-height: 1.4em;\">Czy mogę otrzymać fakturę VAT?</h3>\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\"> </p>\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\">Tak, na zakupione w naszym sklepie produkty możesz otrzymać fakturę VAT. W tym celu w trakcie składania zamówienia w formularzu z Twoimi danymi wybierz opcję „firma” i podaj dane do faktury. Informacje na temat chęci otrzymania faktury VAT umieść w Uwagach (sekcja \"Dodatkowe informacje\"). Jeżeli adres wysyłki jest inny, niż dane do faktury, zaznacz w formularzu opcję „inny adres wysyłki” i podaj adres, na który ma być przesłane zamówienie.</p>\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\">Data wystawienia faktury VAT to data wysyłki Twojego zamówienia. Nie ma możliwości zmiany tej daty.</p>\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\"> </p>\r\n<hr style=\"height: 0px; font-family: Montserrat, sans-serif; font-size: 14px; background-color: #ffffff; width: 792px;\" />\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\"> </p>\r\n<h3 id=\"edycja\" style=\"margin: 1em 0px 0.7em; padding: 0px; border: 0px; background: #ffffff; font-family: Montserrat, sans-serif; line-height: 1.4em;\">Jak zmienić moje zamówienie?</h3>\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\"> </p>\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\">Możesz modyfikować swoje zamówienia jedynie do momentu skompletowania jego zawartości. W momencie przesłania go na wskazany adres modyfikacja jest już niemożliwa. W celu jakiejkolwiek modyfikacji swojego zamówienia (zmiana adresu, dodanie produktu do zamówienia, zmiana sposobu płatności czy dostawy), skontaktuj się z nami jak najszybciej - najlepiej telefonicznie: <span style=\"margin: 0px; padding: 0px; border: 0px; background: transparent; font-weight: bold;\"><em>533121806</em></span>.</p>\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\"> </p>\r\n<hr style=\"height: 0px; font-family: Montserrat, sans-serif; font-size: 14px; background-color: #ffffff; width: 792px;\" />\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\"> </p>\r\n<h3 id=\"anulowanie\" style=\"margin: 1em 0px 0.7em; padding: 0px; border: 0px; background: #ffffff; font-family: Montserrat, sans-serif; line-height: 1.4em;\">Złożyłem błędne zamówienie. Jak je anulować?</h3>\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\"> </p>\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\">Możesz anulować swoje zamówienia jedynie do momentu skompletowania jego zawartości. W momencie przesłania go na wskazany adres anulowanie jest niemożliwe. W celu anulowania zamówienia skontaktuj się z nami jak najszybciej - najlepiej telefonicznie: <span style=\"margin: 0px; padding: 0px; border: 0px; background: transparent; font-weight: bold;\"><em>533121806</em></span>.</p>\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\"> </p>\r\n<hr style=\"height: 0px; font-family: Montserrat, sans-serif; font-size: 14px; background-color: #ffffff; width: 792px;\" />\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\"> </p>\r\n<h3 id=\"przesylka\" style=\"margin: 1em 0px 0.7em; padding: 0px; border: 0px; background: #ffffff; font-family: Montserrat, sans-serif; line-height: 1.4em;\">Gdzie jest moja przesyłka?</h3>\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\"> </p>\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\">Wybierając opcję dostawy poprzez kuriera, w wiadomości email otrzymasz numer listu przewozowego oraz link do strony, na której możesz na bieżąco śledzić położenie Twojej przesyłki. Link ten również jest widoczny dla zarejestrowanych klientów sklepu, w podglądzie szczegółów złożonego zamówienia, w kolumnie Przesyłka.</p>\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\"> </p>\r\n<hr style=\"height: 0px; font-family: Montserrat, sans-serif; font-size: 14px; background-color: #ffffff; width: 792px;\" />\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\"> </p>\r\n<h3 id=\"gwarancja\" style=\"margin: 1em 0px 0.7em; padding: 0px; border: 0px; background: #ffffff; font-family: Montserrat, sans-serif; line-height: 1.4em;\">Czy sprzedawane produkty posiadają gwarancję?</h3>\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\"> </p>\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\">Tak, produkty dostępne w asortymencie naszego sklepu posiadają gwarancję producentów, obowiązującą na terenie Polski. Informacje o czasie gwarancji znajdziesz w opisie produktu, a także na stronach internetowych producentów. Prosimy o zachowanie dowodu zakupu (paragon lub faktura) i oryginalnego opakowania aż do momentu zakończenia okresu gwarancyjnego – stanowią one podstawę zgłaszania reklamacji z tytułu gwarancji, w wypadku towarów które gwarancją są objęte.</p>\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif; text-align: right;\"> </p>\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\"> </p>\r\n<hr style=\"height: 0px; font-family: Montserrat, sans-serif; font-size: 14px; background-color: #ffffff; width: 792px;\" />\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\"> </p>\r\n<h3 id=\"reklamacja\" style=\"margin: 1em 0px 0.7em; padding: 0px; border: 0px; background: #ffffff; font-family: Montserrat, sans-serif; line-height: 1.4em;\">Mam problem z zamówionym produktem. Co teraz?</h3>\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\"> </p>\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\">Zawsze przed odebraniem przesyłki należy sprawdzić, czy nie uległa uszkodzeniu w transporcie. W przypadku, gdy opakowanie posiada widoczne uszkodzenia zewnętrzne, zalecamy odmówienia przyjęcia przesyłki, a następnie skontaktowanie się z nami pod numerem telefonu: <em><span style=\"margin: 0px; padding: 0px; border: 0px; background: transparent; font-weight: bold;\">533121806</span></em>.</p>\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif; text-align: right;\"><span style=\"margin: 0px; padding: 0px; border: 0px; background: transparent; font-weight: bold;\">» <a href=\"14-zwroty-i-reklamacje-2\" style=\"margin: 0px; padding: 0px; border: 0px; background: transparent; color: #f6a802;\">szczegółowa procedura reklamacji</a></span></p>\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\"> </p>\r\n<hr style=\"height: 0px; font-family: Montserrat, sans-serif; font-size: 14px; background-color: #ffffff; width: 792px;\" />\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\"> </p>\r\n<h3 id=\"zwrot\" style=\"margin: 1em 0px 0.7em; padding: 0px; border: 0px; background: #ffffff; font-family: Montserrat, sans-serif; line-height: 1.4em;\">Czy mogę zwrócić zakupiony produkt?</h3>\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\"> </p>\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif;\">Tak, zgodnie z Ustawą z dnia 2 marca 2000 roku, w ciągu 10 dni od daty odebrania przesyłki z zamówieniem, możesz zwrócić zakupiony w sklepie internetowym produkt bez podania przyczyny. Aby zapoznać się ze szczegółowymi informacjami na ten temat proszę przejść do zakładki \'Reklamacje i zwroty\'</p>\r\n<p style=\"margin: 1em 0px; padding: 0px; border: 0px; font-size: 14px; background: #ffffff; font-family: Montserrat, sans-serif; text-align: right;\"><span style=\"margin: 0px; padding: 0px; border: 0px; background: transparent; font-weight: bold;\">» <a href=\"14-zwroty-i-reklamacje-2\" style=\"margin: 0px; padding: 0px; border: 0px; background: transparent; color: #f6a802;\">opis reklamacji i zwrotów</a></span></p>','pytania-i-odpowiedzi'),(11,1,1,'Czas realizacji zamówienia','','','','','czas-realizacji-zamowienia'),(11,2,1,'Czas realizacji zamówienia','Geekup - Czas realizacji zamówienia','Geekup - Czas realizacji zamówienia','','<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\">Natychmiast po złożeniu przez Ciebie zamówienia otrzymasz e-mail z potwierdzeniem złożonego zamówienia i linkiem, w który należy kliknąć. Po otrzymaniu akceptacji zamówienia rozpoczynamy jego realizację, a Ty będziesz na bieżąco informowany o postępie naszych prac.</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\"> </p>\n<h3 style=\"margin:1em 0px 0.7em;padding:0px;border:0px;background:#ffffff;font-family:Montserrat, sans-serif;line-height:1.4em;text-align:center;\"><span style=\"margin:0px;padding:0px;border:0px;font-size:16.38px;background:transparent;\">Termin otrzymania paczki = termin wysyłki + czas dostawy</span></h3>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\">Termin wysyłki wynika z <span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">dostępności produktów</span> i wybranej <span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">formy płatności</span>, podczas gdy czas dostawy zależy od wybranej przez Ciebie <span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">formy dostawy</span>.</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\"> </p>\n<h3 style=\"margin:1em 0px 0.7em;padding:0px;border:0px;background:#ffffff;font-family:Montserrat, sans-serif;line-height:1.4em;\">Dostępność produktów</h3>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\"> </p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\">Przy każdym produkcie jest podany termin, który opisuje, kiedy produkty mogą zostać przez nas wysłane - od 24 godzin do kilku, czasami nawet kilkunastu dni roboczych (w przypadku produktów trudno dostępnych).</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\">Termin realizacji 4-7 dni, który widnieje przy niektórych produktach oznacza, że produkt jest dostępny u <span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">oficjalnego dystrybutora w EU</span> - potrzebujemy kilku dni na jego sprowadzenie i wysyłkę do Państwa. Odpowiadając na pytania informujemy, że <span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">sprzedajemy jedynie oryginalne i licencjonowane gadżety kolekcjonerskie</span> (nie jest to wysyłka z zagranicy, np. Chin).</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\">Jeżeli zamawiasz większą liczbę produktów, czas wysyłki całego zamówienia jest dopasowany do produktu o najdłuższym czasie wysyłki. Można zrealizować zamówienie etapami - w tym celu skontaktuj się z nami lub wpisz odpowiednią adnotację w uwagach do zamówienia.</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\"> </p>\n<h3 style=\"margin:1em 0px 0.7em;padding:0px;border:0px;background:#ffffff;font-family:Montserrat, sans-serif;line-height:1.4em;\">Forma płatności</h3>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\"> </p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\">Płatność elektroniczna - najbardziej wygodny i bardzo szybki sposób realizacji zamówienia. W godzinach roboczych środki na nasze konto zostaną przelane zazwyczaj natychmiastowo.</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\">Płatność przelewem - czas realizacji zamówienia jest uzależniony od momentu zaksięgowania wpłaty. W zależności od banku standardowo trwa to do dwóch dni roboczych.</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\">Płatność przy odbiorze - najszybsza forma płatności, umożliwiająca natychmiastową realizację zamówienia. Należy pamiętać, że jest ona również obciążona dodatkowymi kosztami dostawy.</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;text-align:right;\"><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">» <a href=\"12-dane-do-przelewu\" style=\"margin:0px;padding:0px;border:0px;background:transparent;color:#f6a802;\">formy płatności</a> </span></p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\"> </p>\n<h3 style=\"margin:1em 0px 0.7em;padding:0px;border:0px;background:#ffffff;font-family:Montserrat, sans-serif;line-height:1.4em;\">Forma dostawy</h3>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\"> </p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\">Firma kurierska umożliwia dostarczenie zamówienia zazwyczaj w 1 dzień roboczy od nadania.</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\">Poczta Polska zazwyczaj dostarcza przesyłki w ciągu deklarowanych 2 dni roboczych.</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\">Paczkomaty InPost dostarczane są zazwyczaj w 1 dzień roboczy.</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\">ORLEN dostarcza paczki zazwyczaj w 1 dzień roboczy.</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;text-align:right;\"><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">» <a href=\"13-czas-i-koszty-dostawy\" style=\"margin:0px;padding:0px;border:0px;background:transparent;color:#f6a802;\">koszt dostawy</a></span></p>','czas-realizacji-zamowienia'),(12,1,1,'Dane do przelewu','','','','','dane-do-przelewu'),(12,2,1,'Dane do przelewu','Geekup - Dane do przelewu','Geekup - Dane do przelewu','','<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\"><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">Dane do tradycyjnego przelewu:</span></p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\">11 1140 2004 0000 3002 6439 3550<br />Smooth Sport Łukasz Marcinkowski<br />Cicha 3<br />05-090 Raszyn</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\"> </p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\">W zależności od wartości zamówienia, wybranej formy dostawy i własnych preferencji, możesz wybrać jeden z następujących sposobów płatności:</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\"> </p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\"><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">Przelew</span> - wpłaty należy dokonać na wskazany numer rachunku bankowego, który przekażemy Ci w wiadomości email potwierdzającej przyjęcie zamówienia. Przelew możesz zrealizować przez Internet, na poczcie lub w banku. Po zaksięgowaniu wpłaty na naszym koncie, rozpoczniemy realizację zamówienia.</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\"><br /><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">Pobranie</span> - płacisz gotówką przy odbiorze towaru (kurierowi, listonoszowi lub w oddziale Poczty Polskiej - w zależności od metody dostawy). Ta metoda płatności wiąże się z wyższą opłatę za realizację zamówienia, która nie występuje w przypadku innych opłat.</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\"><br /><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">Płatność elektroniczna</span> - najbardziej wygodny i bezpieczny sposób dokonania wpłaty za pośrednictwem Internetu. W naszym sklepie wykorzystujemy system płatności Przelewy24.pl, do którego zostaniesz przekierowany w celu dokonania płatności. Cały proces odbywa się szybko i bezpiecznie – wybierasz swój bank i dokonujesz opłaty.</p>','dane-do-przelewu'),(13,1,1,'Czas i koszty dostawy','','','','','czas-i-koszty-dostawy'),(13,2,1,'Czas i koszty dostawy','Geekup - Czas i koszty dostawy','Geekup - Czas i koszty dostawy','','<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\">Poniżej znajdziesz wszystkie oferowane przez nas formy dostawy.</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\"><br /><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">Zamówienia z terminem wysyłki 24 godziny, złożone do godziny 13:00 wysyłamy tego samego (tylko dni robocze). </span>99% przesyłek dociera do klienta już następnego dnia. Przykładowo: przy złożeniu zamówienia do godziny 13:00 paczkę otrzymasz już następnego dnia! (od poniedziałku do piątku).</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\">Zamówienia, których wartość przekracza 250 zł wysyłamy za darmo! <span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">Dodaj do koszyka produkty za co najmniej 250 zł i skorzystaj z darmowej dostawy!</span></p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\"> </p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\"><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">Rodzaje dostaw:</span></p>\n<p class=\"p1\" style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\">Paczkomaty InPost - 14,99 zł</p>\n<p class=\"p1\" style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\">Orlen Paczka - 9,99 zł</p>\n<p class=\"p1\" style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\">Kurier InPost - 14,99 zł</p>\n<p class=\"p1\" style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\">Kurier InPost za pobraniem* - 18,99 zł</p>\n<p class=\"p1\" style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\"> </p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\"><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">Opisy dostaw:</span><br /><br /><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">Kurier InPost - 14,99 zł</span><br />Czas dostawy to zazwyczaj<span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\"> 1 dzień roboczy.</span> Kurier dostarczy paczkę pod Twoje drzwi.<br /><br /><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">Paczkomat InPost - 14,99 zł</span><br />Odbieraj przesyłki 24 godziny na dobę, 7 dni w tygodniu. Czas dostawy to w 99% przypadkach <span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">1 dzień roboczy.</span><br />Klient po zamówieniu przesyłki do Paczkomatu otrzyma sms i e-mail z kodem odbioru w momencie dostarczenia przesyłki do wybranego Paczkomatu.<br />Aby odebrać przesyłkę wystarczy wpisać na panelu Paczkomatu numer telefonu komórkowego oraz otrzymany kod odbioru, a skrytka z oczekiwaną przesyłką otworzy się.</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\"><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">Orlen Paczka - 9,99 zł</span><br />Odbieraj przesyłki 24 godziny na dobę, 7 dni w tygodniu. Czas dostawy to w 99% przypadkach <span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">1 dzień roboczy.</span><br />Klient po zamówieniu przesyłki do jednego z 10000 punktów odbioru Orlen otrzyma sms i e-mail z kodem odbioru w momencie dostarczenia przesyłki do wybranego punktu.<br />Aby odebrać przesyłkę, wystarczy wpisać na panelu automatu paczkowego numer telefonu komórkowego oraz otrzymany kod odbioru, a skrytka z oczekiwaną przesyłką otworzy się.<br /><br /><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">Kurier InPost za pobraniem - 18,99 zł</span><br />Zaufany i expresowy kurier. Czas dostawy wynosi zazwyczaj<span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\"> 1 dzień roboczy. </span>Kurier dostarczy paczkę pod wskazany adres, a Ty będziesz mógł za nią wygodnie zapłacić kartą lub gotówką.</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\">*Dotyczy produktów dostępnych w magazynie (termin wysyłki 24 godziny). Za pobraniem nie realizujemy zamówień pre-orderowych z dłuższym czasem wysyłki.</p>','czas-i-koszty-dostawy'),(14,1,1,'Zwroty i reklamacje 2','','','','','zwroty-i-reklamacje-2'),(14,2,1,'Zwroty i reklamacje 2','Geekup - Zwroty i reklamacje 2','Geekup - Zwroty i reklamacje 2','','<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\"><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\"> § 7 Rękojmia</span><br />1. Sprzedawca zapewnia Dostawę Towaru pozbawionego wad fizycznych i prawnych. Sprzedawca jest odpowiedzialny względem Klienta, jeżeli Towar ma wadę fizyczną lub prawną (rękojmia).<br />2. Jeżeli Towar ma wadę Klient może:<br />a) złożyć oświadczenie o obniżeniu ceny albo odstąpieniu od Umowy sprzedaży, chyba że Sprzedawca niezwłocznie i bez nadmiernych niedogodności dla Klienta wymieni Towar wadliwy na wolny od wad albo wadę usunie.<br />Ograniczenie to nie ma zastosowania, jeżeli Towar był już wymieniony lub naprawiany przez sprzedawcę albo sprzedawca nie uczynił zadość obowiązkowi wymiany Towaru na wolny od wad lub usunięcia wad. Klient może zamiast zaproponowanego przez Sprzedawcę usunięcia wady żądać wymiany Towaru na wolny od wad albo zamiast wymiany Towaru żądać usunięcia wady, chyba że doprowadzenie rzeczy do zgodności z umową w sposób wybrany przez Klienta jest niemożliwe albo wymagałoby nadmiernych kosztów w porównaniu ze sposobem proponowanym przez Sprzedawcę. Przy ocenie nadmierności kosztów uwzględnia się wartość Towaru wolnego od wad, rodzaj i znaczenie stwierdzonej wady, a także bierze się pod uwagę niedogodności, na jakie narażałby Klienta inny sposób zaspokojenia.<br />b) żądać wymiany Towaru wadliwego na wolny od wad albo usunięcia wady. Sprzedawca jest obowiązany wymienić Towar wadliwy na wolny od wad lub usunąć wadę w rozsądnym czasie bez nadmiernych niedogodności dla Klienta.<br />Sprzedawca może odmówić zadośćuczynienia żądaniu Klienta, jeżeli doprowadzenie do zgodności z Umową sprzedaży Towaru wadliwego w sposób wybrany przez Klienta jest niemożliwe lub w porównaniu z drugim możliwym sposobem doprowadzenia do zgodności z Umową sprzedaży wymagałoby nadmiernych kosztów. Koszty naprawy lub wymiany ponosi Sprzedawca.<br />3. Klient, który wykonuje uprawnienia z tytułu rękojmi, jest obowiązany dostarczyć rzecz wadliwą na adres Sprzedawcy. W wypadku Klienta będącego Konsumentem koszt dostarczenia pokrywa Sprzedawca.<br />4. Sprzedawca odpowiada z tytułu rękojmi, jeżeli wada fizyczna zostanie stwierdzona przed upływem dwóch lat od wydania Towaru Klientowi. Roszczenie o usunięcie wady lub wymianę Towaru na wolny od wad przedawnia się z upływem roku, lecz termin ten nie może zakończyć się przed upływem terminu określonego w zdaniu pierwszym. W tym terminie Klient może odstąpić od Umowy sprzedaży lub złożyć oświadczenie o obniżeniu ceny z powodu wady Towaru. Jeżeli Klient żądał wymiany Towaru na wolny od wad lub usunięcia wady, termin do odstąpienia od Umowy sprzedaży lub złożenia oświadczenia o obniżeniu ceny rozpoczyna się z chwilą bezskutecznego upływu terminu do wymiany Towaru lub usunięcia wady.<br />5. Wszelkie reklamacje związane z Towarem lub realizacją Umowy sprzedaży, Klient może kierować w formie pisemnej na adres Sprzedawcy.<br />6. Sprzedawca w ciągu 14 dni od dnia żądania zawierającego reklamację, ustosunkuje się do reklamacji Towaru lub reklamacji związanej z realizacją Umowy sprzedaży zgłoszonej przez Klienta.<br />7. Klient może zgłosić Sprzedawcy reklamację w związku z korzystaniem z usług nieodpłatnych świadczonych drogą elektroniczną przez Sprzedawcę. Reklamacja może być złożona w formie elektronicznej i przesłana na adres sklep@geekup.pl. W zgłoszeniu reklamacyjnym Klient winien zawrzeć opis zaistniałego problemu. Sprzedawca niezwłocznie, lecz nie później niż w terminie 14 dni rozpatruje reklamacje i udziela Klientowi odpowiedzi.</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\"> </p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\"><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">§ 8 Gwarancja</span><br />1. Towary sprzedawane przez Sprzedawcę mogą być objęte gwarancją udzieloną przez producenta Towaru bądź dystrybutora.<br />2. W wypadku Towarów objętych gwarancją, informacja dotycząca istnienia i treści gwarancji jest każdorazowo prezentowana na Stronie Internetowej Sklepu.</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\"><br /><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">§ 9 Odstąpienie od Umowy sprzedaży</span><br />1. Klient będący Konsumentem, który zawarł Umowę sprzedaży, może w terminie 14 dni odstąpić od niej bez podawania przyczyny.<br />2. Bieg terminu na odstąpienie od Umowy sprzedaży rozpoczyna się od chwili objęcia Towaru w posiadanie przez Klienta.<br />Klient może odstąpić od Umowy sprzedaży składając Sprzedawcy oświadczenie o odstąpieniu. Oświadczenie można złożyć na formularzu, którego wzór został zamieszczony przez Sprzedawcę na Stronie Internetowej Sklepu pod adresem: <span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\"><a href=\"https://geekup.pl/odstapienie.docx\" style=\"margin:0px;padding:0px;border:0px;background:transparent;color:#f6a802;\">Formularz odstąpienia</a></span>. Do zachowania terminu wystarczy wysłanie oświadczenia przed jego upływem.<br />Klient może odstąpić od Umowy sprzedaży, składając Sprzedawcy oświadczenie o odstąpieniu za pośrednictwem formularza udostępnionego na stronie internetowej pod adresem: <span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\"><a href=\"https://www.rzetelnyregulamin.pl/pl/formularz-odstapienia-od-umowy,sklep-5e2e130e93b39042a97d5e7b3053fdbc\" style=\"margin:0px;padding:0px;border:0px;background:transparent;color:#f6a802;\">Elektroniczny Formularz odstąpienia</a></span>. Do zachowania terminu wystarczy wysłanie oświadczenia przed jego upływem. Sprzedawca niezwłocznie potwierdza Klientowi otrzymanie formularza złożonego za pośrednictwem strony internetowej.<br />3. W przypadku odstąpienia od Umowy sprzedaży, jest ona uważana za niezawartą.<br />4. Jeśli Klient złożył oświadczenie o odstąpieniu od Umowy sprzedaży zanim Sprzedawca przyjął jego ofertę, oferta przestaje wiązać.<br />5. Sprzedawca ma obowiązek niezwłocznie, nie później niż w terminie 14 dni od dnia otrzymania oświadczenia Klienta o odstąpieniu od Umowy sprzedaży, zwrócić mu wszystkie dokonane przez niego płatności, w tym koszt Dostawy Towaru do Klienta. Sprzedawca może wstrzymać się ze zwrotem płatności otrzymanych od Klienta do chwili otrzymania z powrotem Towaru lub dostarczenia przez Klienta dowodu odesłania Towaru, w zależności od tego, które zdarzenie nastąpi wcześniej.<br />6. Jeżeli Klient korzystający z prawa do odstąpienia wybrał sposób dostarczenia Towaru inny niż najtańszy zwykły sposób Dostawy oferowany przez Sprzedawcę, Sprzedawca nie jest zobowiązany do zwrotu Klientowi poniesionych przez niego dodatkowych kosztów.<br />7. Klient ma obowiązek zwrócić Towar Sprzedawcy niezwłocznie, jednak nie później niż w terminie 14 dni od dnia, w którym odstąpił od Umowy sprzedaży. Do zachowania terminu wystarczy odesłanie Towaru na adres Sprzedawcy przed upływem tego terminu.<br />8. W wypadku odstąpienia Klient ponosi tylko bezpośrednie koszty zwrotu Towaru.<br />9. Jeśli ze względu na swój charakter Towar nie może zostać w zwykłym trybie odesłany pocztą, Sprzedawca informuje Klienta o kosztach zwrotu rzeczy na Stronie Internetowej Sklepu.<br />10. Klient ponosi odpowiedzialność za zmniejszenie wartości Towaru będące wynikiem korzystania z niego w sposób wykraczający poza sposób konieczny do stwierdzenia charakteru, cech i funkcjonowania Towaru.<br />11. Sprzedawca dokonuje zwrotu płatności przy użyciu takiego samego sposobu zapłaty, jakiego użył Klient, chyba, że Klient wyraźnie zgodził się na inny sposób zwrotu, który nie wiąże się dla niego z żadnymi kosztami.</p>','zwroty-i-reklamacje-2'),(15,1,1,'Kontakt i dane firmy','','','','','kontakt-i-dane-firmy'),(15,2,1,'Kontakt i dane firmy','Geekup - Kontakt i dane firmy','Geekup - Kontakt i dane firmy','','<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\">Przed wysłaniem nam zapytania zajrzyj do sekcji \"Częste pytania\", w której podaliśmy odpowiedzi na najczęściej występujące pytania, związanie z zakupami w naszym sklepie.</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\"><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">» <a href=\"10-pytania-i-odpowiedzi\" style=\"margin:0px;padding:0px;border:0px;background:transparent;color:#f6a802;\">zobacz odpowiedzi na częste pytania</a></span></p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\"> </p>\n<h2 style=\"margin:0.83em 0px 0.7em;padding:0px;border:0px;background:#ffffff;font-family:Montserrat, sans-serif;line-height:1.4em;\"><span style=\"margin:0px;padding:0px;border:0px;font-size:14pt;background:transparent;\">Kontakt:</span></h2>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\">Wybierz dogodną dla Ciebie metodę kontaktu.</p>\n<div style=\"margin:0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\"> </div>\n<div style=\"margin:0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\">\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">Skorzystaj z: <span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\"><a href=\"../kontakt\" style=\"margin:0px;padding:0px;border:0px;background:transparent;color:#f6a802;\">formularza kontaktowego</a></span></p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">Wyślij email:<span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\"><span style=\"margin:0px;padding:0px;border:0px;background:transparent;\"> <a href=\"mailto:sklep@geekup.pl\" style=\"margin:0px;padding:0px;border:0px;background:transparent;color:#f6a802;\">sklep@geekup.pl</a></span></span> </p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\"><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">Polecamy kontakt drogą mailową - na wiadomości staramy się odpowiadać w ciągu maksymalnie kilku godzin. Kontakt telefoniczny może być momentami utrudniony. W ciągu dnia pracy o wiele łatwiej jest nam odpowiedź poprzez maila.</span></p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\"> </p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">Zadzwoń: 533121806</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\"> </p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\"><span style=\"margin:0px;padding:0px;border:0px;background:transparent;color:#ff0000;\"><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">UWAGA! Nie prowadzimy sprzedaży stacjonarnej w siedzibie firmy. Aktualnie nie udostępniamy także możliwości odbioru osobistego.</span></span></p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\"> </p>\n<h2 style=\"margin:0.83em 0px 0.7em;padding:0px;border:0px;background:transparent;font-family:inherit;line-height:1.4em;\"><span style=\"margin:0px;padding:0px;border:0px;font-size:14pt;background:transparent;\">Dane firmy:</span></h2>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">Smooth Sport Łukasz Marcinkowski<br />ul. Cicha 3<br />05-090 Raszyn<br />REGON: 142004657<br />NIP: 5342423841</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\"><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">Numer konta: </span>11 1140 2004 0000 3002 6439 3550</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\"> </p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;background:transparent;\">Działalność gospodarcza, wpisana do Centralnej Ewidencji i Informacji o Działalności Gospodarczej prowadzonej przez Ministra Gospodarki.</p>\n</div>','kontakt-i-dane-firmy'),(16,1,1,'Jak kupować?','','','','','jak-kupowac'),(16,2,1,'Jak kupować?','Geekup - Jak kupować?','Geekup - Jak kupować?','','<h3 style=\"margin:1em 0px 0.7em;padding:0px;border:0px;background:#ffffff;font-family:Montserrat, sans-serif;line-height:1.4em;\"><span style=\"margin:0px;padding:0px;border:0px;font-size:16.38px;background:transparent;\">Krok 1 - Wybór produktów</span></h3>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\"><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\"> </span></p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\">Przeglądaj listę kategorii lub skorzystaj z wyszukiwarki, aby znaleźć odpowiedni produkt.</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\">Przy każdym produkcie znajdziesz szczegółowe informacje na jego temat.</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\">Pamiętaj, że zarejestrowani klienci mogą zapamiętać produkty w przechowalni.</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\">Po znalezieniu interesującego Ciebie produktu, dodaj go do koszyka.</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\">Jeżeli kompletowanie zamówienia jest zakończone - przejdź do koszyka.</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\"> </p>\n<h3 style=\"margin:1em 0px 0.7em;padding:0px;border:0px;background:#ffffff;font-family:Montserrat, sans-serif;line-height:1.4em;\"><span style=\"margin:0px;padding:0px;border:0px;font-size:16.38px;background:transparent;\">Krok 2 - Zawartość koszyka</span></h3>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\"><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\"> </span></p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\">W koszyku zobaczysz dokładnie, jakie wybrałeś produkty i w jakiej ilości.</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\">Zmień wartość w kolumnie ilość i kliknij na \"przelicz\", aby dopasować zamówienie.</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\">Klikając na ikonę minusa usuniesz produkty z koszyka.</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\">Wybierz odpowiadającą Ci formę dostawy i płatności.</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\">Jeżeli posiadasz kupon rabatowy, wprowadź go poniżej, aby otrzymać zniżkę.</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\">Potwierdź wybrane opcje klikając na przycisk „zamawiam”.</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\"> </p>\n<h3 style=\"margin:1em 0px 0.7em;padding:0px;border:0px;background:#ffffff;font-family:Montserrat, sans-serif;line-height:1.4em;\"><span style=\"margin:0px;padding:0px;border:0px;font-size:16.38px;background:transparent;\">Krok 3 - Składanie zamówienia</span></h3>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\"><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\"> </span></p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\">Jeżeli posiadasz konto w naszym sklepie, podaj dane logowania i kliknij na \"zaloguj się\",</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\">Jeżeli nie posiadasz konta, wybierz opcję \"zarejestruj się\" lub pomiń zakładanie konta klikając na \"złóż zamówienie\"; pamiętaj, że rejestracja pozwoli Ci korzystać z wielu przywilejów, w tym:</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\">- podgląd statusu realizacji zamówień oraz historii zakupów,</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\">- brak konieczności ponownego wprowadzania danych przy kolejnych zakupach,</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\">- możliwość otrzymywania indywidualnych rabatów i kuponów promocyjnych.</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\">Wprowadź Twoje imię i nazwisko oraz informacje teleadresowe,</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\">Aby zamówienie wysłać na inny adres, zaznacz \"inny adres wysyłki\" i podaj odpowiednie dane,</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\">Ewentualne dodatkowe informacje o realizacji zamówienia umieść w polu \"uwagi\"</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\">Po kliknięciu na \"Podsumowanie\" zobaczysz komplet podanych przez Ciebie informacji,</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\">Kliknięcie na przycisku \"Złóż zamówienie\" oznacza potwierdzenie zakupu,</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\">Odbierz wiadomość email i kliknij na link potwierdzający złożenie zamówienia.</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\"> </p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\">Pamiętaj, że zarejestrowani klienci mogą w swoim koncie śledzić status realizacji złożonych zamówień.</p>','jak-kupowac'),(17,1,1,'O sklepie','','','','','o-sklepie'),(17,2,1,'O sklepie','Geekup - O sklepie','Geekup - O sklepie','','<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\"><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">GeekUP.pl</span> to sklep internetowy dla wszystkich popkulturowych maniaków :) Staramy się stworzyć miejsce dla ludzi zafascynowanych światem filmów, seriali, bajek, komiksów i gier. Mówiąc krótko miejsce gdzie każdy GEEK znajdzie coś dla siebie. W sklepie oferujemy rozmaite <span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">gadżety filmowe</span>, począwszy od zwykłych produktów codziennego użytku kończąc na replikach i figurkach twoich ulubionych bohaterów. Zależy Nam aby fan nawet niezbyt popularnego serialu czy filmu mógł u Nas znależć coś dla siebie. Nie każdy musi być przecież fanem Star Wars - choć chyba powinien :). </p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\"> </p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\">Cały czas się rozwijamy, regularnie dodajemy na sklep nowe produkty więc warto Nas odwiedzać. Jeżeli macie jakiś problem, chcielibyście o coś zapytać czy macie jakiś pomysł to śmiało do Nas piszcie! Mamy nadzieję, że zakupy w Naszym sklepie będą dla Was samą przyjemnością :).</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\"> </p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\"><span style=\"margin:0px;padding:0px;border:0px;font-size:10pt;background:transparent;font-family:verdana, geneva;\">Naszą rzetelność potwierdzają komentarze w serwisie Opineo.</span></p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\"> </p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\"><span style=\"margin:0px;padding:0px;border:0px;background:transparent;color:#ff0000;\"><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\"><span style=\"margin:0px;padding:0px;border:0px;font-size:10pt;background:transparent;font-family:verdana, geneva;\">UWAGA! Aktualnie nie prowadzimy sprzedaży stacjonarnej w siedzibie firmy.</span></span></span></p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\"> </p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\"><span style=\"margin:0px;padding:0px;border:0px;font-size:10pt;background:transparent;font-family:verdana, geneva;\">W razie jakichkolwiek pytań lub wątpliwości zapraszamy do kontaktu z nami poprzez <span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\"><a href=\"../kontakt\" style=\"margin:0px;padding:0px;border:0px;background:transparent;color:#f6a802;\">formularz kontaktowy</a></span>, pod adresem email <span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">sklep@geekup.pl</span> lub telefonicznie pod numerem <span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">533121806</span>.</span></p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\"> </p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\"><span style=\"margin:0px;padding:0px;border:0px;font-size:10pt;background:transparent;font-family:verdana, geneva;\"><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">Serdecznie zapraszamy!</span></span></p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\"><span style=\"margin:0px;padding:0px;border:0px;font-size:10pt;background:transparent;font-family:verdana, geneva;\"><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">Załoga sklepu<br /></span><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">GeekUp.pl - Figurki Funko POP, gadżety filmowe, gadżety z gier, komiksów i bajek</span></span></p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\"><span style=\"margin:0px;padding:0px;border:0px;font-size:10pt;background:transparent;font-family:verdana, geneva;\"><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\"> </span></span></p>','o-sklepie'),(18,1,1,'Sprzedaż hurtowa','','','','','sprzedaz-hurtowa'),(18,2,1,'Sprzedaż hurtowa','Geekup - Sprzedaż hurtowa','Geekup - Sprzedaż hurtowa','','<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\"><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">Oferta hurtowa Funko POP!</span> oraz innych licencjonwanych gadżetów i akcesoriów ze świata filmu, seriali, komiksów i gier.</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\">Wychodząc na przeciw oczekiwaniom klientów oferujemy zakupy hurtowe B2B w naszym sklepie.</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\">Aby otrzymać dedykowaną ofertą z cennikiem hurtowym prosimy o rejestrację w naszym sklepie internetowym podając dane firmowe i <span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">wysłaniu maila z prośbą o cennik na sklep@geekup.pl.</span> <span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">Rabaty w niektórych przypadkach sięgają nawet 60%.</span></p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\">Sprzedaż hurtowa dotyczy wybranych pozycji z naszej oferty.</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\">Minimalne zamówienie - 500 zł netto.</p>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:14px;background:#ffffff;font-family:Montserrat, sans-serif;\"><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">Wysyłka gratis! Zapraszamy do kontaktu.</span></p>','sprzedaz-hurtowa');
