INSERT INTO `ps_info_lang` VALUES (1,1,1,'<h2>Custom Text Block</h2>\r\n<p><strong class=\"dark\">Lorem ipsum dolor sit amet conse ctetu</strong></p>\r\n<p>Sit amet conse ctetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit.</p>'),(1,1,2,'<p style=\"margin: 0px; padding: 0px; border: 0px; outline: none 0px; font-size: 13px; background: #ffffff; font-weight: 400; line-height: 25px; font-family: \'Open Sans\', sans-serif; color: #41464b;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: none 0px; background: transparent; font-weight: bold;\">GeekUP.pl </span>to sklep internetowy skierowany do wszystkich fanów szeroko rozumianej popkultury. Od ponad 7 lat tworzymy miejsce pełne geekowych gadżetów ze świata filmów, seriali, gier, komiksów oraz anime. Ogromną część naszej oferty stanowią <span style=\"margin: 0px; padding: 0px; border: 0px; outline: none 0px; background: transparent; font-weight: bold;\">figurki Funko POP</span>, które już od lat są fenomen na rynku figurek kolekcjonerskich. Znajdziesz u nas większość nowych kolekcji, w tym niedostępne w innych miejscach <span style=\"margin: 0px; padding: 0px; border: 0px; outline: none 0px; background: transparent; font-weight: bold;\">figurki Exclusive</span>, <span style=\"margin: 0px; padding: 0px; border: 0px; outline: none 0px; background: transparent; font-weight: bold;\">Special Edition</span> oraz <span style=\"margin: 0px; padding: 0px; border: 0px; outline: none 0px; background: transparent; font-weight: bold;\">Chase Limited Edition</span>.</p>\r\n<p style=\"margin: 0px; padding: 0px; border: 0px; outline: none 0px; font-size: 13px; background: #ffffff; font-weight: 400; line-height: 25px; font-family: \'Open Sans\', sans-serif; color: #41464b;\"> </p>\r\n<p style=\"margin: 0px; padding: 0px; border: 0px; outline: none 0px; font-size: 13px; background: #ffffff; font-weight: 400; line-height: 25px; font-family: \'Open Sans\', sans-serif; color: #41464b;\">Nasz <span style=\"margin: 0px; padding: 0px; border: 0px; outline: none 0px; background: transparent; font-weight: bold;\">geek sklep </span>to jednak nie tylko figurki. <span style=\"margin: 0px; padding: 0px; border: 0px; outline: none 0px; background: transparent; font-weight: bold;\">Repliki filmowe z Harrego Pottera</span>, <span style=\"margin: 0px; padding: 0px; border: 0px; outline: none 0px; background: transparent; font-weight: bold;\">gadżety z Wiedźmina</span>, komiksowe akcesoria i <span style=\"margin: 0px; padding: 0px; border: 0px; outline: none 0px; background: transparent; font-weight: bold;\">upominki dla fana Marvela</span> czy <span style=\"margin: 0px; padding: 0px; border: 0px; outline: none 0px; background: transparent; font-weight: bold;\">galaktyczne gadżety Star Wars Gwiezdne Wojny. </span>Nieważne czy jesteś fanem Ricka i Mortiego, Dragon Ball Z czy Władcy Pierścieni - na pewno znajdziesz u nas coś dla siebie. A jeżeli wybór jest dla Ciebie trudny i lubisz większość tematyk z popkulturowego uniwersum to strzałem w dziesiątkę może się okazać <span style=\"margin: 0px; padding: 0px; border: 0px; outline: none 0px; background: transparent; font-weight: bold;\">Pudełko Niespodzianka GeekUP!</span> czy <span style=\"margin: 0px; padding: 0px; border: 0px; outline: none 0px; background: transparent; font-weight: bold;\">Mystery Box Funko POP!</span>.</p>\r\n<p style=\"margin: 0px; padding: 0px; border: 0px; outline: none 0px; font-size: 13px; background: #ffffff; font-weight: 400; line-height: 25px; font-family: \'Open Sans\', sans-serif; color: #41464b;\"> </p>\r\n<p style=\"margin: 0px; padding: 0px; border: 0px; outline: none 0px; font-size: 13px; background: #ffffff; font-weight: 400; line-height: 25px; font-family: \'Open Sans\', sans-serif; color: #41464b;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: none 0px; font-size: 10pt; background: transparent; line-height: 25px;\">Cały czas się rozwijamy, regularnie sprowadzamy do sklepu nowe produkty, więc warto nas stale odwiedzać. Jeżeli macie jakiś problem, chcielibyście o coś zapytać lub wpadliście na jakiś pomysł, śmiało do nas piszcie! Mamy nadzieję, że zakupy w naszym sklepie będą dla Was samą przyjemnością :)</span></p>');
/*!40000 ALTER TABLE `ps_info_lang` ENABLE KEYS */;
UNLOCK TABLES;

