INSERT INTO `ps_product_lang` VALUES (684,1,1,'<div class=\"resetcss\" itemprop=\"description\"><p><strong>Mystery POP! Marvel Box x 6 to idealny pomysł na rozszerzenie swojej kolekcji figurek z serii Marvel Comics.</strong></p>\n<p>Jeżeli lubisz niespodzianki to Mystery POP! Box może być dla Ciebie fajnym rozwiązaniem :). Dostaniesz od nas jedynie oryginalne, w pełni nowe i nieuszkodzone figurki Marvel Funko POP.</p>\n<p><strong>Mystery bo zawiera 6 losowych figurek Funko POP! z serii MARVEL (w tym co najmniej jedną limitowaną figurkę, mogą to być naklejki Special Edition, Exclusive, Limited Edition czy CHASE).</strong></p>\n<p>W tym zestawie koszt figurki Marvel to <span style=\"color: #ff6600;\"><strong>tylko 33 zł za sztukę! </strong></span> W tej kwocie trudno o znalezienie lepszej oferty, normalna cena figurek Funko jest sporo wyższa.</p>\n<p> </p>\n<p><strong>Dlaczego warto:</strong></p>\n<p>- tylko oryginalne figurki Funko POP! Marvel</p>\n<p>- co najmniej jedną figurę ze specjalnej serii</p>\n<p>- wartość rynkowa figurek w środku jest wyższa od ceny boxu o kilkadziesiąt procent!</p>\n<p>- świetna zabawa i gwarantowany dreszczyk emocji przy otwieraniu</p>\n<p> </p>\n<p>Idealny pomysł na prezent dla fana Figurek Funko POP!, a w szczególności uniwersum Marvel Comics.</p>\n<div id=\"spoon-plugin-kncgbdglledmjmpnikebkagnchfdehbm-2\" style=\"display: none;\"> </div></div>','','Mystery-Box-MARVEL-Exclusive-Figurka-Niespodzianka-Funko-POP-x-6','','','','Mystery Box MARVEL Exclusive Figurka Niespodzianka Funko POP x 6','Produkt dostępny','','24 godziny',''),(684,1,2,'<div class=\"resetcss\" itemprop=\"description\"><p><strong>Mystery POP! Marvel Box x 6 to idealny pomysł na rozszerzenie swojej kolekcji figurek z serii Marvel Comics.</strong></p>\n<p>Jeżeli lubisz niespodzianki to Mystery POP! Box może być dla Ciebie fajnym rozwiązaniem :). Dostaniesz od nas jedynie oryginalne, w pełni nowe i nieuszkodzone figurki Marvel Funko POP.</p>\n<p><strong>Mystery bo zawiera 6 losowych figurek Funko POP! z serii MARVEL (w tym co najmniej jedną limitowaną figurkę, mogą to być naklejki Special Edition, Exclusive, Limited Edition czy CHASE).</strong></p>\n<p>W tym zestawie koszt figurki Marvel to <span style=\"color: #ff6600;\"><strong>tylko 33 zł za sztukę! </strong></span> W tej kwocie trudno o znalezienie lepszej oferty, normalna cena figurek Funko jest sporo wyższa.</p>\n<p> </p>\n<p><strong>Dlaczego warto:</strong></p>\n<p>- tylko oryginalne figurki Funko POP! Marvel</p>\n<p>- co najmniej jedną figurę ze specjalnej serii</p>\n<p>- wartość rynkowa figurek w środku jest wyższa od ceny boxu o kilkadziesiąt procent!</p>\n<p>- świetna zabawa i gwarantowany dreszczyk emocji przy otwieraniu</p>\n<p> </p>\n<p>Idealny pomysł na prezent dla fana Figurek Funko POP!, a w szczególności uniwersum Marvel Comics.</p>\n<div id=\"spoon-plugin-kncgbdglledmjmpnikebkagnchfdehbm-2\" style=\"display: none;\"> </div></div>','','mystery-box-marvel-exclusive-figurka-niespodzianka-funko-pop-x-6','','','','Mystery Box MARVEL Exclusive Figurka Niespodzianka Funko POP x 6','','','',''),(685,1,1,'<div class=\"resetcss\" itemprop=\"description\"><p><span style=\"font-size: 12pt;\"><strong>Mystery Funko POP! Box x 6 to Idealny box na poszerzenie kolekcji Funko POP! lub rozpoczęcie przygody z kolekcjonowaniem. Figurki Funko świetnie prezentują się na półce z książkami czy biurku.</strong></span></p>\n<p><span style=\"font-size: 12pt;\"> </span></p>\n<p><span style=\"font-size: 12pt;\">W tym zestawie koszt figurki to mniej niż <span style=\"color: #ff6600;\"><strong>26</strong><strong> zł za sztukę!</strong></span> Normalna cena figurek POP to mniej więcej 60-70 zł za sztukę.</span></p>\n<p><span style=\"font-size: 12pt;\">Jeżeli lubisz niespodzianki to Mystery POP! Box może być dla Ciebie fajnym rozwiązaniem.</span></p>\n<p><span style=\"font-size: 12pt;\">Dostaniesz od nas <strong>6 losowych figurek Funko POP! (figurki są nowe i bez wad). </strong></span></p>\n<p><span style=\"font-size: 12pt;\">W środku znajdziesz <strong>minimum jedną figurkę w pudełku z naklejką z serii Exclusive/ Limited Edition/ Art Series/ Speciality Series/ Chase itp.</strong></span></p>\n<p><span style=\"font-size: 12pt;\">W tym boxie, sporadycznie mogą znaleźć się figurki, których opakowania mogą być lekko uszkodzone (są to pojedyncze przypadki i zazwyczaj jest to jedna figurka). Wiele opinii klientów jest takich, że uszkodzenia pudełek w tym mystery boxie są minimalne lub nie ma ich wcale.</span></p>\n<p> </p>\n<p><span style=\"font-size: 12pt;\">Sprawdź opinie naszych klientów - 99% pozytywnych opini! (zakładka \"Opinie o produkcie\" znajdująca się powyżej).</span></p>\n<div id=\"spoon-plugin-kncgbdglledmjmpnikebkagnchfdehbm-2\" style=\"display: none;\"><span style=\"font-size: 12pt;\"> </span></div></div>','','6-x-Funko-POP-Mystery-Box-Figurka-Niespodzianka','','','','6 x Funko POP! Mystery Box Figurka Niespodzianka','Produkt dostępny','','24 godziny',''),(685,1,2,'<div class=\"resetcss\" itemprop=\"description\"><p><span style=\"font-size: 12pt;\"><strong>Mystery Funko POP! Box x 6 to Idealny box na poszerzenie kolekcji Funko POP! lub rozpoczęcie przygody z kolekcjonowaniem. Figurki Funko świetnie prezentują się na półce z książkami czy biurku.</strong></span></p>\n<p><span style=\"font-size: 12pt;\"> </span></p>\n<p><span style=\"font-size: 12pt;\">W tym zestawie koszt figurki to mniej niż <span style=\"color: #ff6600;\"><strong>26</strong><strong> zł za sztukę!</strong></span> Normalna cena figurek POP to mniej więcej 60-70 zł za sztukę.</span></p>\n<p><span style=\"font-size: 12pt;\">Jeżeli lubisz niespodzianki to Mystery POP! Box może być dla Ciebie fajnym rozwiązaniem.</span></p>\n<p><span style=\"font-size: 12pt;\">Dostaniesz od nas <strong>6 losowych figurek Funko POP! (figurki są nowe i bez wad). </strong></span></p>\n<p><span style=\"font-size: 12pt;\">W środku znajdziesz <strong>minimum jedną figurkę w pudełku z naklejką z serii Exclusive/ Limited Edition/ Art Series/ Speciality Series/ Chase itp.</strong></span></p>\n<p><span style=\"font-size: 12pt;\">W tym boxie, sporadycznie mogą znaleźć się figurki, których opakowania mogą być lekko uszkodzone (są to pojedyncze przypadki i zazwyczaj jest to jedna figurka). Wiele opinii klientów jest takich, że uszkodzenia pudełek w tym mystery boxie są minimalne lub nie ma ich wcale.</span></p>\n<p> </p>\n<p><span style=\"font-size: 12pt;\">Sprawdź opinie naszych klientów - 99% pozytywnych opini! (zakładka \"Opinie o produkcie\" znajdująca się powyżej).</span></p>\n<div id=\"spoon-plugin-kncgbdglledmjmpnikebkagnchfdehbm-2\" style=\"display: none;\"><span style=\"font-size: 12pt;\"> </span></div></div>','','6-x-funko-pop-mystery-box-figurka-niespodzianka','','','','6 x Funko POP! Mystery Box Figurka Niespodzianka','','','',''),(686,1,1,'<div class=\"resetcss\" itemprop=\"description\"><p><strong>Mystery Funko POP! Box - co to jest :)?</strong></p>\r\n<p>Jeżeli lubisz niespodzianki to Mystery POP! Box może być dla Ciebie fajnym rozwiązaniem :). </p>\r\n<p>Dostaniesz od nas 1 losową figurkę Funko POP!.</p>\r\n<p>Wszystkie figurki są w nowe i oryginalne.</p>\r\n<p> </p>\r\n<p><strong>Dlaczego warto?</strong></p>\r\n<p>- super niespodzianka</p>\r\n<p>- gwarancja otrzymania figurki, której nie masz w kolekcji (przy zakupie prosimy o informację jakie figurki już posiadasz - pole \"Uwagi\" przy formularzu adresowym)</p>\r\n<p>- przy zamówieniu kilku sztuk na pewno nie otrzymasz takich samych figurek</p>\r\n<p> </p>\r\n<div id=\"spoon-plugin-kncgbdglledmjmpnikebkagnchfdehbm-2\" style=\"display: none;\"> </div></div>','','Mystery-Funko-POP-Box-Figurka-Niespodzianka','','','','Mystery Funko POP Box Figurka Niespodzianka','Produkt dostępny','','24 godziny',''),(686,1,2,'<div class=\"resetcss\" itemprop=\"description\"><p><strong>Mystery Funko POP! Box - co to jest :)?</strong></p>\r\n<p>Jeżeli lubisz niespodzianki to Mystery POP! Box może być dla Ciebie fajnym rozwiązaniem :). </p>\r\n<p>Dostaniesz od nas 1 losową figurkę Funko POP!.</p>\r\n<p>Wszystkie figurki są w nowe i oryginalne.</p>\r\n<p> </p>\r\n<p><strong>Dlaczego warto?</strong></p>\r\n<p>- super niespodzianka</p>\r\n<p>- gwarancja otrzymania figurki, której nie masz w kolekcji (przy zakupie prosimy o informację jakie figurki już posiadasz - pole \"Uwagi\" przy formularzu adresowym)</p>\r\n<p>- przy zamówieniu kilku sztuk na pewno nie otrzymasz takich samych figurek</p>\r\n<p> </p>\r\n<div id=\"spoon-plugin-kncgbdglledmjmpnikebkagnchfdehbm-2\" style=\"display: none;\"> </div></div>','','mystery-funko-pop-box-figurka-niespodzianka','','','','Mystery Funko POP Box Figurka Niespodzianka','','','',''),(687,1,1,'<div class=\"resetcss\" itemprop=\"description\"><p><strong>Czym jest MEGA Mystery Box MARVEL GeekUP! ?</strong></p>\n<p><br/><strong>Mega Mystery Box MARVEL</strong> to nowa, ulepszona wersja naszego podstawowego pudełka niespodzianki GeekUP. W tym boxie jest po prostu wszystkiego więcej! Znajdziesz w nim <strong>co najmniej 6 geekowych produktów tylko z uniwersum MARVELA!</strong></p>\n<p><br/><strong>Dlaczego warto?</strong></p>\n<p><br/>- Każde pudełko niespodzianka zawiera produkty, których łączna wartość detaliczna <strong>przekracza granicę 219 zł</strong> o minimum kilkadziesiąt procent! </p>\n<p>- <strong>Mystery Box to super prezent dla fana uniwersum MARVEL</strong>. Gotowy, ładnie zapakowany zestaw, w którym każdy fan znajdzie coś dla siebie. Otwierając pudełko nie mamy pojęcia co znajduje się w środku, co dodatkowo podnosi poziom ekscytacji. </p>\n<p>- W boxie znajdują się tylko <strong>gadżety na licencji MARVEL </strong>(mogą to być figurki, kubki, breloczki itp.)</p>\n<p>- Co najmniej jedna figurka <strong>Funko POP! MARVEL ze specjalnej serii Exclusive, Special Edition lub CHASE!</strong></p>\n<p>- Nie musisz czekać! Boxy wysyłamy w maksymalnie 24 godziny.</p>\n<p>- Wszystkie gadżety są w 100% nowe, licencjonowane i w oryginalnych opakowaniach.</p></div>','','Prezent-Gadety-MARVEL-Pudeko-Niespodzianka-Mystery-Box','','','','Prezent Gadżety MARVEL Pudełko Niespodzianka Mystery Box','Produkt dostępny','','24 godziny',''),(687,1,2,'<div class=\"resetcss\" itemprop=\"description\"><p><strong>Czym jest MEGA Mystery Box MARVEL GeekUP! ?</strong></p>\n<p><br/><strong>Mega Mystery Box MARVEL</strong> to nowa, ulepszona wersja naszego podstawowego pudełka niespodzianki GeekUP. W tym boxie jest po prostu wszystkiego więcej! Znajdziesz w nim <strong>co najmniej 6 geekowych produktów tylko z uniwersum MARVELA!</strong></p>\n<p><br/><strong>Dlaczego warto?</strong></p>\n<p><br/>- Każde pudełko niespodzianka zawiera produkty, których łączna wartość detaliczna <strong>przekracza granicę 219 zł</strong> o minimum kilkadziesiąt procent! </p>\n<p>- <strong>Mystery Box to super prezent dla fana uniwersum MARVEL</strong>. Gotowy, ładnie zapakowany zestaw, w którym każdy fan znajdzie coś dla siebie. Otwierając pudełko nie mamy pojęcia co znajduje się w środku, co dodatkowo podnosi poziom ekscytacji. </p>\n<p>- W boxie znajdują się tylko <strong>gadżety na licencji MARVEL </strong>(mogą to być figurki, kubki, breloczki itp.)</p>\n<p>- Co najmniej jedna figurka <strong>Funko POP! MARVEL ze specjalnej serii Exclusive, Special Edition lub CHASE!</strong></p>\n<p>- Nie musisz czekać! Boxy wysyłamy w maksymalnie 24 godziny.</p>\n<p>- Wszystkie gadżety są w 100% nowe, licencjonowane i w oryginalnych opakowaniach.</p></div>','','prezent-gadzety-marvel-pudelko-niespodzianka-mystery-box','','','','Prezent Gadżety MARVEL Pudełko Niespodzianka Mystery Box','','','',''),(688,1,1,'<div class=\"resetcss\" itemprop=\"description\"><p><strong>Mystery POP! Box x 6 - co to jest :)?</strong></p>\n<p>Jeżeli lubisz niespodzianki to Mystery POP! Box może być dla Ciebie fajnym rozwiązaniem :).</p>\n<p>Dostaniesz od nas <strong>6 losowych figurek Funko POP! (w tym co najmniej jedną figurkę z serii <span style=\"background-color: #ffffff; color: #ff6600;\">Exclusive - Special Edition lub CHASE! - </span><span style=\"color: #000000;\">wartośc takiej figurki jest dużo wyższa</span>).</strong></p>\n<p><span style=\"font-size: 12pt;\">W tym zestawie koszt figurki to <span style=\"color: #ff6600;\"><strong>niecałe 29 zł za sztukę!</strong></span> Normalna cena figurek POP to mniej więcej 50-70 zł za sztukę.</span></p>\n<p><strong>Poniżej sprawdzisz opinie o naszym mystery boxie - 99% zadowolonych klientów!</strong></p>\n<p> </p>\n<p>Wszystkie figurki są w nowe i oryginalne. Pudełka nie posiadają żadnych uszkodzeń.</p>\n<p>Przy zamówieniu więcej niż jednej sztuki masz pewność, że nie otrzymasz powtórek.</p>\n<p>Wartość figurek w boxie przekracza wartość rynkową o co najmniej kilkadziesiąt procent!</p>\n<p>Ciekawy pomysł na prezent dla fana Funko POP.</p>\n<div id=\"spoon-plugin-kncgbdglledmjmpnikebkagnchfdehbm-2\" style=\"display: none;\"> </div></div>','','Mystery-Box-Funko-POP-Figurka-Niespodzianka-6-Figurek','','','','Mystery Box Funko POP Figurka Niespodzianka 6 Figurek','Produkt dostępny','','24 godziny',''),(688,1,2,'<div class=\"resetcss\" itemprop=\"description\"><p><strong>Mystery POP! Box x 6 - co to jest :)?</strong></p>\n<p>Jeżeli lubisz niespodzianki to Mystery POP! Box może być dla Ciebie fajnym rozwiązaniem :).</p>\n<p>Dostaniesz od nas <strong>6 losowych figurek Funko POP! (w tym co najmniej jedną figurkę z serii <span style=\"background-color: #ffffff; color: #ff6600;\">Exclusive - Special Edition lub CHASE! - </span><span style=\"color: #000000;\">wartośc takiej figurki jest dużo wyższa</span>).</strong></p>\n<p><span style=\"font-size: 12pt;\">W tym zestawie koszt figurki to <span style=\"color: #ff6600;\"><strong>niecałe 29 zł za sztukę!</strong></span> Normalna cena figurek POP to mniej więcej 50-70 zł za sztukę.</span></p>\n<p><strong>Poniżej sprawdzisz opinie o naszym mystery boxie - 99% zadowolonych klientów!</strong></p>\n<p> </p>\n<p>Wszystkie figurki są w nowe i oryginalne. Pudełka nie posiadają żadn