>Jak na zdjęciu.</span> </p>\n<p><span style=\"font-size: small;\"><strong>Mega pomysł na prezent dla każdego fana serii filmów Star Wars - Gwiezdne Wojny. Sprawdź także pozostałe figurki Funko POP! dostępne w sklepie GeekUP.</strong></span></p></div>','','figurka-star-wars-mandalorian-bo-katan-kryze-with-throne-15-cm','','','','Figurka Star Wars Mandalorian Bo Katan Kryze with Throne 15 cm','','','',''),(1213,1,1,'<div class=\"resetcss\" itemprop=\"description\"><p class=\"p1\"><strong>Hasbro Star Wars The Black Series - Miecz świetlny Darth Revan Force FX Elite.</strong></p>\n<ul class=\"ul1\">\n<li class=\"li3\">Producent: Hasbro</li>\n<li class=\"li3\">Przedział wiekowy: Od 14 lat</li>\n<li class=\"li3\">Płeć: Chłopiec, Dziewczynka</li>\n<li class=\"li3\">Efekty: Świetlne, Dźwiękowe</li>\n<li class=\"li3\">Baterie: 3 x AA/LR6 (brak w zestawie)</li>\n<li class=\"li3\">Wymiary: ok. 100 cm (całkowita długość miecza)</li>\n<li class=\"li3\">Waga: 2,50 kg</li>\n</ul>\n<p class=\"p3\"><strong>Star Wars The Black Series</strong> jest ekskluzywną kolekcją akcesoriów ze świata Gwiezdnych Wojen. To właśnie dzięki mieczom świetlnym z tej serii fani Star Wars mogą wyobrazić sobie największe pojedynki Jedi.</p>\n<p class=\"p3\">Miecz świetlny Darth Revan Force FX Elite to elitarne ostrze wyposażone w zaawansowaną technologię LED i inspirowane filmami realistyczne efekty dźwiękowe.</p>\n<p class=\"p3\">Darth Revan Lightsaber jest najbardziej realistycznym mieczem świetlnym Force FX, jaki znajdziecie w całej kolekcji Hasbro Star Wars.</p>\n<p class=\"p3\">Dzięki wyjątkowym funkcjom miecz Force FX Elite jest uosobieniem najwyższej jakości i ponadprzeciętnego realizmu. Użyj przełącznika i przycisku na rękojeści, aby aktywować niesamowite efekty dźwiękowe i świetlne.</p>\n<p class=\"p3\">Stojak na lightsaber pozwoli ci z dumą prezentować miecz w gablocie kolekcjonerskiej.</p>\n<p class=\"p3\"><strong>Zawartość opakowania:</strong></p>\n<ul class=\"ul1\">\n<li class=\"li3\">1 x miecz świetlny</li>\n<li class=\"li3\">1 x stojak</li>\n<li class=\"li3\">1 x kryształ kyber</li>\n<li class=\"li3\">1 x pierścień</li>\n<li class=\"li3\">1 x narzędzie do zdejmowania pierścienia</li>\n<li class=\"li3\">instrukcja</li>\n</ul>\n<p class=\"p3\"><strong>Cechy produktu:</strong></p>\n<ul class=\"ul1\">\n<li class=\"li3\">światła LED</li>\n<li class=\"li3\">ostrze świeci na fioletowo i czerwono.</li>\n<li class=\"li3\">realistyczne efekty dźwiękowe</li>\n<li class=\"li3\">efekty uruchamiane za pomocą przycisków i za pomocą czujnika ruchu</li>\n<li class=\"li3\">dźwiękowy efekt przy włączaniu i wyłączaniu</li>\n<li class=\"li3\">duel effect - dźwiękowy efekt starcia w pojedynku</li>\n<li class=\"li3\">blaster deflect effect - extra wizualne i dźwiękowe efekty w różnych miejscach na ostrzu</li>\n<li class=\"li3\">molten blade tip effect - wizualny i dźwiękowy efekt z rozjarzoną końcówką miecza</li>\n<li class=\"li3\">battle clash effect - wizualny i dźwiękowy efekt sparowania w pojedynku</li>\n<li class=\"li3\">odłączane ostrze</li>\n<li class=\"li3\">wyjmowany kryształ kyber</li>\n<li class=\"li3\">rękojeść z prawdziwego metalu</li>\n<li class=\"li3\">reprezentacyjny stojak na miecz</li>\n</ul>\n<p> </p>\n<p>Zewnętrzne opakowanie może zawierać małe niedoskonałości (lekkie wzgniecenie/rozdarcie).</p></div>','','Replika-Miecz-wietlny-Darth-Revan-Star-Wars-Hasbro-Force-FX-Elite-Lightsaber-Black-Series-11','','','','Replika Miecz Świetlny Darth Revan Star Wars Hasbro Force FX Elite Lightsaber Black Series 1/1','Ostatnia sztuka!','','24 godziny',''),(1213,1,2,'<div class=\"resetcss\" itemprop=\"description\"><p class=\"p1\"><strong>Hasbro Star Wars The Black Series - Miecz świetlny Darth Revan Force FX Elite.</strong></p>\n<ul class=\"ul1\">\n<li class=\"li3\">Producent: Hasbro</li>\n<li class=\"li3\">Przedział wiekowy: Od 14 lat</li>\n<li class=\"li3\">Płeć: Chłopiec, Dziewczynka</li>\n<li class=\"li3\">Efekty: Świetlne, Dźwiękowe</li>\n<li class=\"li3\">Bateri